the next day to read it in the Gulf Mercury. There was a line of type operator who worked at the Mercury. He devised a contraption on top of the Bell Building called the Paragon Scoreboard.',NULL),(57376,78,'https://archive.cfru.ca/archive/2023/04/21/Morning Soul Shake-Up! - April 21, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-21 08:00:00',86507648,NULL,NULL,NULL),(57377,79,'https://archive.cfru.ca/archive/2023/05/08/Breezy Breakfast Radio - May 8, 2023 at 09:00 - CFRU 93.3.mp3','2023-05-08 09:00:00',86507648,'2023-10-26 05:58:22','Breezy Breakfast Radio Hour is back for May Day. This week we are joined by two special local guests. Barney Dartner who brings us back to the 1900s describing the colorful characters of Guelph\'s past. Brian Holstein regales us with the tale of work and play in the time before radio.',NULL),(57378,78,'https://archive.cfru.ca/archive/2023/04/20/Morning Soul Shake-Up! - April 20, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-20 08:00:00',86507648,NULL,NULL,NULL),(57379,79,'https://archive.cfru.ca/archive/2023/05/01/Breezy Breakfast Radio - May 1, 2023 at 10:00 - CFRU 93.3.mp3','2023-05-01 10:00:00',86507648,'2023-10-26 05:55:33','\"It\'s just my life,\" says a fox. \"I don\'t think I know that\" \"I\'m coming out at night\" \"Let\'s make this easy\" \"How am I supposed to feel?\"',NULL),(57380,78,'https://archive.cfru.ca/archive/2023/04/19/Morning Soul Shake-Up! - April 19, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-19 08:00:00',86507648,NULL,NULL,NULL),(57381,79,'https://archive.cfru.ca/archive/2023/05/01/Breezy Breakfast Radio - May 1, 2023 at 09:00 - CFRU 93.3.mp3','2023-05-01 09:00:00',86507648,'2023-10-26 05:53:19','Breezy Breakfast is back with a new host and a new set of hosts. This week\'s topic is Guelph\'s 200th birthday in 2027. Donna Evans, General Manager of Culture and Recreation, outlines plans for the celebration. The Rowdy Breakfisters offer their suggestions for the best celebration.',NULL),(57382,78,'https://archive.cfru.ca/archive/2023/04/18/Morning Soul Shake-Up! - April 18, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-18 08:00:00',86507648,NULL,NULL,NULL),(57383,79,'https://archive.cfru.ca/archive/2023/04/24/Breezy Breakfast Radio - April 24, 2023 at 10:00 - CFRU 93.3.mp3','2023-04-24 10:00:00',86507648,'2023-10-26 05:50:28','Kaya is the youngest member of COVID, a group of teen activists. Kaya says her name means roots to rewards, which she loves. She says being outside makes you happy and it relieves stress and connects you to nature.',NULL),(57384,78,'https://archive.cfru.ca/archive/2023/04/17/Morning Soul Shake-Up! - April 17, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-17 08:00:00',86507648,NULL,NULL,NULL),(57385,79,'https://archive.cfru.ca/archive/2023/04/24/Breezy Breakfast Radio - April 24, 2023 at 09:00 - CFRU 93.3.mp3','2023-04-24 09:00:00',86507648,'2023-10-26 05:47:39','Breezy Breakfast Earth Day episode. We hear from four organizations that are working to meet Guelph\'s one tree canopy goals. Cuyah Mason Weatherill is the youth activist behind the newly established Roots to Rewards, a organization dedicated to planting more trees.',NULL),(57386,78,'https://archive.cfru.ca/archive/2023/04/14/Morning Soul Shake-Up! - April 14, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-14 08:00:00',86507648,NULL,NULL,NULL),(57387,79,'https://archive.cfru.ca/archive/2023/04/17/Breezy Breakfast Radio - April 17, 2023 at 10:00 - CFRU 93.3.mp3','2023-04-17 10:00:00',86507648,'2023-10-26 05:44:54','Randy, I\'m really looking forward to getting to hear your evaluation speech at the district level on April the 21st. English is the language you must use for your speech. You have to be, it has to be in English, but you ca ca.',NULL),(57388,78,'https://archive.cfru.ca/archive/2023/04/13/Morning Soul Shake-Up! - April 13, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-13 08:00:00',86507648,NULL,NULL,NULL),(57390,79,'https://archive.cfru.ca/archive/2023/04/17/Breezy Breakfast Radio - April 17, 2023 at 09:00 - CFRU 93.3.mp3','2023-04-17 09:00:00',86507648,'2023-10-26 05:41:50','Toastmasters International has been in continuous operation for 99 years. Currently in 144 countries around the world, with more than 280,000 members. Toastmasters has helped millions become better speakers and leaders.',NULL),(57391,78,'https://archive.cfru.ca/archive/2023/04/12/Morning Soul Shake-Up! - April 12, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-12 08:00:00',86638720,NULL,NULL,NULL),(57393,79,'https://archive.cfru.ca/archive/2023/04/10/Breezy Breakfast Radio - April 10, 2023 at 10:00 - CFRU 93.3.mp3','2023-04-10 10:00:00',86507648,'2023-10-26 05:39:12','Aaron Carroll: It\'s really important to understand what we could and could not do. Aaron Carroll: I think that the conditions that were put in place for good and it was good enough to say yes, so long as then we can pledge to this. It is a huge amount of residences that they want us to build.',NULL),(57394,78,'https://archive.cfru.ca/archive/2023/04/11/Morning Soul Shake-Up! - April 11, 2023 at 08:00 - CFRU 93.3.mp3','2023-04-11 08:00:00',86507648,NULL,NULL,NULL),(57396,79,'https://archive.cfru.ca/archive/2023/04/10/Breezy Breakfast Radio - April 10, 2023 at 09:00 - CFRU 93.3.mp3','2023-04-10 09:00:00',86638720,'2023-10-26 05:36:22','Bill 23 was introduced on October 25th and passed on November 28th. The More Homes Built Faster Act purports to increase the number of affordable housing units. However, the definition of affordable is no longer related to income, but rather the market value. Bill 23 decreases development, community benefit and parkland dedication charges.',NULL),(57398,79,'https://archive.cfru.ca/archive/2023/04/03/Breezy Breakfast Radio - April 3, 2023 at 10:00 - CFRU 93.3.mp3','2023-04-03 10:00:00',86638720,'2023-10-26 05:33:45','Aaron Carroll: \"As much as I didn\'t like it, I took the pill because there was sugar on it, but there are so many issues that are outstanding\" \"We haven\'t even really begun to talk about issues associated with floodplain, with conservation authorities, with environmental concerns\" \"I think that the other thing that we need to do is to make sure that the residents that they want us to build in a short amount of time\"',NULL),(57400,79,'https://archive.cfru.ca/archive/2023/04/03/Breezy Breakfast Radio - April 3, 2023 at 09:00 - CFRU 93.3.mp3','2023-04-03 09:00:00',86638720,'2023-10-26 05:30:27','Bill 23 was introduced on October 25th and passed on November 28th. The More Homes Built Faster Act purports to increase the number of affordable housing units. In fact, there is nothing in Bill 23 that actually promotes affordable and supportive housing. Bill 23 decreases development, community benefit and parkland dedication charges.',NULL),(57402,79,'https://archive.cfru.ca/archive/2023/03/27/Breezy Breakfast Radio - March 27, 2023 at 10:00 - CFRU 93.3.mp3','2023-03-27 10:00:00',86507648,'2023-10-26 05:27:53','Nurse Morgan says the recovery from the pandemic has been even harder than she imagined. She says many nurses have given up their full time jobs and, and gone part time or casual. Morgan: \"They went from being seen in the public as heroes, and now they say they feel like zeros because people are so angry\"',NULL),(57403,81,'https://archive.cfru.ca/archive/2023/05/15/The Sentinel’s Marvellous Kaleidoscope - May 15, 2023 at 15:00 - CFRU 93.3.mp3','2023-05-15 15:00:00',86507648,NULL,NULL,NULL),(57405,79,'https://archive.cfru.ca/archive/2023/03/27/Breezy Breakfast Radio - March 27, 2023 at 09:00 - CFRU 93.3.mp3','2023-03-27 09:00:00',86507648,'2023-10-26 05:24:43','This month marks the third anniversary of the World Health Organization clearing the novel COVID virus, a global pandemic. We are joined by Melissa Skinner, VP, patient services and chief nursing executive at Guelph General Hospital. Melissa answers questions such as how does she start her day? What is the role of the community in funding a hospital?',NULL),(57406,81,'https://archive.cfru.ca/archive/2023/05/08/The