ndtrack for the Alpha State with Chris Durand, a goodbye from James Bailey.','James Bailey is the host of Electric Sense on CIUT 89.5 FM'),(59927,219,'https://mcdn.podbean.com/mf/web/46i7ff/ELEWE231_Electric_Sense_10_May9du76.mp3','2023-05-11 19:53:58',141625557,'2023-10-29 05:20:12','James Bailey: I can\'t remember the last time I opened the program with a track featured bassoon, let alone solo bassoon. That was Sebastian Mallette being a new piece by Frank Horvat called Great Bear Rainforest, and we\'ll be hitting the shelves a week from Friday, May 12th.','James Bailey: I can\'t remember the last time I opened the program with a track featured bassoon, let alone solo basso'),(59928,219,'https://mcdn.podbean.com/mf/web/jhvxt2/ELEWE231_Electric_Sense_3_May6ztlc.mp3','2023-05-04 04:33:03',141601524,'2023-10-29 05:14:15','250/50 - 30/10 ybagoury/flan-t5-base-tldr_news - James Bailey: I can\'t remember the last time I opened the program with a track featuring bassoon, let alone solo bassoon. That was Sebastian Mallette being a new piece by Frank Horvat called Great Bear Rainforest, and we\'ll be hitting the shelves a week from Friday, May 12th.','James Bailey\'s Great Bear Rainforest is coming to the shelves on May 12th '),(59929,219,'https://mcdn.podbean.com/mf/web/e6idrm/ELEWE231_Electric_Sense_26_Apr64l2s.mp3','2023-04-27 05:02:58',141602569,'2023-10-29 05:14:01','James Bailey is joined by Eric Larr, Fabio Anile, Beatings are in the Body, Erica Angel and Peggy Lee on cello and Royson Adams on keyboard. They will be playing music for the Living and the Dead on Friday 10th April at 8pm on Electric Sense. James is also reminding listeners that the station\'s spring fundraising drive is starting in May.','Electric Sense is playing music for Living and the Dead on Friday 10 April '),(59930,219,'https://mcdn.podbean.com/mf/web/bvqci5/ELEWE231_Electric_Sense_19_Aprb2s43.mp3','2023-04-26 16:39:07',141587941,'2023-10-29 04:57:27','James Bailey: This is CIUT 89.5 FM, or through www.ciut.fm online through our web stream, or any other method you may prefer. Starting it off, we\'ll be Dirty Inputs, a working name of Aaron Dawson. Then we go to Emily\'s Cecilia LaBelle. And earlier in the year I played a very long overdue debut solo release by David Yeager.','CIUT 89.5 FM (Sponsor)'),(59931,219,'https://mcdn.podbean.com/mf/web/wse6cr/ES_April_129vt4e.mp3','2023-04-19 19:53:01',143961989,'2023-10-29 04:51:16','James Bailey takes a look at some of the bands coming out this week. He also looks at a local dog rescue dedicated to saving the lives of dogs in need. And then we hear a piece that sounds folky, but with a hint of something odd going on.','James Bailey: Some of the best bands coming out this week (10 minute read)'),(59932,219,'https://mcdn.podbean.com/mf/web/7huxpm/NF01_23-00.mp3','2023-04-07 13:34:13',143961989,'2023-10-29 04:44:41','James Bailey: Opening track is Utsjoki Disco from Vilda, a duo of folks from Lapi, the northern part of Finland. Followed by a track from Carkey Face aka Angela Edwards called Chateauyants\' Movement 4. We\'re going to carry on now something more local to the Toronto area and a new release from Jason Dole.','James Bailey: New releases from Vilda, Carkey Face, and more '),(59933,219,'https://mcdn.podbean.com/mf/web/kte3mx/Electric_Sense_29_Marbd2ex.mp3','2023-04-06 16:44:43',142426961,'2023-10-29 04:11:11','200 ybagoury/flan-t5-base-tldr_news - James Bailey is back with a new episode of Electric Sense. This week we hear a piece that has not been broadcast before. It comes from a duo by the name of if I\'m parsing things correctly electroacoustic cowboys.','James Bailey returns to Electric Sense with a new episode '),(59934,247,'https://mcdn.podbean.com/mf/web/eeqetp/CAB_15th8yab9.mp3','2023-04-19 22:42:48',143961989,NULL,NULL,NULL),(59935,247,'https://mcdn.podbean.com/mf/web/t8z6xq/CAB_April_8th967u7.mp3','2023-04-19 22:42:27',143961989,NULL,NULL,NULL),(59936,247,'https://mcdn.podbean.com/mf/web/xx7qqh/N