,NULL,NULL,NULL),(60054,78,'https://archive.cfru.ca/archive/2023/06/19/Morning Soul Shake-Up! - June 19, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-19 08:00:00',86507648,NULL,NULL,NULL),(60055,78,'https://archive.cfru.ca/archive/2023/06/16/Morning Soul Shake-Up! - June 16, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-16 08:00:00',86507648,NULL,NULL,NULL),(60056,78,'https://archive.cfru.ca/archive/2023/06/15/Morning Soul Shake-Up! - June 15, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-15 08:00:00',86507648,NULL,NULL,NULL),(60057,78,'https://archive.cfru.ca/archive/2023/06/14/Morning Soul Shake-Up! - June 14, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-14 08:00:00',86507648,NULL,NULL,NULL),(60058,78,'https://archive.cfru.ca/archive/2023/06/13/Morning Soul Shake-Up! - June 13, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-13 08:00:00',86507648,NULL,NULL,NULL),(60059,78,'https://archive.cfru.ca/archive/2023/06/12/Morning Soul Shake-Up! - June 12, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-12 08:00:00',86507648,NULL,NULL,NULL),(60060,78,'https://archive.cfru.ca/archive/2023/06/09/Morning Soul Shake-Up! - June 9, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-09 08:00:00',86507648,NULL,NULL,NULL),(60061,78,'https://archive.cfru.ca/archive/2023/06/08/Morning Soul Shake-Up! - June 8, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-08 08:00:00',86507648,NULL,NULL,NULL),(60062,79,'https://archive.cfru.ca/archive/2023/06/26/Breezy Breakfast Radio - June 26, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-26 10:00:00',86507648,'2023-10-26 04:55:33','Linda: We never know if developers will be passing on the discount that is going to be provided by reduced development charges and Parkland fees. Linda: We have more than 30,000 seniors on wait lists for long-term care. LZ: We need to look at housing as an ecosystem.',NULL),(60063,78,'https://archive.cfru.ca/archive/2023/06/07/Morning Soul Shake-Up! - June 7, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-07 08:00:00',86507648,NULL,NULL,NULL),(60064,79,'https://archive.cfru.ca/archive/2023/06/26/Breezy Breakfast Radio - June 26, 2023 at 09:00 - CFRU 93.3.mp3','2023-06-26 09:00:00',86507648,'2023-10-26 04:51:37','This week\'s open mic comes from Guelph, Ontario. The groundbreaking ceremony for the new library was held on June 20th. There are very strong views regarding the Strong Mayor\'s Building Homes Act. Will stronger mayoral powers lead to more affordable housing?',NULL),(60065,78,'https://archive.cfru.ca/archive/2023/06/06/Morning Soul Shake-Up! - June 6, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-06 08:00:00',86507648,NULL,NULL,NULL),(60066,79,'https://archive.cfru.ca/archive/2023/06/12/Breezy Breakfast Radio - June 12, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-12 10:00:00',86507648,'2023-10-26 04:47:37','Councilor Alton: It\'s a question of what is the budget that we would provide for by-law support that would include staffing. Councilor Doug: We are aware we are monitoring other municipalities to do it. And we\'re waiting to see the results from them before making any recommendations.',NULL),(60067,78,'https://archive.cfru.ca/archive/2023/06/05/Morning Soul Shake-Up! - June 5, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-05 08:00:00',86507648,NULL,NULL,NULL),(60068,79,'https://archive.cfru.ca/archive/2023/06/12/Breezy Breakfast Radio - June 12, 2023 at 09:00 - CFRU 93.3.mp3','2023-06-12 09:00:00',86507648,'2023-10-26 04:43:27','This week on the Breezy Breakfast, we learn about Guelph\'s bylaws. Doug Godfrey and Dustin Gronk field questions about bylaw enforcement.',NULL),(60069,78,'https://archive.cfru.ca/archive/2023/06/02/Morning Soul Shake-Up! - June 2, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-02 08:00:00',86507648,NULL,NULL,NULL),(60070,79,'https://archive.cfru.ca/archive/2023/06/05/Breezy Breakfast Radio - June 5, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-05 10:00:00',86507648,'2023-10-26 04:39:12','Katrina, Crystal and Tynomi, let us know about some of the more important events that you are participating in and final words for today. Katrina: \"The more visibly supportive we can be of the LGBTQIA plus community, the more people will not feel as safe vocalizing those issues, right? I would like to make bigots quiet again\"',NULL),(60071,78,'https://archive.cfru.ca/archive/2023/06/01/Morning Soul Shake-Up! - June 1, 2023 at 08:00 - CFRU 93.3.mp3','2023-06-01 08:00:00',86507648,NULL,NULL,NULL),(60072,79,'https://archive.cfru.ca/archive/2023/06/05/Breezy Breakfast Radio - June 5, 2023 at 09:00 - CFRU 93.3.mp3','2023-06-05 09:00:00',86507648,'2023-10-26 04:35:17','Today marks the beginning of Pride Month and National Indigenous History Month. The Two-Spirit people were considered special by the majority of Indigenous tribes pre-contact. They were able to walk in both worlds of gender.',NULL),(60073,78,'https://archive.cfru.ca/archive/2023/05/31/Morning Soul Shake-Up! - May 31, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-31 08:00:00',86507648,NULL,NULL,NULL),(60074,79,'https://archive.cfru.ca/archive/2023/05/29/Breezy Breakfast Radio - May 29, 2023 at 10:00 - CFRU 93.3.mp3','2023-05-29 10:00:00',86507648,'2023-10-26 04:31:42','I wanted to ask if you could comment, and I know you did already, on the three bills that you are going to introduce into Parliament. I don\'t think it\'s going to affect the need for a new hospital. I think the bigger concern about the private clinics is the draining of healthcare staff from the public system. It\'s about a 10-year long process, so even though we\'re getting approvals, it\'s still going to take time.',NULL),(60075,78,'https://archive.cfru.ca/archive/2023/05/30/Morning Soul Shake-Up! - May 30, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-30 08:00:00',86507648,NULL,NULL,NULL),(60077,79,'https://archive.cfru.ca/archive/2023/05/29/Breezy Breakfast Radio - May 29, 2023 at 09:00 - CFRU 93.3.mp3','2023-05-29 09:00:00',86507648,'2023-10-26 04:28:16','This week on the Breezy Breakfast we hear from our federal and provincial representatives, MP Lloyd Longfield and MPP Mike Schreiner. We get the scoop on topics such as housing, gun control, proportional representation, municipal authority and the greenbelt.',NULL),(60078,78,'https://archive.cfru.ca/archive/2023/05/29/Morning Soul Shake-Up! - May 29, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-29 08:00:00',86507648,NULL,NULL,NULL),(60080,79,'https://archive.cfru.ca/archive/2023/05/22/Breezy Breakfast Radio - May 22, 2023 at 10:00 - CFRU 93.3.mp3','2023-05-22 10:00:00',86507648,'2023-10-26 04:25:15','Mayor: I think that as much as I didn\'t like it, I took the pill because there was sugar on it. There\'s so many issues that are outstanding and we haven\'t even really begun to talk about issues associated with floodplain, with conservation authorities. One of the questions that came up was with regard to financial impacts and our reserve funds.',NULL),(60081,78,'https://archive.cfru.ca/archive/2023/05/26/Morning Soul Shake-Up! - May 26, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-26 08:00:00',86507648,NULL,NULL,NULL),(60083,79,'https://archive.cfru.ca/archive/2023/05/22/Breezy Breakfast Radio - May 22, 2023 at 09:00 - CFRU 93.3.mp3','2023-05-22 09:00:00',86507648,'2023-10-26 04:22:06','Bill 23 was introduced on October 25th and passed on November 28th. The More Homes Built Faster Act purports to increase the number of affordable housing units. However, the definition of affordable is no longer related to income, but rather the market value. Bill 23 decreases development, community benefit and parkland dedication charges.',NULL),(60086,81,'https://archive.cfru.ca/archive/2023/06/26/The Sentinel’s Marvellous Kaleidoscope - June 26, 2023 at 15:00 - CFRU 93.3.mp3','2023-06-26 15:00:00',86507648,NULL,NULL,NULL),(60088,81,'https://archive.cfru.ca/archive/2023/06/19/The Sentinel’s Marvellous Kaleidoscope - June 19, 2023 at 15:00 - CFRU 93.3.mp3','2023-06-19 15:00:00',86507648,NULL,NULL,NULL),(60090,81,'https://archive.cfru.ca/archive/2023/06/12/The Sentinel’s Marvellous Kaleidoscope - June 12, 2023 at 15:00 - CFRU 93.3.m