/18/The Kookoo Bananas Variety Hour - June 18, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-18 10:00:00',86507648,'2023-10-31 01:34:07','200 - The guys are celebrating Father\'s day with music and games, but they\'re also talking about grandpa. The narrator is psyched because he has a dad, and he says he\'s got to do something for him. He wants to play a song about his dad, but he doesn\'t want to play songs about grandpas because grandpas aren\'t cool. He says he wants to do a music show about music, so he decides to play some songs about his father. He\'s going to play music that he likes, and then he\'ll talk about why he chose a particular song. In this case, it\'ll be a song called \"Chunga Chunga.\" It\'s from Portugal, which is','The boys are talking about grandpa, but they\'re also talking about dads'),(60532,145,'https://archive.cfru.ca/archive/2023/05/28/Visions fugitives - May 28, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-28 08:00:00',86507648,NULL,NULL,NULL),(60533,146,'https://archive.cfru.ca/archive/2023/06/11/The Kookoo Bananas Variety Hour - June 11, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-11 10:00:00',86507648,'2023-10-31 01:03:55','The Cuckoo Banana Show begins with Oliver teasing the audience about the song they\'ll hear on the show. The song is not Japanese, but rather part of French. Oliver thinks it\'s actually a song from a Japanese TV show called \"Kurekuretrashakura,\" which means \"gimme gime octopus.\" This is a reference to the song \"Gimme that Octopus,\" which is a show about greedy octopuses. The next song is a song called \"Guitar Boogie,\" which sounds a lot like \"I\'m a Boy I\'m A Boy You\'re A Boy Im A Girl I\'M A Boy Oh, Right When I Did This.\" After the song, Oliver tells the audience that they','The Cuckoo Banana Show begins with Oliver teasing the audience about the song they hear'),(60534,145,'https://archive.cfru.ca/archive/2023/05/21/Visions fugitives - May 21, 2023 at 09:00 - CFRU 93.3.mp3','2023-05-21 09:00:00',86507648,NULL,NULL,NULL),(60535,146,'https://archive.cfru.ca/archive/2023/06/04/The Kookoo Bananas Variety Hour - June 4, 2023 at 10:00 - CFRU 93.3.mp3','2023-06-04 10:00:00',86507648,'2023-10-31 00:53:11','The gang discusses the flower, dandelion, and their connection to music and science. They learn that the flower is edible, that it has a bitter taste, and that it is a source of vitamins A, C and K. They also learn that a flower called Woodruff is native to Canada, but that it might be an invasive species, since it has spread across the world.','The gang discusses the flower, dandelion, and their connection to music and science'),(60536,145,'https://archive.cfru.ca/archive/2023/05/21/Visions fugitives - May 21, 2023 at 08:00 - CFRU 93.3.mp3','2023-05-21 08:00:00',86507648,NULL,NULL,NULL),(60537,146,'https://archive.cfru.ca/archive/2023/05/28/The Kookoo Bananas Variety Hour - May 28, 2023 at 10:00 - CFRU 93.3.mp3','2023-05-28 10:00:00',86507648,'2023-10-31 00:42:52','Welcome to another new episode of the Cuckoo Banana Show. The narrator and his students are in the middle of a beautiful spring day at the university in Guelph, Canada. The students are walking to the university station when they hear a song about flowers. The song is called \"You Want the Flower, But Not the Seed From Texturology\" by James Harpham and is based on the book \"Nature\'s World\" by the same author. The music will start off with \"The Engines Running\" and end with \"Flower Garden,\" a song by Harpham. The science corner of the show will be dedicated to the song \"Dandelion,\" a flower that is edible, but bitter and poisonous. Rowan and the students learn that the flower','The Cuckoo Banana Show is a new show dedicated to flowers'),(60538,146,'https://archive.cfru.ca/archive/2023/05/21/The Kookoo Bananas Variety Hour - May 21, 2023 at 10:00 - CFRU 93.3.mp3','2023-05-21 10:00:00',86507648,'2023-10-31 00:32:49','The gang decides to play a few father-centric songs to start the show. The first song is from Jay Cherko, a musician from Winnipeg. The song is called \"Super Fun Happy Wake-Up Song\" and the lyrics are, \"Hey everybody, It\'s time for to get up / Gonna be a good day today.\" The song\'s lyrics refer to a Saturday, and the song is about a new baby named Olive. The band also plays a song called \"Big Sister\" by Gregory Pepper, a new dad named Jillian, and a song about a black metal artist named Gregory Pepper. The show ends with the announcement that they have gotten their dad an Atari game, which is more or lesser than it was when it','The gang decides to play a few father-centric songs to start the show'),(60539,148,'https://archive.cfru.ca/archive/2023/07/02/Clan Na Gael - July 2, 2023 at 13:00 - CFRU 93.3.mp3','2023-07-02 13:00:00',86507648,NULL,NULL,NULL),(60540,148,'https://archive.cfru.ca/archive/2023/07/02/Clan Na Gael - July 2, 2023 at 12:00 - CFRU 93.3.mp3','2023-07-02 12:00:00',86507648,NULL,NULL,NULL),(60541,148,'https://archive.cfru.ca/archive/2023/06/25/Clan Na Gael - June 25, 2023 at 13:00 - CFRU 93.3.mp3','2023-06-25 13:00:00',86507648,NULL,NULL,NULL),(60542,149,'https://archive.cfru.ca/archive/2023/06/25/La Buena Onda - June 25, 2023 at 17:00 - CFRU 93.3.mp3','2023-06-25 17:00:00',86507648,NULL,NULL,NULL),(60543,148,'https://archive.cfru.ca/archive/2023/06/25/Clan Na Gael - June 25, 2023 at 12:00 - CFRU 93.3.mp3','2023-06-25 12:00:00',86507648,NULL,NULL,NULL),(60544,149,'https://archive.cfru.ca/archive/2023/06/25/La Buena Onda - June 25, 2023 at 16:00 - CFRU 93.3.mp3','2023-06-25 16:00:00',86507648,NULL,NULL,NULL),(60545,148,'https://archive.cfru.ca/archive/2023/06/18/Clan Na Gael - June 18, 2023 at 13:00 - CFRU 93.3.mp3','2023-06-18 13:00:00',86507648,NULL,NULL,NULL),(60546,149,'https://archive.cfru.ca/archive/2023/06/18/La Buena Onda - June 18, 2023 at 17:00 - CFRU 93.3.mp3','2023-06-18 17:00:00',86507648,NULL,NULL,NULL),(60547,148,'https://archive.cfru.ca/archive/2023/06/18/Clan Na Gael - June 18, 2023 at 12:00 - CFRU 93.3.mp3','2023-06-1