e a bunch of things that I have gathered over the years on bandcamp.','James Bailey: I was originally going to play stuff from the latest Music Works magazine, which just'),(60952,219,'https://mcdn.podbean.com/mf/web/8birp9/ES230614.mp3','2023-06-16 22:20:04',143450994,'2023-10-29 03:52:44','James Bailey is the host of Electric Sense on CIUT 89.5 FM. He plays music live every Wednesday night from 11 o\'clock until midnight. This week we\'ll hear Richard Harriot\'s Twilight Song of Trinity Bay, Alto Flute and Piano. And we\'ll also hear Riding by Keith and Julie Tippett.','Electric Sense (Newsletter)'),(60953,219,'https://mcdn.podbean.com/mf/web/a2txe7/ES230607.mp3','2023-06-08 16:07:50',140511696,'2023-10-29 03:46:53','James Bailey is the host of CIUT 89.5 FM\'s Music of the Day. This week he plays a piece by Canadian violinist Christopher Whitley. Whitley\'s new release, Describe Yourself, will be released on June 23rd.','James Bailey plays a piece by Canadian violinist Christopher Whitley '),(60954,219,'https://mcdn.podbean.com/mf/web/csewpj/ELEWE231_Electric_Sense_31_May62jxs.mp3','2023-06-07 20:26:53',141848151,'2023-10-29 03:03:04','200 - MacGyver takes a look at some of the music coming out of Norman, Oklahoma. First time we\'ve had anybody from the state on the program. Ilana Wanyak, Emily Cecilia LaBelle, Lina Alomano and Brody West round out the set. MacGyver thanks all those who contributed during our fundraising week.','First time we\'ve had anybody from the state on the program. Ilana Wany'),(60955,257,'https://mcdn.podbean.com/mf/web/zdvewr/June_29_2023_Psychedelic_Stoner_Rock6cqdu.mp3','2023-06-29 22:02:36',287962512,NULL,NULL,NULL),(60956,257,'https://mcdn.podbean.com/mf/web/jzubf4/June_22_2023_Psychedelic_Stoner_Rockbhn7a.mp3','2023-06-23 15:54:18',287962512,NULL,NULL,NULL),(60957,257,'https://mcdn.podbean.com/mf/web/kimcgn/June_22_2023_Psychedelic_Stoner_Rockb6c4t.mp3','2023-06-23 15:41:41',287962512,NULL,NULL,NULL),(60958,257,'https://mcdn.podbean.