 08:00:00',86507648,NULL,NULL,NULL),(61334,84,'https://archive.cfru.ca/archive/2023/07/31/Blues Around the Block - July 31, 2023 at 20:00 - CFRU 93.3.mp3','2023-07-31 20:00:00',86507648,NULL,NULL,NULL),(61335,82,'https://archive.cfru.ca/archive/2023/07/17/Big Sis Radio - July 17, 2023 at 17:00 - CFRU 93.3.mp3','2023-07-17 17:00:00',86507648,NULL,NULL,NULL),(61336,83,'https://archive.cfru.ca/archive/2023/07/17/to know the land - July 17, 2023 at 18:00 - CFRU 93.3.mp3','2023-07-17 18:00:00',86507648,'2023-10-30 18:55:27','In this episode of the Know the Land podcast, Byron speaks with the program director of the Greenbelt Foundation, Shelly Petrie. The two discuss the Greenbelt, a 2.1 million-acre protected area stretching from the east to the west across the greater Toronto area. The region includes iconic landscapes like the Niagara Scarpement, the Oak Ridges Moraine, and the Great Lakes. The Greenbelt protects farmland, natural resources, and water resources. The idea of a greenbelt, a vast, protected area, is often mentioned as being larger than the Province of Prince Edward Island. The story behind the Greenbelt begins with a song by Sarah Harmer, which asks, \"If we blow a Hole in the Escarpment, will the Creek still Flow to The Great Lakes?\" This question has been answered by many protection measures over the years. In the early 80s, a number of measures were put in place to protect the escarpment, the Niagara, and Oak Ridge. Then, in the early 2000s, the Green Belt came into existence. It protects farmland and natural resources as well as water resources and agriculture systems. The foundation is an independent charity, which means it receives funding from the province, but it does not have to deal with land-use policy. There are other examples of the importance of protecting the landscape around the world, including the Iron Curtain, a Green Belt created after the fall of the Berlin Wall. There is an ecological, or \"green,\" Green Belt in Australia. There was a Green','The Great Lakes: How I Built a Green Belt in the 1980s?'),(61337,86,'https://archive.cfru.ca/archive/2023/07/24/The Deep House Project - July 24, 2023 at 22:00 - CFRU 93.3.mp3','2023-07-24 22:00:00',86507648,NULL,NULL,NULL),(61338,79,'https://archive.cfru.ca/archive/2023/07/31/Breezy Breakfast Radio - July 31, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-31 09:00:00',86507648,'2023-10-26 04:09:42','Cameron Walsh oversees waste management in Guelph. The Downtown Waste Disposal project is also an important topic. Be sure to have your say before August 18th. You\'re listening to CFRU at 93.3 FM.',NULL),(61339,85,'https://archive.cfru.ca/archive/2023/07/24/Ripcord Radio - July 24, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-24 21:00:00',86507648,NULL,NULL,NULL),(61341,78,'https://archive.cfru.ca/archive/2023/08/03/Morning Soul Shake-Up! - August 3, 2023 at 08:00 - CFRU 93.3.mp3','2023-08-03 08:00:00',86507648,NULL,NULL,NULL),(61342,84,'https://archive.cfru.ca/archive/2023/07/31/Blues Around the Block - July 31, 2023 at 19:00 - CFRU 93.3.mp3','2023-07-31 19:00:00',86507648,NULL,NULL,NULL),(61343,82,'https://archive.cfru.ca/archive/2023/07/10/Big Sis Radio - July 10, 2023 at 17:00 - CFRU 93.3.mp3','2023-07-10 17:00:00',86507648,NULL,NULL,NULL),(61344,83,'https://archive.cfru.ca/archive/2023/07/10/to know the land - July 10, 2023 at 18:00 - CFRU 93.3.mp3','2023-07-10 18:00:00',86507648,'2023-10-30 18:45:00','The narrator introduces this week\'s episode of To Know The Land, a show about the connection between the land and the people who live there. The show is produced by the university\'s faculty of science, technology, engineering, and mathematics, as well as the faculty of geography. The narrator is Byron, a student at the university. He\'s interested in plants, and particularly in a group of them called the Amalanchier family, which includes the Juneberry, the Shadbush, and the Saskatoonberry. He listens to the program every week to learn more about these plants. The first thing he does is read a book called \"Shrubs of Ontario\" by James H Soper. The book is written in the early 1980s, and it was put out only in 1982. The narrator notes that the name \"Amlancier\" comes from the French word for \"honey.\" He also notes that some of the flowers are long and some are short. He notes that there are many different kinds of plants that live in the same place, and that it\'s hard to tell which ones are the same. He also says that he likes the fruit, which is a bright red, and then fades to a dark purple. He names his bike Juneberry in honor of the berries. He decides to read some of John Eastman\'s book \"Forest and Thicket\" because he\'s really interested in how it describes plants. It describes plants in very simple terms. The','The narrator tells the story of plants that live in the land'),(61345,86,'https://archive.cfru.ca/archive/2023/07/17/The Deep House Project - July 17, 2023 at 22:00 - CFRU 93.3.mp3','2023-07-17 22:00:00',86507648,NULL,NULL,NULL),(61346,79,'https://archive.cfru.ca/archive/2023/07/24/Breezy Breakfast Radio - July 24, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-24 10:00:00',86507648,'2023-10-26 04:07:09','Chief Coby: \"We need to be very vigilant in ensuring that our property is well protected\" Chief: \"How do we roll the budget back? Truthfully, I don\'t think we do yet\" \"I think we need to find a safe place for people to create a community\"',NULL),(61347,85,'https://archive.cfru.ca/archive/2023/07/17/Ripcord Radio - July 17, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-17 21:00:00',86507648,NULL,NULL,NULL),(61349,78,'https://archive.cfru.ca/archive/2023/08/02/Morning Soul Shake-Up! - August 2, 2023 at 08:00 - CFRU 93.3.mp3','2023-08-02 08:00:00',86507648,NULL,NULL,NULL),(61350,84,'https://archive.cfru.ca/archive/2023/07/24/Blues Around the Block - July 24, 2023 at 20:00 - CFRU 93.3.mp3','2023-07-24 20:00:00',86507648,NULL,NULL,NULL),(61351,86,'https://archive.cfru.ca/archive/2023/07/10/The Deep House Project -