out the language of gender. Aaron has first-hand knowledge of this. She is non-binary. Aaron explains how the understanding of gender is often confused with sex, sexuality, and gives examples of different cultures that have different views of gender We talk about the etiquette of referring to people by the preferred pronouns. We touch on English grammar, bigotry, acceptance, and embracing the broad culture of humanity.',NULL),(61363,78,'https://archive.cfru.ca/archive/2023/07/28/Morning Soul Shake-Up! - July 28, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-28 08:00:00',86507648,NULL,NULL,NULL),(61364,84,'https://archive.cfru.ca/archive/2023/07/17/Blues Around the Block - July 17, 2023 at 19:00 - CFRU 93.3.mp3','2023-07-17 19:00:00',86507648,NULL,NULL,NULL),(61365,79,'https://archive.cfru.ca/archive/2023/07/10/Breezy Breakfast Radio - July 10, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-10 10:00:00',86507648,'2023-10-26 03:54:33','City of Guelph posts spring cleaning green in April. The city looked great by the end of April. But unfortunately by the middle of May, it\'s back to where it was. That\'s something that should not be tolerated.',NULL),(61367,78,'https://archive.cfru.ca/archive/2023/07/27/Morning Soul Shake-Up! - July 27, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-27 08:00:00',86507648,NULL,NULL,NULL),(61368,84,'https://archive.cfru.ca/archive/2023/07/10/Blues Around the Block - July 10, 2023 at 20:00 - CFRU 93.3.mp3','2023-07-10 20:00:00',86507648,NULL,NULL,NULL),(61369,79,'https://archive.cfru.ca/archive/2023/07/10/Breezy Breakfast Radio - July 10, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-10 09:00:00',86507648,'2023-10-26 03:26:53','Today on The Breezy Breakfast we take a deep dive into water and wastewater. We also engage in some serious trash talk. Our guests, Nectar Tampakopoulos and Wayne Ferrendas, raise our awareness about issues that affect us.',NULL),(61371,78,'https://archive.cfru.ca/archive/2023/07/26/Morning Soul Shake-Up! - July 26, 2023 at 08:00 - CFRU 93