00:00',86507648,NULL,NULL,NULL),(61404,100,'https://archive.cfru.ca/archive/2023/07/26/We Know Some Stuff + CFRU playlist - July 26, 2023 at 12:00 - CFRU 93.3.mp3','2023-07-26 12:00:00',86507648,NULL,NULL,NULL),(61406,78,'https://archive.cfru.ca/archive/2023/07/13/Morning Soul Shake-Up! - July 13, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-13 08:00:00',86507648,NULL,NULL,NULL),(61407,101,'https://archive.cfru.ca/archive/2023/07/16/Seems Like Old Times - July 16, 2023 at 14:00 - CFRU 93.3.mp3','2023-07-16 14:00:00',86507648,NULL,NULL,NULL),(61408,99,'https://archive.cfru.ca/archive/2023/07/26/The Stillness & The Dancing - July 26, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-26 09:00:00',86507648,'2023-10-30 13:03:05','pszemraj/pegasus-x-large-book-summary - The show opens with a flourish of patriotic music, beginning with a song from the new album Spring by Project Epic 45. The song is called Opening, and the music is described as \"minimal post-rock\" music. The band then moves on to new music from Photo Ruckel, a label that has been releasing records in the U.K. and Canada. The label is releasing a new release called Feel, a collection of music from Polar Seize, and a new track from Harry Towels. The last track is from the release by N5MD called The Silence Between The New World And The Aftermath. This is a song called Still Looking Toward the Sky. The show ends with new music by Brock Donway. The first track is a long form composition from his latest release, For Forgetting Out on Sound In Silence. The second track is called One More More Morning. The program ends with the song \"Zombie Jamboree.\" This song is a tribute to the zombie apocalypse.','The \'minimal post-rock\' music begins with a new album'),(61409,102,'https://archive.cfru.ca/archive/2023/07/19/End Credits - July 19, 2023 at 15:00 - CFRU 93.3.mp3','2023-07-19 15:00:00',86507648,NULL,NULL,NULL),(61410,95,'https://archive.cfru.ca/archive/2023/07/18/Humanoid Radio - July 18, 2023 at 22:00 - CFRU 93.3.mp3','2023-07-18 22:00:00',86507648,NULL,NULL,NULL),(61411,97,'https://archive.cfru.ca/archive/2023/07/27/Wild Combination - July 27, 2023 at 01:00 - CFRU 93.3.mp3','2023-07-27 01:00:00',86638720,NULL,NULL,NULL),(61412,96,'https://archive.cfru.ca/archive/2023/07/18/Cyber Lich’s Gothic Castle - July 18, 2023 at 23:00 - CFRU 93.3.mp3','2023-07-18 23:00:00',86507648,NULL,NULL,NULL),(61413,100,'https://archive.cfru.ca/archive/2023/07/19/We Know Some Stuff + CFRU playlist - July 19, 2023 at 12:00 - CFRU 93.3.mp3','2023-07-19 12:00:00',86507648,NULL,NULL,NULL),(61415,78,'https://archive.cfru.ca/archive/2023/07/12/Morning Soul Shake-Up! - July 12, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-12 08:00:00',86507648,NULL,NULL,NULL),(61416,101,'https://archive.cfru.ca/archive/2023/07/09/Seems Like Old Times - July 9, 2023 at 15:00 - CFRU 93.3.mp3','2023-07-09 15:00:00',86507648,NULL,NULL,NULL),(61417,99,'https://archive.cfru.ca/archive/2023/07/19/The Stillness & The Dancing - July 19, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-19 10:00:00',86507648,'2023-10-30 13:02:58','On this episode of The Stillness And The Dancing, host Anthony Manette introduces listeners to his new show, which airs every Tuesday from 11:00 to 12:00 on CFRU-933FM. The show is a wide-ranging mix of experimental music, spoken word, and spoken-word poetry. The program also includes an extensive discography of releases by various artists, including Golden Brown, Arrow Wound, Ludovico, Aldi, Lassl, and PJS. Manette also discusses the latest releases from his favorite label, Lost Tribe Sound. The first two tracks are from the band\'s latest release, The Octopus Pond, which was released in April. The third track is from a four-track EP called Theory Anthropes, which is a series of stories about shape-shifting, or the ability of individuals to transform into animals. The fourth track is called In the Ocean Pond. The second track is a song called Sun Rain from another band called Waters. The fifth track is an ethereal drone from Good Night And Good Morning. The sixth track is one of Manette\'s favorites, an EP called Ocean In View, which he calls \"perfectly captured melancholy haze.\" The seventh track is also an ethereal, bowed vibraphone track. The eighth track is the newest release from PJS, Ouroboros, which Manette describes as \"some immersive expansive stuff.\" The program ends with Ritual, a track from the new release by the duo Lassl and Lawrence English.','The Stillness And The Dancing premieres Tuesday on CFRU-933FM'),(61418,102,'https://archive.cfru.ca/archive/2023/07/12/End Credits - July 12, 2023 at 15:00 - CFRU 93.3.mp3','2023-07-12 15:00:00',86507648,NULL,NULL,NULL),(61419,95,'https://archive.cfru.ca/archive/2023/07/11/Humanoid Radio - July 11, 2023 at 22:00 - CFRU 93.3.mp3','2023-07-11 22:00:00',86507648,NULL,NULL,NULL),(61420,97,'https://archive.cfru.ca/archive/2023/07/27/Wild Combination - July 27, 2023 at 00:00 - CFRU 93.3.mp3','2023-07-27 00:00:00',86507648,NULL,NULL,NULL),(61421,96,'https://archive.cfru.ca/archive/2023/07/11/Cyber Lich’s Gothic Castle - July 11, 2023 at 23:00 - CFRU 93.3.mp3','2023-07-11 23:00:00',86507648,NULL,NULL,NULL),(61422,100,'https://archive.cfru.ca/archive/2023/07/12/We Know Some Stuff + CFRU playlist - July 12, 2023 at 12:00 - CFRU 93.3.mp3','2023-07-12 12:00:00',86507648,NULL,NULL,NULL),(61424,78,'https://archive.cfru.ca/archive/2023/07/11/Morning Soul Shake-Up! - July 11, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-11 08:00:00',86507648,NULL,NULL,NULL),(61425,101,'https://archive.cfru.ca/archive/2023/07/09/Seems Like Old Times - July 9, 2023 at 14:00 - CFRU 93.3.mp3','2023-07-09 14:00:00',86507648,NULL,NULL,NULL),(61426,99,'https://archive.cfru.ca/archive/2023/07/19/The Stillness & The Dancing - July 19, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-19 09:00:00',86507648,'2023-10-29 23:23:12','In this edition of the show, host Joel Cuthbert leads listeners on a tour of new music. The first track is from a new album from Epic 45 called Spring. The second track from the new album is from Haruka Nakamura\'s From Dusk To The Sun. The third track from an upcoming release from the label Rookle is called Feel. The fourth track from White Lab Recordings is called PrunusAvium. The fifth track from N5M is called Reflections Revisited. The sixth track from Tangent is In Danger. The seventh track from Imaginary North is Barn 6. The eighth track from Sound Portraits from The Felmer Tassal Odyssey is called SwallowedHole by the RedCavalry. The ninth track from Brock Van Waae\'s For Forgetting is One More Morning.','Joel Cuthbert leads listeners on a tour of new music'),(61427,97,'https://archive.cfru.ca/archive/2023/07/20/Wild Combination - July 20, 2023 at 01:00 - CFRU 93.3.mp3','2023-07-20 01:00:00',86507648,NULL,NULL,NULL),(61429,78,'https://archive.cfru.ca/archive/2023/07/10/Morning Soul Shake-Up! - July 10, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-10 08:00:00',86507648,NULL,NULL,NULL),(61430,99,'https://archive.cfru.ca/archive/2023/07/12/The Stillness & The Dancing - July 12, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-12 10:00:00',86507648,'2023-10-29 23:14:59','The show starts off with a bunch of new music, starting with Will Bolton\'s Scattered Thoughts, then Will\'s new release, Swept, followed by Swept\'s track, Remote Memory Palace, and then a new track by Theo Alexander called Waiting for you to die. Next up is a track from Ian Willem Craig\'s Postcards from the Backyard Part 2, then a track by the Vancouver artist, The Turn Of Breath, then an album by another artist named Mirope, then another by his old coworker, Jay Carter, named Salos. Then a new release by another local artist named J. R. Halepin named Heretofore thereafter. And then a bunch more new music from the local artists and labels, all of which are on Bandcamp. If you missed the show, you can always find it on the show\'s Facebook page or on Mixcloud. And if you want to check out more of the local music, here\'s where you\'ll find it: TheStillnessAndTheDancingatCFU.ca. But if you missed something, or just want more information, then you can just reach out to the host of the show and he\'ll answer it for you. And here are a few more things that you can check out: The Campus Radio at CFRU is looking for people to promote local events and festivals, like Hillside and Jazz Fest. They also need people to record public service announcements and scripts. And finally','TheStillnessAndTheDancingatCFU.ca'),(61431,97,'https://archive.cfru.ca/archive/2023/07/20/Wild Combination - July 20, 2023 at 00:00 - CFRU 93.3.mp3','2023-07-20 00:00:00',86507648,NULL,NULL,NULL),(61433,99,'https://archive.cfru.ca/archive/2023/07/12/The Stillness & The Dancing - July 12, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-12 09:00:00',86507648,'2023-10-29 23:05:22','The second hour of the live show begins with a description of the latest episode of the show. The narrator describes how he was battling with strep throat and was eventually able to recover. The show starts with a new release from his friend, Syro Burn, who is a field recording artist. The music is described as a mix of field recording and electronics. The first track is called elfin, which is translated to \"southern winter\" or \"summertime\". The second track is a final collaboration between Syro and Mikosa called vierno, which means \"white lab\". The third track is an exploration of Tronica, a Latin term for folk music. It is said to be an uncle force. The fourth track is from c.diab, a band that uses bowed acoustic guitar to create \"alienated sounds\". The fifth track is the work of a friend of Cuthbert\'s called Helios. The sixth track is inspired by the music of marine eyes, an artist who creates music out of the natural world. The seventh track is titled nurture Adam and is described by the narrator as \"in the present\". The eighth track is by the band Balmoria, whose latest release is called pendant worlds. The final track is Aaron Martin\'s touch dissolves. The next hour is devoted to new music from Nick Wade, a project from Buxton. The song is called scattered thoughts, which the narrator describes as \"a track called stillness and dancing\".','The second hour of the live show begins with a description of the latest episode of the show'),(61434,97,'https://archive.cfru.ca/archive/2023/07/13/Wild Combination - July 13, 2023 at 01:00 - CFRU 93.3.mp3','2023-07-13 01:00:00',86507648,NULL,NULL,NULL),(61436,97,'https://archive.cfru.ca/archive/2023/07/13/Wild Combination - July 13, 2023 at 00:00 - CFRU 93.3.mp3','2023-07-13 00:00:00',86507648,NULL,NULL,NULL),(61440,107,'https://archive.cfru.ca/archive/2023/08/02/Tone Zone - August 2, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-02 21:00:00',86507648,NULL,NULL,NULL),(61441,107,'https://archive.cfru.ca/archive/2023/07/26/Tone Zone - July 26, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-26 21:00:00',86507648,NULL,NULL,NULL),(61442,107,'https://archive.cfru.ca/archive/2023/07/19/Tone Zone - July 19, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-19 21:00:00',86507648,NULL,NULL,NULL),(61443,105,'https://archive.cfru.ca/archive/2023/08/02/B Siide Radio - August 2, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-02 19:00:00',86507648,NULL,NULL,NULL),(61444,109,'https://archive.cfru.ca/archive/2023/08/02/Radia - August 2, 2023 at 00:00 - CFRU 93.3.mp3','2023-08-02 00:00:00',86507648,NULL,NULL,NULL),(61445,106,'https://archive.cfru.ca/archive/2023/08/02/Trail Mix - August 2, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-02 20:00:00',86507648,NULL,NULL,NULL),(61446,94,'https://archive.cfru.ca/archive/2023/08/01/Let’s Get Lost - August 1, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-01 21:00:00',86507648,NULL,NULL,NULL),(61447,107,'https://archive.cfru.ca/archive/2023/07/12/Tone Zone - July 12, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-12 21:00:00',86507648,NULL,NULL,NULL),(61448,105,'https://archive.cfru.ca/archive/2023/07/26/B Siide Radio - July 26, 2023 at 19:00 - CFRU 93.3.mp3','2023-07-26 19:00:00',86507648,NULL,NULL,NULL),(61449,109,'htt