ure and stories. The second song we play is from the Turkish folk band, Elten Gun, who are playing the island stage later in the day. The third song is from another performer, Vi, who will perform later that afternoon at the Island stage. The show ends with the introduction of the band members, Cormac and Dave. They are both from Peterborough, and they met there when','The Corus is giving away free tickets to all summer long on their web site'),(61584,142,'https://archive.cfru.ca/archive/2023/08/05/Tiempo de Mujeres - August 5, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-05 20:00:00',86507648,NULL,NULL,NULL),(61585,144,'https://archive.cfru.ca/archive/2023/07/30/The Underground - July 30, 2023 at 00:00 - CFRU 93.3.mp3','2023-07-30 00:00:00',86507648,NULL,NULL,NULL),(61586,140,'https://archive.cfru.ca/archive/2023/07/22/Caribbean Anthology - July 22, 2023 at 16:00 - CFRU 93.3.mp3','2023-07-22 16:00:00',86507648,NULL,NULL,NULL),(61587,143,'https://archive.cfru.ca/archive/2023/07/29/Mach Vibe Radio - July 29, 2023 at 22:00 - CFRU 93.3.mp3','2023-07-29 22:00:00',86507648,NULL,NULL,NULL),(61588,139,'https://archive.cfru.ca/archive/2023/07/22/Bel Araby with CAWA - July 22, 2023 at 15:00 - CFRU 93.3.mp3','2023-07-22 15:00:00',86507648,NULL,NULL,NULL),(61589,145,'https://archive.cfru.ca/archive/2023/07/30/Visions fugitives - July 30, 2023 at 08:00 - CFRU 93.3.mp3','2023-07-30 08:00:00',86507648,NULL,NULL,NULL),(61590,141,'https://archive.cfru.ca/archive/2023/08/05/Alternativa Latinoamericana - August 5, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-05 18:00:00',86507648,NULL,NULL,NULL),(61591,146,'https://archive.cfru.ca/archive/2023/07/16/The Kookoo Bananas Variety Hour - July 16, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-16 10:00:00',86507648,'2023-10-31 00:02:36','The show starts off with a special edition of the show dedicated to fathers. It\'ll feature a bunch of songs about fathers, which is what the show is all about. The first song is from a guy named Jay Cherko, who\'s known as \"Chows of Canada.\" The song is called \"Super Fun Happy Wake-Up,\" which is kind of like \"Oliver without the R.\" The next song is by Gregory Pepper, who sings about his problems with his black metal demos. The third song is a song called \"Big Sister.\" It\'s about a new baby named Olive. The last song is \"Super duper cute.\" The show ends with a shout-out to UMFM, a local station in','The first song from a guy named Jay Cherko is about a new baby named Olive'),(61592,142,'https://archive.cfru.ca/archive/2023/07/29/Tiempo de Mujeres - July 29, 2023 at 20:00 - CFRU 93.3.mp3','2023-07-29 20:00:00',86507648,NULL,NULL,NULL),(61593,144,'https://archive.cfru.ca/archive/2023/07/29/The Underground - July 29, 2023 at 23:00 - CFRU 93.3.mp3','2023-07-29 23:00:00',86507648,NULL,NULL,NULL),(61594,140,'https://archive.cfru.ca/archive/2023/07/15/Caribbean Anthology - July 15, 2023 at 17:00 - CFRU 93.3.mp3','2023-07-15 17:00:00',86507648,NULL,NULL,NULL),(61595,143,'https://archive.cfru.ca/archive/2023/07/29/Mach Vibe Radio - July 29, 2023 at 21:00 - CFRU 93.3.mp3','2023-07-29 21:00:00',86507648,NULL,NULL,NULL),(61596,139,'https://archive.cfru.ca/archive/2023/07/15/Bel Araby with CAWA - July 15, 2023 at 15:00 - CFRU 93.3.mp3','2023-07-15 15:00:00',86507648,NULL,NULL,NULL),(61597,145,'https://archive.cfru.ca/archive/2023/07/23/Visions fugitives - July 23, 2023 at 09:00 - CFRU 93.3.mp3','2023-07-23 09:00:00',86507648,NULL,NULL,NULL),(61598,141,'https://archive.cfru.ca/archive/2023/07/22/Alternativa Latinoamericana - July 22, 2023 at 19:00 - CFRU 93.3.mp3','2023-07-22 19:00:00',86507648,NULL,NULL,NULL),(61599,146,'https://archive.cfru.ca/archive/2023/07/09/The Kookoo Bananas Variety Hour - July 9, 2023 at 10:00 - CFRU 93.3.mp3','2023-07-09 10:00:00',86507648,'2023-10-30 23:52:58','In this chapter, Rowan explains that he is a \"router for the computer\" because he knows that his task is not as difficult as the \"enormous problem\" that the elephant has. The elephant has a \"great