,'2023-10-30 18:33:38','The narrator begins by saying that the word \"eco\" is \"ecological functions first before our human relationship\" . He goes on to say that he doesn\'t know how to spell the word, but he thinks that it\'s important because it refers to the functions of plants before their human relationship. He says that plants need the surrounding environment to do their work. The narrator describes the weather for the next few days and says that he loves the changing seasons. He leads a walk with his partner in the Eroosa River Valley. They had a great time. The weather was beautiful and the landscape was beautiful. He wanted to learn more about the plants, so he decided to read some more. He chose to read a book about plants called \"nature\'s garden\" by Samuel Thayer, and a book called \"The book of field and roadside\" by John Eastman. The first book is from Samuel Thayer. The description of the plant is that it is a species of aster. It has a rosette of leaves that looks like dandelion. The leaves have hairs on the midrib, which is different from the leaves of the other plant. It is also very thin, unlike the other plants. The stalk looks like someone forgot to shrink the leaves. The plant has sessile leaves, which are smaller than the leaves in the rosette. The flowers have ray florets, which means that each flower petal on the flower has its own flower, not the other way around. They open','The Garden of Aster: A Plant That Looks Like a dandelion'),(61924,80,'https://archive.cfru.ca/archive/2023/07/31/CFRU Playlist - July 31, 2023 at 14:00 - CFRU 93.3.mp3','2023-07-31 14:00:00',86507648,'2023-08-16 03:00:50',NULL,NULL),(61925,84,'https://archive.cfru.ca/archive/2023/08/07/Blues Around the Block - August 7, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-07 20:00:00',86507648,'2023-08-16 03:00:51',NULL,NULL),(61926,81,'https://archive.cfru.ca/archive/2023/08/07/The Sentinel’s Marvellous Kaleidoscope - August 7, 2023 at 15:00 - CFRU 93.3.mp3','2023-08-07 15:00:00',86507648,'2023-08-16 03:00:51',NULL,NULL),(61927,82,'https://archive.cfru.ca/archive/2023/08/07/Big Sis Radio - August 7, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-07 17:00:00',86507648,'2023-08-16 03:00:52',NULL,NULL),(61928,83,'https://archive.cfru.ca/archive/2023/08/07/to know the land - August 7, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-07 18:00:00',86507648,'2023-10-30 18:22:58','The show begins with a brief introduction of the listeners, followed by a description of the plant and a discussion of the different kinds of mulberry trees in the area. The show ends with a discussion on the differences between native mulberry and non-native mulberry trees.','The native mulberry and non-native mulberries in the area'),(61929,80,'https://archive.cfru.ca/archive/2023/07/28/CFRU Playlist - July 28, 2023 at 12:00 - CFRU 93.3.mp3','2023-07-28 12:00:00',86507648,'2023-08-16 03:00:52',NULL,NULL),(61930,90,'https://archive.cfru.ca/archive/2023/08/15/Bridging The Social Distance - August 15, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-15 12:00:00',86638720,'2023-08-16 03:00:53',NULL,NULL),(61931,84,'https://archive.cfru.ca/archive/2023/08/07/Blues Around the Block - August 7, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-07 19:00:00',86507648,'2023-08-16 03:00:53',NULL,NULL),(61932,80,'https://archive.cfru.ca/archive/2023/07/27/CFRU Playlist - July 27, 2023 at 14:00 - CFRU 93.3.mp3','2023-07-27 14:00:00',86507648,'2023-08-16 03:00:54',NULL,NULL),(61933,90,'https://archive.cfru.ca/archive/2023/08/08/Bridging The Social Distance - August 8, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-08 12:00:00',86507648,'2023-08-16 03:00:54',NULL,NULL),(61934,91,'https://archive.cfru.ca/archive/2023/08/15/Tuesday at 5 - August 15, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-15 17:00:00',86507648,'2023-08-16 03:00:55',NULL,NULL),(61935,80,'https://archive.cfru.ca/archive/2023/07/25/CFRU Playlist - July 25, 2023 at 07:00 - CFRU 93.3.mp3','2023-07-25 07:00:00',86507648,'2023-08-16 03:00:55',NULL,NULL),(61936,94