et Lost - August 8, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-08 20:00:00',86507648,'2023-08-16 03:00:59',NULL,NULL),(61948,80,'https://archive.cfru.ca/archive/2023/07/19/CFRU Playlist - July 19, 2023 at 17:00 - CFRU 93.3.mp3','2023-07-19 17:00:00',86507648,'2023-08-16 03:01:00',NULL,NULL),(61949,99,'https://archive.cfru.ca/archive/2023/08/09/The Stillness & The Dancing - August 9, 2023 at 10:00 - CFRU 93.3.mp3','2023-08-09 10:00:00',86507648,'2023-10-29 22:55:59','On this second hour of The Stillness And The Dancing, host Joel Cuthbert continues his song selection work. He starts with Home Learning and then Aria Rustami\'s track called \"Here Outside Waiting\" and then a new release from a Montreal duo called \"Sun Drips\" . Finally, he is listening to the program on CFRU93.3. He tells us about Riverfest, which is coming up in Allora in August. He also tells us that the university will be giving away free passes to the festival and that he\'s been watching the women\'s world cup. He says he doesn\'t follow sports religiously, but he knows that watching people in coats is always a reminder of him. He\'s also been listening to music. The show starts off with a piece from Michael Tone called \"Meadow Trail,\" which he calls \"a great little EP.\" He then goes on to talk about some of the other music on the program. He talks about how it\'s warm in the north and how he likes to listen to music that\'s \"more like kind of like really beautiful\" and \"kind of like pastoral\" music. Then he talks about \"Minimal Post-Rock,\" which is one of his favorite kinds of music. He goes on and on about how he loves this music and how it captures \"still that sort of emotion without just fall prey to the building and fall and fall.\" He also talks about a friend of the program, J.Ryan','The Stillness And The Dancing: Joel Cuthbert is listening to the program'),(61950,99,'https://archive.cfru.ca/archive/2023/08/09/The Stillness & The Dancing - August 9, 2023 at 09:00 - CFRU 93.3.mp3','2023-08-09 09:00:00',86507648,'2023-10-29 22:44:43','On this new edition of the show, host Joel Cuthbert introduces his guest. He welcomes listeners to the world of \"ambient, experimental, and modern composition.\" He and his guest discuss the music on the show. The program begins with a shout-out to the listeners who have come to listen to the program, and then begins with an introduction to the show\'s host. He introduces himself as a student at the University of Guelph in Ontario, Canada. He is currently living in a friend\'s house on the other side of town, and he wants to finish up his last week of classes before he goes north for the winter. He tells the listeners that he\'s in a \"funny, funny situation\" in that he has been \"house sitting\" for friends. He\'s been enjoying his time in the house with his cats, but he forgot to take a headphone adapter with him. He doesn\'t know how to use the left channel of his music player, so he only uses the right one. He says he hopes listeners are enjoying the show as much as he does. He hopes they\'re all doing well. He goes on to talk about his summer, which is coming to an end. He also says he\'d like listeners to feel that wherever they are in the world, spring, fall, winter, or spring, they can enjoy whatever they are doing. He talks about the soundtrack to a film called Little Fish, composed by Keegan DeWitt, which','Joel Cuthbert introduces his guest to the world of \"ambient, experimental, and modern composition\"'),(61951,100,'https://archive.cfru.ca/archive/2023/08/09/We Know Some Stuff + CFRU playlist - August 9, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-09 12:00:00',86507648,'2023-08-16 03:01:01',NULL,NULL),(61952,105,'https://archive.cfru.ca/archive/2023/08/09/B Siide Radio - August 9, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-09 19:00:00',86507648,'2023-08-16 03:01:02',NULL,NULL),(61953,101,'https://archive.cfru.ca/archive/2023/08/13/Seems Like Old Times - August 13, 2023 at 15:00 - CFRU 93.3.mp3','2023-08-