https://archive.cfru.ca/archive/2023/08/10/Open Sources Guelph - August 10, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-10 17:00:00',86507648,'2023-10-30 20:50:29','On this week\'s edition of the \"Guelphian Politico\" podcast, Adam A Donaldson, a political reporter for the Guelph Daily Collegian, discusses the recent events in Russia. He and his co-host Catherine Varner discuss the recent actions of a Russian mercenary group, the Wagner Group, led by a man named Eugeny Pragogin, who defected from the group and marched to Moscow to challenge the leadership of Vladimir Putin and his allies. The group\'s leader, who is also known as \"Progosion,\" is wanted by the United States for his role in the murder of countless people. The pro-Putin faction of the Russian military, which includes some of the most powerful men in the country, is trying to take control of the situation. Some of these men, including Pavel Troigu, and Aleksey Girmazov, are loyal to Putin, while others, including Alexei Navalny, are running against him in the upcoming presidential election. The Progosion movement will have to watch over the windows of water bottles and bottles of food in case the Russian government tries to poison him.','The Guelph Daily Collegian discusses the recent events of a Russian military group'),(61966,116,'https://archive.cfru.ca/archive/2023/08/10/T.K.O. - August 10, 2023 at 16:00 - CFRU 93.3.mp3','2023-08-10 16:00:00',86507648,'2023-08-16 03:01:19',NULL,NULL),(61967,119,'https://archive.cfru.ca/archive/2023/08/10/Turtle Island Underground - August 10, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-10 18:00:00',86507648,'2023-08-16 03:01:20',NULL,NULL),(61968,120,'https://archive.cfru.ca/archive/2023/08/10/The Crooked Beat - August 10, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-10 20:00:00',86507648,'2023-08-16 03:01:20',NULL,NULL),(61969,120,'https://archive.cfru.ca/archive/2023/08/10/The Crooked Beat - August 10, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-10 19:00:00',86507648,'2023-08-1