e\'s got a lot left in him. He\'s been feeling this way since he was a kid. He says he\'ll be done now, but he still feels it. He feels like he has a lot of love left for you. The guys start off with the Chipmunks. Then they cut to the music from two other songs: \"Mowbish Crashman\" and \"Mega Man 2.\" The narrator explains that both of these games are very difficult to defeat.','The kids love a song called \"Cleaning,\" a remix of an old song'),(62002,150,'https://archive.cfru.ca/archive/2023/08/13/Zombie Jamboree - August 13, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-13 19:00:00',86507648,'2023-08-16 03:01:44',NULL,NULL),(62003,150,'https://archive.cfru.ca/archive/2023/08/13/Zombie Jamboree - August 13, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-13 18:00:00',86507648,'2023-08-16 03:01:44',NULL,NULL),(62004,148,'https://archive.cfru.ca/archive/2023/08/13/Clan Na Gael - August 13, 2023 at 13:00 - CFRU 93.3.mp3','2023-08-13 13:00:00',86638720,'2023-08-16 03:01:45',NULL,NULL),(62005,148,'https://archive.cfru.ca/archive/2023/08/13/Clan Na Gael - August 13, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-13 12:00:00',86507648,'2023-08-16 03:01:45',NULL,NULL),(62006,149,'https://archive.cfru.ca/archive/2023/08/13/La Buena Onda - August 13, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-13 17:00:00',86638720,'2023-08-16 03:01:46',NULL,NULL),(62007,149,'https://archive.cfru.ca/archive/2023/08/13/La Buena Onda - August 13, 2023 at 16:00 - CFRU 93.3.mp3','2023-08-13 16:00:00',86638720,'2023-08-16 03:01:46',NULL,NULL),(62008,152,'https://archive.cfru.ca/archive/2023/08/13/Through the Looking Glass - August 13, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-13 21:00:00',86507648,'2023-08-16 03:01:47',NULL,NULL),(62009,153,'https://archive.cfru.ca/archive/2023/08/13/Backtracks - August 13, 2023 at 22:00 - CFRU 93.3.mp3','2023-08-13 22:00:00',86507648,'2023-08-16 03:01:47',NULL,NULL),(62010,154,'https://archive.cfru.ca/archive/2023/08/14/This Night Wounds Time - August 14, 2023 at 01:00 - CFRU 93.3.mp3',