023-08-17 01:00:00',86638720,'2023-08-21 03:49:27',NULL,NULL),(62088,97,'https://archive.cfru.ca/archive/2023/08/17/Wild Combination - August 17, 2023 at 00:00 - CFRU 93.3.mp3','2023-08-17 00:00:00',86638720,'2023-08-21 03:49:28',NULL,NULL),(62089,100,'https://archive.cfru.ca/archive/2023/08/16/We Know Some Stuff + CFRU playlist - August 16, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-16 12:00:00',86507648,'2023-08-21 03:49:29',NULL,NULL),(62090,99,'https://archive.cfru.ca/archive/2023/08/16/The Stillness & The Dancing - August 16, 2023 at 10:00 - CFRU 93.3.mp3','2023-08-16 10:00:00',86507648,'2023-10-29 22:35:57','The second hour of the show begins with music from two of the producers\' friends, Rick Johnson and Mikos Ellerens-Estance, as well as a track from another of their friends, Fernando. From there, the show moves to a few other releases, including a guitar track by Niels Fromm, a track by Fubutsu, a folk experimental track by Black Coral Sprigg, and a track called \"It\'s Cloudy outside\" by Preserve Sound. The program ends with some final thoughts on mental health, including the availability of mental health helplines in the province of Ontario.','The second hour of the show begins with music from Rick Johnson and Mikos Ellerens-Estance'),(62091,99,'https://archive.cfru.ca/archive/2023/08/16/The Stillness & The Dancing - August 16, 2023 at 09:00 - CFRU 93.3.mp3','2023-08-16 09:00:00',86638720,'2023-10-29 22:27:16','The host returns from his first week of vacation, and describes his adventures. He spent time in Midland and then in Sudbury, where he found a friend and went on a tour of the city\'s rich mining history. He also took a boat tour around the lake and went to a rail museum. The host is very excited about his vacation because he\'s going to be going back to Montreal to see his family. He has a week off before returning to school in a week. He tells us that it\'s fall, which is usually a good time to go back to school. The weather report and his personal report are included. The first song on the show is an instrumental from musician Gia Margaret, who releases two instrumental releases each year. The music from this artist includes some of her most recent music, as well as some from her friend Robin Seville, her friend Allie McDonald, and her friend Ian Haggard. The rest of the music includes some from David Cordero, Ian\'s friend, and some from Nora Lorway. The show closes with a song from Rick Johnson, a prolific musician.','The first song on the show is an instrumental from Gia Margaret, and some from Ian Haggard'),(62092,102,'https://archive.cfru.ca/archive/2023/08/16/End Credits - August 16, 2023 at 15:00 - CFRU 93.3.mp3','2023-08-16 15:00:00',86507648,'2023-08-21 03:49:33',NULL,NULL),(62093,105,'https://archive.cfru.ca/archive/2023/08/16/B Siide Radio - August 16, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-16 19:00:00',86638720,'2023-08-21 03:49:33',NULL,NULL),(62094,106,'https://archive.cfru.ca/archive/2023/08/16/Trail Mix - August 16, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-16 20:00:00',86638720,'2023-08-21 03:49:34',NULL,NULL),(62095,107,'https://archive.cfru.ca/archive/2023/08/16/Tone Zone - August 16, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-16 21:00:00',86638720,'2023-08-21 03:49:37',NULL,NULL),(62096,109,'https://archive.cfru.ca/archive/2023/08/16/Radia - August 16, 2023 at 00:00 - CFRU 93.3.mp3','2023-08-16 00:00:00',86638720,'2023-08-21 03:49:38',NULL,NULL),(62097,108,'https://archive.cfru.ca/archive/2023/08/20/Wind-Down - August 20, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-20 20:00:00',86507648,'2023-08-21 03:49:38',NULL,NULL),(62098,110,'https://archive.cfru.ca/archive/2023/08/17/Here Today - August 17, 2023 at 07:00 - CFRU 93.3.mp3','2023-08-17 07:00:00',86638720,'2023-08-21 03:49:40',NULL,NULL),(62099,111,'https://archive.cfru.ca/archive/2023/08/17/Tales from the Bridge - August 17, 2023 at 09:00 - CFRU 93.3.mp3','2023-08-17 09:00:00',86638720,'2023-08-21 03:49:40',NULL,NULL),(62100,113,'https://arch