een a long time coming. Ford has promised to cancel all of the recommendations in the report. The biggest recommendation is to take away the plum pickings from the friends of the mayor. The other one is to make sure that the contractors who gave Ford\'s employees the union t-shirts are investigated as well. The second recommendation is that the people who gave the mayor the fake green belt sign should be investigated. The first one is that he take the plums from the','The CNE is a huge, three-day event, and the food is hideous as ever does'),(62106,122,'https://archive.cfru.ca/archive/2023/08/18/Forever Deaf - August 18, 2023 at 01:00 - CFRU 93.3.mp3','2023-08-18 01:00:00',86507648,'2023-08-21 03:49:48',NULL,NULL),(62107,122,'https://archive.cfru.ca/archive/2023/08/18/Forever Deaf - August 18, 2023 at 00:00 - CFRU 93.3.mp3','2023-08-18 00:00:00',86507648,'2023-08-21 03:49:49',NULL,NULL),(62108,122,'https://archive.cfru.ca/archive/2023/08/17/Forever Deaf - August 17, 2023 at 23:00 - CFRU 93.3.mp3','2023-08-17 23:00:00',86638720,'2023-08-21 03:49:49',NULL,NULL),(62109,122,'https://archive.cfru.ca/archive/2023/08/17/Forever Deaf - August 17, 2023 at 22:00 - CFRU 93.3.mp3','2023-08-17 22:00:00',86638720,'2023-08-21 03:49:50',NULL,NULL),(62110,121,'https://archive.cfru.ca/archive/2023/08/17/Sundowner - August 17, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-17 21:00:00',86507648,'2023-08-21 03:49:50',NULL,NULL),(62111,120,'https://archive.cfru.ca/archive/2023/08/17/The Crooked Beat - August 17, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-17 20:00:00',86507648,'2023-08-21 03:49:50',NULL,NULL),(62112,120,'https://archive.cfru.ca/archive/2023/08/17/The Crooked Beat - August 17, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-17 19:00:00',86638720,'2023-08-21 03:49:51',NULL,NULL),(62113,124,'https://archive.cfru.ca/archive/2023/08/18/Planet Groove - August 18, 2023 at 10:00 - CFRU 93.3.mp3','2023-08-18 10:00:00',86507648,'2023-08-21 03:49:51',NULL,NULL),(62114,123,'https://archive.cfru.ca/ar