 since the beginning. The second hour starts with some music from a buddy named Mikos Fernando. Mikos has been experimenting with different sounds, and his latest release is called \"Last Night I Found my Shadow Crying\" and was released in 2023. The third track is a tribute to John Cage by the guy named Sunsetter. The fourth track is an ambient guitar release by a guy called Machines of Loving grace. The track is named \"All Watched over by machines of loving grace\" and is probably a nod to the late John Cage. The fifth track is one of his favorite releases of all time, by Nils Fromme. The sixth track is another tribute to Fromme, this time called \"Then Patterns\" and the seventh is a track by a friend of his named Francisco Sonor called \"Eight Years\" and it\'s from Healthy Trees. The program ends with a little rain, so the show is over. If you missed a track on the show, you can find it on Facebook. If there is any missing track, the show will try to track it down.','The first track is from a guy who\'s putting out new music on Bandcamp'),(62244,99,'https://archive.cfru.ca/archive/2023/08/23/The Stillness & The Dancing - August 23, 2023 at 09:00 - CFRU 93.3.mp3','2023-08-23 09:00:00',86507648,'2023-10-29 22:32:44','bigbird-pegasus-large-bigpatent - A new episode of the show, here in the stillness in the dancing. Im your host, host, host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im your host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im your host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im your host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im your host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im your host, host, host, with some descriptive routines on what youve heard and what youre going to hear. Im you