he factors that go into building a new hospital and the associated staffing issues.',NULL),(62355,84,'https://archive.cfru.ca/archive/2023/08/28/Blues Around the Block - August 28, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-28 20:00:00',86507648,'2023-08-29 13:51:55',NULL,NULL),(62356,85,'https://archive.cfru.ca/archive/2023/08/28/Ripcord Radio - August 28, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-28 21:00:00',86638720,'2023-08-29 13:51:56',NULL,NULL),(62357,84,'https://archive.cfru.ca/archive/2023/08/28/Blues Around the Block - August 28, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-28 19:00:00',86507648,'2023-08-29 13:51:56',NULL,NULL),(62358,83,'https://archive.cfru.ca/archive/2023/08/28/to know the land - August 28, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-28 18:00:00',86507648,'2023-10-30 18:03:01','The topic of the conversation is reproductive biology, and the UM\'s Rosalind seeks to understand how plants make with each other, how they hybrids, and how they form new species. She does this by studying how plants evolve from cross-breeding to exclusively self-breeding, or \"self-fertilization.\" Rosalind\'s passion for reproductive biology is related to her time in Brazil studying a plant that had three different sexes, or three mating types. She was fascinated by the way that these different types of plants dictated the way the pollen was moved, and she was able to observe how those plants affected the way their species evolved. Rosalind was also interested in how these plants were able to change over time, so that the different types could mate and produce offspring that were of the same type. Rosalind is particularly interested in the question of \"perfect flowers,\" which she describes as \"wet that tail.\" She is also fascinated with the concept of gender, because \"the concepts of gender are extremely important.\" Rosalind describes a new project called \"Ontario Heritage and Feral Apples.\" The goal of the project is to better understand the distribution and abundance of domestic apples and to study the potential applications of these apples for cider production and wild environments. She also discusses the idea of \"heterozygous,\" which is the definition of a \"high heterozygousion.\"','The UM\'s Rosalind explores how plants evolve from cross-breeding to exclusively self-breech'),(62359,108,'https://archive.cfru.ca/archive/2023/08/27/Wind-Down - August 27, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-27 20:00:00',86507648,'2023-08-29 13:52:13',NULL,NULL),(62360,140,'https://archive.cfru.ca/archive/2023/08/26/Caribbean Anthology - August 26, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-26 17:00:00',86507648,'2023-08-29 13:52:44',NULL,NULL),(62361,140,'https://archive.cfru.ca/archive/2023/08/26/Caribbean Anthology - August 26, 2023 at 16:00 - CFRU 93.3.mp3','2023-08-26 16:00:00',86507648,'2023-08-29 13:52:45',NULL,NULL),(62362,138,'https://archive.cfru.ca/archive/2023/08/26/Sound Magic - August 26, 2023 at 14:00 - CFRU 93.3.mp3','2023-08-26 14:00:00',86638720,'2023-08-29 13:52:45',NULL,NULL),(62363,138,'https://archive.cfru.ca/archive/2023/08/26/Sound Magic - August 26, 2023 at 13:00 - CFRU 93.3.mp3','2023-08-26 13:00:00',86507648,'2023-08-29 13:52:45',NULL,NULL),(62364,139,'https://archive.cfru.ca/archive/2023/08/26/Bel Araby with CAWA - August 26, 2023 at 15:00 - CFRU 93.3.mp3','2023-08-26 15:00:00',86638720,'2023-08-29 13:52:46',NULL,NULL),(62365,138,'https://archive.cfru.ca/archive/2023/08/26/Sound Magic - August 26, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-26 12:00:00',86507648,'2023-08-29 13:52:46',NULL,NULL),(62366,141,'https://archive.cfru.ca/archive/2023/08/26/Alternativa Latinoamericana - August 26, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-26 19:00:00',86507648,'2023-08-29 13:52:47',NULL,NULL),(62367,141,'https://archive.cfru.ca/archive/2023/08/26/Alternativa Latinoamericana - August 26, 2023 at 18:00 - CFRU 93.3.mp3','2023-08-26 18:00:00',86638720,'2023-08-29 13:52:47',NULL,NULL),(62368,142,'https://archive.cfru.ca/archive/202