 greet all newcomers with kindness and goodwill. He also encourages listeners to get involved in Welcoming Week, a week-long celebration of people from all over the world coming to Canada for the first time. The narrator explains that his family has five people in it: his sister, two brothers, his mother, and his pup. He is glad that he has five in his family, because he\'d never swap one of them for another. He says that he\'s glad he has two brothers and a sister and a mother and a pup, because that\'s enough for him. The music is a song from Sesame Street called \"Five Million Families in the World.\" The narrator says that the song came from a Sesame Street show called \"Mothers and Fathers.\" The song introduces the narrator to a band called \"The Moon.\" The band sings a song about mothers and fathers. The song also introduces the song \"Fire with my Father\'s name as dad.\" Then the narrator asks the audience what kind of music they\'ll hear after listening to the father song. The band plays songs about moms. The songs are all about moms, and the narrator tells us that they\'ve played a lot of moms\' songs before. They\'ve even played songs about cats, like \"Mother May I.\" The second song is about a guy who\'s going to his mom to ask her to teach him some new dance. The dance is','The narrator tells the audience to listen to a new song about moms and fathers'),(62379,149,'https://archive.cfru.ca/archive/2023/08/27/La Buena Onda - August 27, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-27 17:00:00',86638720,'2023-08-29 13:52:55',NULL,NULL),(62380,150,'https://archive.cfru.ca/archive/2023/08/27/Zombie Jamboree - August 27, 2023 at 19:00 - CFRU 93.3.mp3','2023-08-27 19:00:00',86638720,'2023-08-29 13:52:56',NULL,NULL),(62381,148,'https://archive.cfru.ca/archive/2023/08/27/Clan Na Gael - August 27, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-27 12:00:00',86507648,'2023-08-29 13:52:57',NULL,NULL),(62382,149,'https://archive.cfru.ca/archive/2023/08/27/La Buena Onda - Augus