62456,79,'https://archive.cfru.ca/archive/2023/09/04/Breezy Breakfast Radio - September 4, 2023 at 10:00 - CFRU 93.3.mp3','2023-09-04 10:00:00',86638720,'2023-10-26 03:01:07','Cameron Walsh is back with his final breezy breakfast of the summer. What do you think of culture conversation cafes? Have your say about the Parks and Recreation Master Plan. Are you confident with your skills? Improve the skills you need for work and life.',NULL),(62457,79,'https://archive.cfru.ca/archive/2023/09/04/Breezy Breakfast Radio - September 4, 2023 at 09:00 - CFRU 93.3.mp3','2023-09-04 09:00:00',86638720,'2023-10-26 02:57:39','Cameron Walsh, the division manager of solid waste resources in the city of Guelph, explains how the city is working to transition to a new collection model. Under the new model, companies that produce blue bin materials must fully fund and operate the recycling system. The Downtown Waste Disposal Project is also an important topic. Be sure to have your say before August 18th.',NULL),(62458,81,'https://archive.cfru.ca/archive/2023/09/04/The Sentinel’s Marvellous Kaleidoscope - September 4, 2023 at 15:00 - CFRU 93.3.mp3','2023-09-04 15:00:00',86507648,'2023-09-05 01:15:15',NULL,NULL),(62459,81,'https://archive.cfru.ca/archive/2023/08/30/The Sentinel’s Marvellous Kaleidoscope - August 30, 2023 at 17:00 - CFRU 93.3.mp3','2023-08-30 17:00:00',86507648,'2023-09-05 01:15:15',NULL,NULL),(62460,90,'https://archive.cfru.ca/archive/2023/08/31/Bridging The Social Distance - August 31, 2023 at 12:00 - CFRU 93.3.mp3','2023-08-31 12:00:00',86638720,'2023-09-05 01:15:16',NULL,NULL),(62461,83,'https://archive.cfru.ca/archive/2023/09/04/to know the land - September 4, 2023 at 18:00 - CFRU 93.3.mp3','2023-09-04 18:00:00',86507648,'2023-10-30 17:52:58','On this episode of the Talk Show, we speak with Byron, an artist, about his recent work, called \"Animal Forms.\" The artist is named Mickey Tamblin and he is a wildlife educator. He has created a series of masks that represent various animals that live in the forest and has invited people to interact with the masks and read journal entries. He also has asked people to take photographs of their experiences with the mask. The two talk about how seeing the world from another\'s point of view can affect one\'s actions, and about the work of the Council of Beings, an organization dedicated to bringing together all forms of being. The artist says he came to the project to participate in naming his own mask. He says he chose the raccoon mask as a challenge to himself and to the world. The project is playful and playful as well, and the artist says that adults often don\'t have time to play with their masks, which are a bit silly.','Byron, a wildlife educator, has created a mask for the world'),(62462,78,'https://archive.cfru.ca/archive/2023/09/04/Morning Soul Shake-Up! - September 4, 2023 at 08:00 - CFRU 93.3.mp3','2023-09-04 08:00:00',86507648,'2023-09-05 01:15:16',NULL,NULL),(62463,78,'https://archive.cfru.ca/archive/2023/09/01/Morning Soul Shake-Up! - September 1, 2023 at 08:00 - CFRU 93.3.mp3','2023-09-01 08:00:00',86507648,'2023-09-05 01:15:17',NULL,NULL),(62464,84,'https://archive.cfru.ca/archive/2023/09/04/Blues Around the Block - September 4, 2023 at 20:00 - CFRU 93.3.mp3','2023-09-04 20:00:00',86638720,'2023-09-05 01:15:20',NULL,NULL),(62465,78,'https://archive.cfru.ca/archive/2023/08/31/Morning Soul Shake-Up! - August 31, 2023 at 08:00 - CFRU 93.3.mp3','2023-08-31 08:00:00',86507648,'2023-09-05 01:15:21',NULL,NULL),(62466,84,'https://archive.cfru.ca/archive/2023/09/04/Blues Around the Block - September 4, 2023 at 19:00 - CFRU 93.3.mp3','2023-09-04 19:00:00',86507648,'2023-09-05 01:15:21',NULL,NULL),(62467,78,'https://archive.cfru.ca/archive/2023/08/30/Morning Soul Shake-Up! - August 30, 2023 at 08:00 - CFRU 93.3.mp3','2023-08-30 08:00:00',86507648,'2023-09-05 01:15:22',NULL,NULL),(62468,91,'https://archive.cfru.ca/archive/2023/08/29/Tuesday at 5 - August 29, 2023 at 17:00 - CFRU 93.3.m