overnment has also come out against the process of collective bargaining, arguing that it is too time-consuming and that it will only delay the inevitable. The strike vote doesn\'t mean that the teachers are on strike, says the show\'s host. He has been voting for collective agreements every single time he\'s voted on them. He finds this to be a back-pocket bargaining tactic that the government uses to try and get things done. On the flip side, he finds the tone of the strike different than it was in the past, when there were so many distractions in the school. Parents are still trying to catch up with the times, but there is no hard talk this time around. The only reason the teachers got a contract in the first place was because of a pandemic, and the teachers wanted to sign a contract now, rather than come back and work out','The teachers are on strike, says the show\'s host . The government has come out against the collective bargaining process'),(62492,122,'https://archive.cfru.ca/archive/2023/09/01/Forever Deaf - September 1, 2023 at 01:00 - CFRU 93.3.mp3','2023-09-01 01:00:00',86507648,'2023-09-05 01:15:45',NULL,NULL),(62493,122,'https://archive.cfru.ca/archive/2023/09/01/Forever Deaf - September 1, 2023 at 00:00 - CFRU 93.3.mp3','2023-09-01 00:00:00',86507648,'2023-09-05 01:15:46',NULL,NULL),(62494,121,'https://archive.cfru.ca/archive/2023/08/31/Sundowner - August 31, 2023 at 21:00 - CFRU 93.3.mp3','2023-08-31 21:00:00',86638720,'2023-09-05 01:15:46',NULL,NULL),(62495,122,'https://archive.cfru.ca/archive/2023/08/31/Forever Deaf - August 31, 2023 at 23:00 - CFRU 93.3.mp3','2023-08-31 23:00:00',86507648,'2023-09-05 01:15:46',NULL,NULL),(62496,120,'https://archive.cfru.ca/archive/2023/08/31/The Crooked Beat - August 31, 2023 at 20:00 - CFRU 93.3.mp3','2023-08-31 20:00:00',86638720,'2023-09-05 01:15:47',NULL,NULL),(62497,122,'https://archive.cfru.ca/archive/2023/08/31/Forever Deaf - August 31, 2023 at 22:00 - CFRU 93.3.mp3','2023-08-31 22:00:00',86638720,'2023-09