 songs on the show are music from the Canadian school, so the person who wrote the song will get a check from the school. Next, the program asks about the students, and they reveal that they are in different grades: Oliver is in grade three, Sankiajmita is in a different grade, and Annae is in another grade. They also talk about their art classes, and about the lessons they\'ve learned so far in the school year. They talk about spelling, and writing, and how they learned to read and write. They play a few songs from old shows about reading, including one called \"Read Along,\" which is creepy. The second song, \"Read All About It,\" is a','The musical program starts with a description of the show, then segues into the program\'s main subject'),(62516,149,'https://archive.cfru.ca/archive/2023/09/03/La Buena Onda - September 3, 2023 at 17:00 - CFRU 93.3.mp3','2023-09-03 17:00:00',86507648,'2023-09-05 01:16:08',NULL,NULL),(62517,149,'https://archive.cfru.ca/archive/2023/09/03/La Buena Onda - September 3, 2023 at 16:00 - CFRU 93.3.mp3','2023-09-03 16:00:00',86638720,'2023-09-05 01:16:08',NULL,NULL),(62518,148,'https://archive.cfru.ca/archive/2023/09/03/Clan Na Gael - September 3, 2023 at 15:00 - CFRU 93.3.mp3','2023-09-03 15:00:00',86507648,'2023-09-05 01:16:09',NULL,NULL),(62519,148,'https://archive.cfru.ca/archive/2023/09/03/Clan Na Gael - September 3, 2023 at 14:00 - CFRU 93.3.mp3','2023-09-03 14:00:00',86638720,'2023-09-05 01:16:09',NULL,NULL),(62520,148,'https://archive.cfru.ca/archive/2023/09/03/Clan Na Gael - September 3, 2023 at 13:00 - CFRU 93.3.mp3','2023-09-03 13:00:00',86507648,'2023-09-05 01:16:09',NULL,NULL),(62521,148,'https://archive.cfru.ca/archive/2023/09/03/Clan Na Gael - September 3, 2023 at 12:00 - CFRU 93.3.mp3','2023-09-03 12:00:00',86507648,'2023-09-05 01:16:10',NULL,NULL),(62522,150,'https://archive.cfru.ca/archive/2023/09/03/Zombie Jamboree - September 3, 2023 at 19:00 - CFRU 93.3.mp3','2023-09-03 19:00:00',86638720,'2023-09-05 01:16:10',NULL,N