company partner, as a new member of its cabinet. Mutton\'s lobbying firm has also made an appearance in the new cabinet. The government has also announced a new consultation process for the Greenbelt, which means that the government is not consulting with the public. The new government has not yet announced that it will halt the process, but rather that it is going to review all of its plans and come up with a final decision. Adam says that this government is \"almost masochistic\" and that','The Eden Mills Writers’ Festival will be held on September 10th, 2019'),(62664,119,'https://archive.cfru.ca/archive/2023/09/07/Turtle Island Underground - September 7, 2023 at 18:00 - CFRU 93.3.mp3','2023-09-07 18:00:00',86507648,'2023-09-10 02:48:52',NULL,NULL),(62665,124,'https://archive.cfru.ca/archive/2023/09/08/Planet Groove - September 8, 2023 at 10:00 - CFRU 93.3.mp3','2023-09-08 10:00:00',86507648,'2023-09-10 02:48:57',NULL,NULL),(62666,120,'https://archive.cfru.ca/archive/2023/09/07/The Crooked Beat - September 7, 2023 at 20:00 - CFRU 93.3.mp3','2023-09-07 20:00:00',86507648,'2023-09-10 02:49:03',NULL,NULL),(62667,120,'https://archive.cfru.ca/archive/2023/09/07/The Crooked Beat - September 7, 2023 at 19:00 - CFRU 93.3.mp3','2023-09-07 19:00:00',86507648,'2023-09-10 02:49:08',NULL,NULL),(62668,122,'https://archive.cfru.ca/archive/2023/09/08/Forever Deaf - September 8, 2023 at 01:00 - CFRU 93.3.mp3','2023-09-08 01:00:00',86507648,'2023-09-10 02:49:14',NULL,NULL),(62669,122,'https://archive.cfru.ca/archive/2023/09/08/Forever Deaf - September 8, 2023 at 00:00 - CFRU 93.3.mp3','2023-09-08 00:00:00',86507648,'2023-09-10 02:49:20',NULL,NULL),(62670,128,'https://archive.cfru.ca/archive/2023/09/08/Walkuman Style - September 8, 2023 at 18:00 - CFRU 93.3.mp3','2023-09-08 18:00:00',86507648,'2023-09-10 02:49:25',NULL,NULL),(62671,122,'https://archive.cfru.ca/archive/2023/09/07/Forever Deaf - September 7, 2023 at 23:00 - CFRU 93.3.mp3','2023-09-07 23:00:00',86507648,'2023-09-10 02: