e/2023/09/11/The Deep House Project - September 11, 2023 at 22:00 - CFRU 93.3.mp3','2023-09-11 22:00:00',86507648,'2023-09-12 03:35:56',NULL,NULL),(62754,84,'https://archive.cfru.ca/archive/2023/09/11/Blues Around the Block - September 11, 2023 at 20:00 - CFRU 93.3.mp3','2023-09-11 20:00:00',86638720,'2023-09-12 03:36:02',NULL,NULL),(62755,83,'https://archive.cfru.ca/archive/2023/09/11/to know the land - September 11, 2023 at 18:00 - CFRU 93.3.mp3','2023-09-11 18:00:00',86507648,'2023-10-30 17:43:25','The Underground Man begins his second song, \"The Top Soil . . snapping turtles in quietly brushes will grow\" . In this song, the Underground Man says, \"the top soil . will grow in places where they stolen the top soil.\" He goes on to say that, \"Toronto was born for 10 chillings old crooked feet like dominoes\" , which is a reference to the Ten Chillings of Jim Crow. He then turns to an album by a band called the Bolrushes, which he describes as \"an album of bull rushes.\" The album was released in response to the eviction of the Indigenous Peoples of Brantford by the Ontario Provincial Police and the destruction of native lands by a company called Target. The album is inspired by the resistance of the Iroquois people to this development and is dedicated to celebrating the \"colonization day\" of this country. The underground man says that he has been in Toronto to see shows and he hopes to be able to continue playing music in the future, but he\'s worried about the weather. He says that the wind is blowing from the west and it feels 38 degrees outside. He\'s been out exploring and looking for bugs all day, and he came up with the idea of recording a song in his journal about spittle bugs, a family of freshwater insects. The spittle bug is a member of the same family of insects as leafhoppers, which means it\'s basically the same group of insects, except','The Underground Man is recording a song about spittle bugs, a family of freshwater insects'),(62756,82,'https