sday at 5:00PM as the host discusses the latest news from the Guelph area. The show also discusses the recent Conservative Party of Canada policy convention in Quebec City. The convention passed many conservative resolutions, but the most important resolutions are those that directly attack the Trudeau administration. The Trudeau government is spending a lot of money on defense, and the government seems to be trying to teach Canadians how to eat insects. The government is pushing bugs, which is the same kind of conspiracy theory that the Trudeaus and the Berniers are trying to propagate in the United States. The scandal surrounding the leak of information about the government\'s lobbying activities is also a big issue for the Conservative Party in Canada. Some of the people on the governing board are made up of people who support corporations that have significant investments in Canada','CFRU\'s political and current affairs show airs every Thursday at 5:00PM'),(62840,120,'https://archive.cfru.ca/archive/2023/09/14/The Crooked Beat - September 14, 2023 at 19:00 - CFRU 93.3.mp3','2023-09-14 19:00:00',86507648,'2023-09-15 00:54:24',NULL,NULL),(62841,119,'https://archive.cfru.ca/archive/2023/09/14/Turtle Island Underground - September 14, 2023 at 18:00 - CFRU 93.3.mp3','2023-09-14 18:00:00',86507648,'2023-09-15 00:54:25',NULL,NULL),(62842,1437,'https://archive.cfru.ca/archive/2023/09/14/Democracy Now - September 14, 2023 at 11:00 - CFRU 93.3.mp3','2023-09-14 11:00:00',86507648,'2023-09-15 00:55:04',NULL,NULL),(62843,1437,'https://archive.cfru.ca/archive/2023/09/14/Democracy Now (Rebroadcast) - September 14, 2023 at 02:00 - CFRU 93.3.mp3','2023-09-14 02:00:00',86507648,'2023-09-15 00:55:04',NULL,NULL),(62845,158,'https://mcdn.podbean.com/mf/web/mp989h/RR_sep_12bok2n.mp3','2023-09-15 17:59:54',143961989,'2023-09-16 04:38:52',NULL,NULL),(62846,170,'https://mcdn.podbean.com/mf/web/k6c832/Ruby_Slippers_Sept_15_mp3_-_2023-09-11_905_PM76h9x.mp3','2023-09-15 22:46:09',11137852