 country hit by the Four Tops. The narrator starts off by saying \"we got love.\" We got love, we got love. And we\'re about to get a little bit more of this kind of thing when we introduce our new friend, Little Tom. Little Tom is a little chubby, and he used to talk to his friends like a kid would talk to a friend. The two of them talk about how they used to say funny things, and Little Tom remembers some of the ones that he remembers. He also tells us that he\'s happy to have his cousin\'s birthday after Christmas, because it\'ll be a little more fun. He says that his friend Elliot told him that he would have a better time celebrating his birthday in August than in December because his parents are out of money for Christmas presents. We\'ll get to that later. The kids have a bit of a discussion about their favorite childhood songs, and the narrator points out that a lot of them don\'t sound like the songs','We Got Love, and we\'re about to get a little bit more of this kind of thing'),(63262,148,'https://archive.cfru.ca/archive/2023/09/17/Clan Na Gael - September 17, 2023 at 13:00 - CFRU 93.3.mp3','2023-09-17 13:00:00',86638720,'2023-09-18 12:07:22',NULL,NULL),(63263,148,'https://archive.cfru.ca/archive/2023/09/17/Clan Na Gael - September 17, 2023 at 12:00 - CFRU 93.3.mp3','2023-09-17 12:00:00',86507648,'2023-09-18 12:07:23',NULL,NULL),(63264,149,'https://archive.cfru.ca/archive/2023/09/17/La Buena Onda - September 17, 2023 at 17:00 - CFRU 93.3.mp3','2023-09-17 17:00:00',86638720,'2023-09-18 12:07:26',NULL,NULL),(63265,149,'https://archive.cfru.ca/archive/2023/09/17/La Buena Onda - September 17, 2023 at 16:00 - CFRU 93.3.mp3','2023-09-17 16:00:00',86507648,'2023-09-18 12:07:26',NULL,NULL),(63266,150,'https://archive.cfru.ca/archive/2023/09/17/Zombie Jamboree - September 17, 2023 at 19:00 - CFRU 93.3.mp3','2023-09-17 19:00:00',86507648,'2023-09-18 12:07:28',NULL,NULL),(63267,150,'https://archive.cfru.ca/archive/2023/09/17/Zombie Jamboree - September 17, 2023 at 18