er_14th_2023_Higher_Ground63cdl.mp3','2023-09-21 22:31:55',287962512,'2023-09-22 00:06:07',NULL,NULL),(63708,118,'https://archive.cfru.ca/archive/2023/09/21/Open Sources Guelph - September 21, 2023 at 17:00 - CFRU 93.3.mp3','2023-09-21 17:00:00',86638720,'2023-10-30 19:42:06','The show begins with a welcome to the open source community from Adam A. Donaldson of the Guelph Politico and Scott Hertz of Guelph FM Donaldson. The show is hosted by Adam, who is the host of the CFRU 93.2 open source news program. The program covers the latest news from the region and around the globe. Adam and Scott discuss the recent events in the city. First, the Canadian government has announced that the Indian government has murdered a Canadian citizen, a Sikh man named Hardeep Nijar. This news has caused tensions with India, who has issued an international travel advisory for anyone from the Indian state visiting Canada. This has also brought up the frosty relationship between the two countries at the G20. The program also discusses the upcoming military cooperation summit being held in India. It is not clear if this summit will have any negative effects on Canada, but it will certainly have a chilling effect on other countries. The Canadian government is not in any hurry to cancel the summit. It has, however, shut down the business of the country\'s embassy in India after the failed trade talks with India. If this is the case, it is highly unusual, and it is a blow to the Canadian political system. The Canadians are demanding to know the exact nature of the killing, but the government does not have the means to give them the information they need. The killing seems to have been coordinated among a number of organizations, including some who had been trying to kill Hardeep for years. It','New Open Source News Program is a blow to the Canadian political system'),(63709,119,'https://archive.cfru.ca/archive/2023/09/21/Turtle Island Underground - September 21, 2023 at 18:00 - CFRU 93.3.mp3