 already sunk a few hundred million dollars into it and I don\'t want to see that money wasted. I\'m going to continue to push Infrastructure Ontario to respect the heritage at the Guelph reformatory lands, and especially these murals.',NULL),(63914,79,'https://archive.cfru.ca/archive/2023/09/23/Breezy Breakfast Radio - September 23, 2023 at 07:00 - CFRU 93.3.mp3','2023-09-23 07:00:00',86507648,'2023-10-26 02:48:22','Breezy Breakfast welcomes Guelph MPP Mike Schreiner for a Queens Park update and Q&A session. The challenges facing Ontario are legion, the lack of affordable housing, ever increasing rents, and the shortage of health care workers are at the top of the list. MPP Sch reiner has plans for three new bills regarding the Greenbelt, 400 series highways, and quarries.',NULL),(63915,136,'https://archive.cfru.ca/archive/2023/09/23/A Dog’s Breakfast - September 23, 2023 at 10:00 - CFRU 93.3.mp3','2023-09-23 10:00:00',86507648,'2023-09-24 04:07:10',NULL,NULL),(63916,138,'https://archive.cfru.ca/archive/2023/09/23/Sound Magic - September 23, 2023 at 14:00 - CFRU 93.3.mp3','2023-09-23 14:00:00',86638720,'2023-09-24 04:07:15',NULL,NULL),(63917,138,'https://archive.cfru.ca/archive/2023/09/23/Sound Magic - September 23, 2023 at 13:00 - CFRU 93.3.mp3','2023-09-23 13:00:00',86507648,'2023-09-24 04:07:15',NULL,NULL),(63918,138,'https://archive.cfru.ca/archive/2023/09/23/Sound Magic - September 23, 2023 at 12:00 - CFRU 93.3.mp3','2023-09-23 12:00:00',86507648,'2023-09-24 04:07:16',NULL,NULL),(63919,139,'https://archive.cfru.ca/archive/2023/09/23/Bel Araby with CAWA - September 23, 2023 at 15:00 - CFRU 93.3.mp3','2023-09-23 15:00:00',86507648,'2023-09-24 04:07:16',NULL,NULL),(63920,140,'https://archive.cfru.ca/archive/2023/09/23/Caribbean Anthology - September 23, 2023 at 17:00 - CFRU 93.3.mp3','2023-09-23 17:00:00',86507648,'2023-09-24 04:07:18',NULL,NULL),(63921,142,'https://archive.cfru.ca/archive/2023/09/23/Tiempo de Mujeres - September 23, 2023 at 20:00 - CFRU 93.3.mp3