3 at 23:00 - CFRU 93.3.mp3','2023-09-23 23:00:00',86507648,'2023-09-24 22:07:49',NULL,NULL),(63942,145,'https://archive.cfru.ca/archive/2023/09/24/Visions fugitives - September 24, 2023 at 09:00 - CFRU 93.3.mp3','2023-09-24 09:00:00',86507648,'2023-09-24 22:07:50',NULL,NULL),(63943,145,'https://archive.cfru.ca/archive/2023/09/24/Visions fugitives - September 24, 2023 at 08:00 - CFRU 93.3.mp3','2023-09-24 08:00:00',86507648,'2023-09-24 22:07:51',NULL,NULL),(63944,146,'https://archive.cfru.ca/archive/2023/09/24/The Kookoo Bananas Variety Hour - September 24, 2023 at 10:00 - CFRU 93.3.mp3','2023-09-24 10:00:00',86507648,'2023-10-30 22:06:20','The students at the school begin their first day back to school and Oliver and Jake are excited to get back to the routine of school. The songs they\'re going to sing are all about school. They\'re all about how much fun it is to be in school and how boring it is. Oliver is in grade 7 now, and Jake is now in grade 3. Oliver says that in grade 7, there are more responsibilities, more sports, more clubs, and more science and math. Jake says that he\'s in grade three because he doesn\'t have an awesome science teacher. Oliver asks if the songs are going to be about the ABCs, and the guys say yes. They play a game to teach the kids how to spell. They memorize the alphabet, and then they play a rhyming game to learn how many numbers they can correctly guess. They sing a song about a band called Three Simmons, and they play another song about school, this time about how school is like sucking kids\' happiness.','The first day of school is back, and we\'re going to sing a song'),(63945,148,'https://archive.cfru.ca/archive/2023/09/24/Clan Na Gael - September 24, 2023 at 13:00 - CFRU 93.3.mp3','2023-09-24 13:00:00',86507648,'2023-09-24 22:07:54',NULL,NULL),(63946,148,'https://archive.cfru.ca/archive/2023/09/24/Clan Na Gael - September 24, 2023 at 12:00 - CFRU 93.3.mp3','2023-09-24 12:00:00',86638720,'2023-09-24 22:07:54',NULL,NULL),(63947,