 and goes on to play a song called \"Everything\'s Gonna be Alright\" and then he begins his weekly musical trip with \"strings broken threads and springs broken heads\". He says that the streets are filled with broken people and that he is \"a sing-looking flame\" and that is why he is so big. He says he is a \"bunch of turnips\" and says that he can play the keys but that he does not play any other things. He also says that if he needs to call heaven, he will stop his feet. Then he says he has \"engine trouble\" and someone is riding in his car and he is afraid that someone else is driving it. Ken asks how he can drive his car, and he','Ken Stower says he is a \"sing-looking flame\" and he has \"engine trouble\"'),(64703,149,'https://archive.cfru.ca/archive/2023/10/01/La Buena Onda - October 1, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-01 17:00:00',86507648,'2023-10-02 00:07:13',NULL,NULL),(64704,150,'https://archive.cfru.ca/archive/2023/10/01/Zombie Jamboree - October 1, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-01 18:00:00',86507648,'2023-10-02 00:07:16',NULL,NULL),(64708,170,'https://mcdn.podbean.com/mf/web/itz7gv/Ruby_Slippers_Sept_29_mp3_-_2023-09-25_818_PM9o7vc.mp3','2023-10-02 01:20:01',111378520,'2023-10-02 02:05:26',NULL,NULL),(64715,108,'https://archive.cfru.ca/archive/2023/10/01/Wind-Down - October 1, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-01 20:00:00',86638720,'2023-10-02 02:06:42',NULL,NULL),(64716,150,'https://archive.cfru.ca/archive/2023/10/01/Zombie Jamboree - October 1, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-01 19:00:00',86507648,'2023-10-02 02:07:21',NULL,NULL),(64726,200,'https://mcdn.podbean.com/mf/web/u3uipq/Karibuni_Oct_1-20238r01f.mp3','2023-10-02 02:37:22',287962512,'2023-10-02 04:05:55',NULL,NULL),(64727,153,'https://archive.cfru.ca/archive/2023/10/01/Backtracks - October 1, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-01 22:00:00',86507648,'2023-10-02 04:07:15',NULL,NULL),(64728,152,'https://archive.cfru.ca/archive/2023/10/01/Through the Looking