rchive/2023/10/02/Democracy Now - October 2, 2023 at 11:00 - CFRU 93.3.mp3','2023-10-02 11:00:00',86638720,'2023-10-02 18:07:19',NULL,NULL),(64800,1438,'https://archive.cfru.ca/archive/2023/10/02/Worst Responders - October 2, 2023 at 12:00 - CFRU 93.3.mp3','2023-10-02 12:00:00',86638720,'2023-10-02 18:07:21',NULL,NULL),(64810,80,'https://archive.cfru.ca/archive/2023/10/02/CFRU Playlist - October 2, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-02 14:00:00',86507648,'2023-10-02 20:06:33',NULL,NULL),(64820,81,'https://archive.cfru.ca/archive/2023/10/02/The Sentinel’s Marvellous Kaleidoscope - October 2, 2023 at 15:00 - CFRU 93.3.mp3','2023-10-02 15:00:00',86638720,'2023-10-02 22:06:24',NULL,NULL),(64830,82,'https://archive.cfru.ca/archive/2023/10/02/Big Sis Radio - October 2, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-02 17:00:00',86507648,'2023-10-03 00:06:07',NULL,NULL),(64831,83,'https://archive.cfru.ca/archive/2023/10/02/to know the land - October 2, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-02 18:00:00',86638720,'2023-10-30 16:52:24','The narrator of this program is Byron, the host of CFRU\'s Big Sis Radio. He tells us that he\'s on the lookout for volunteers to participate in a study about the effects of COVID-19 on young and older adults. The narrator also tells us about Silence, a non-profit organization that works to preserve silence. They need your support to continue their work, so they\'re asking you to pledge to silence for a month. If you can\'t commit $10 a month but want to support the cause, you can pledge to support Silence for a year. You can support Silence by signing up for their pledge of silence. Byron tells us his name is Cece, and he is a producer on the CFRU program, To Know the land. Byron introduces himself as Dr Troy McMullen, a research scientist at the Canadian museum of nature. He says he started his career as a high school biology teacher. He was interested in studying lichens because he was involved in protecting old growth forest in Nova Scotia. He wanted to get his master\'s degree, so he went to different universities to find out what other scientists were studying. He found there weren\'t many people who studied lichens. He ended up spending most of his time learning about lichens from other scientists. He\'s published two books, one on lichens and the other on the common lichens of the Great Lakes. Byron wants to know what\'s different about the new book, Macro','Big Sis Radio narrator asks you to pledge to silence for a month'),(64841,84,'https://archive.cfru.ca/archive/2023/10/02/Blues Around the Block - October 2, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-02 20:00:00',86507648,'2023-10-03 02:06:23',NULL,NULL),(64842,84,'https://archive.cfru.ca/archive/2023/10/02/Blues Around the Block - October 2, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-02 19:00:00',86638720,'2023-10-03 02:06:24',NULL,NULL),(64852,86,'https://archive.cfru.ca/archive/2023/10/02/The Deep House Project - October 2, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-02 22:00:00',86507648,'2023-10-31 05:46:41','This week on the Deep House project, Aaron Badgley and the band play a selection of new and older tracks. The first track is by Dabin, who has teamed up with William Black on a song called \"Black in the Cold.\" The band also plays a song by the legendary DJ, Kevin Glasko, \"The Rhythm.\"','Aaron Badgley and the band play new and older tracks on Deep House'),(64853,85,'https://archive.cfru.ca/archive/2023/10/02/Ripcord Radio - October 2, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-02 21:00:00',86507648,'2023-10-03 04:06:18',NULL,NULL),(64854,1437,'https://archive.cfru.ca/archive/2023/10/03/Democracy Now (Rebroadcast) - October 3, 2023 at 02:00 - CFRU 93.3.mp3','2023-10-03 02:00:00',86638720,'2023-10-03 13:49:00',NULL,NULL),(64855,1447,'https://archive.cfru.ca/archive/2023/10/03/Rainbow Country - October 3, 2023 at 01:00 - CFRU 93.3.mp3','2023-10-03 01:00:00',86638720,'2023-10-03 13:49:03',NULL,NULL),(64856,1447,'https://archive.cfru.ca/archive/20