ness & The Dancing - October 4, 2023 at 09:00 - CFRU 93.3.mp3','2023-10-04 09:00:00',86638720,'2023-10-29 06:59:08','Joel Cuthbert has been diagnosed with a fairly rare and optimistically treatable form of cancer. The doctors are optimistic that he should make a full recovery. It\'s been an incredible week of outpouring of love and support from friends, family and some strangers.','Joel Cuthbert is diagnosed with a rare and optimistically treatable form of cancer'),(65024,100,'https://archive.cfru.ca/archive/2023/10/04/We Know Some Stuff + CFRU playlist - October 4, 2023 at 12:00 - CFRU 93.3.mp3','2023-10-04 12:00:00',86507648,'2023-10-04 18:06:49',NULL,NULL),(65025,1437,'https://archive.cfru.ca/archive/2023/10/04/Democracy Now - October 4, 2023 at 11:00 - CFRU 93.3.mp3','2023-10-04 11:00:00',86507648,'2023-10-04 18:08:03',NULL,NULL),(65028,155,'https://mcdn.podbean.com/mf/web/2pu5yx/DrMouth_CIUTshow_oct3_2023_fullshow.mp3','2023-10-04 18:14:25',287930048,'2023-10-04 20:05:22',NULL,NULL),(65036,1586,'https://archive.cfru.ca/archive/2023/10/04/What Do You Do? - October 4, 2023 at 13:00 - CFRU 93.3.mp3','2023-10-04 13:00:00',0,'2023-10-04 20:08:09',NULL,NULL),(65037,13298,'https://archive.cfru.ca/archive/2023/10/04/CFRU Selector - October 4, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-04 14:00:00',86507648,'2023-10-04 20:08:31',NULL,NULL),(65047,102,'https://archive.cfru.ca/archive/2023/10/04/End Credits - October 4, 2023 at 15:00 - CFRU 93.3.mp3','2023-10-04 15:00:00',86507648,'2023-10-04 22:06:42',NULL,NULL),(65048,1464,'https://archive.cfru.ca/archive/2023/10/04/Gryphon And Special Olympics Sports Show - October 4, 2023 at 16:00 - CFRU 93.3.mp3','2023-10-04 16:00:00',86507648,'2023-10-04 22:07:46',NULL,NULL),(65058,13298,'https://archive.cfru.ca/archive/2023/10/04/CFRU Selector - October 4, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-04 17:00:00',86507648,'2023-10-05 00:07:55',NULL,NULL),(65068,105,'https://archive.cfru.ca/archive/2023/10/04/B Siide Radio - October 4, 2023