 miss her dearly','Baba Maul\'s \"Across the Universe\" song is dedicated to Elizabeth Montgomery, the matriarch of the family'),(65466,200,'https://mcdn.podbean.com/mf/web/ztsxmm/Karibuni_Oct_8-239vsik.mp3','2023-10-09 00:24:42',287962512,'2023-10-09 12:06:03',NULL,NULL),(65467,296,'https://mcdn.podbean.com/mf/web/mwc756/9_30_23_showap4iu.mp3','2023-10-08 21:11:52',80801820,'2023-10-09 12:06:16',NULL,NULL),(65468,101,'https://archive.cfru.ca/archive/2023/10/08/Seems Like Old Times - October 8, 2023 at 15:00 - CFRU 93.3.mp3','2023-10-08 15:00:00',86507648,'2023-10-09 12:06:52',NULL,NULL),(65469,101,'https://archive.cfru.ca/archive/2023/10/08/Seems Like Old Times - October 8, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-08 14:00:00',86638720,'2023-10-09 12:06:53',NULL,NULL),(65470,108,'https://archive.cfru.ca/archive/2023/10/08/Wind-Down - October 8, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-08 20:00:00',86507648,'2023-10-09 12:06:57',NULL,NULL),(65471,145,'https://archive.cfru.ca/archive/2023/10/08/Visions fugitives - October 8, 2023 at 09:00 - CFRU 93.3.mp3','2023-10-08 09:00:00',86507648,'2023-10-09 12:07:38',NULL,NULL),(65472,148,'https://archive.cfru.ca/archive/2023/10/08/Clan Na Gael - October 8, 2023 at 13:00 - CFRU 93.3.mp3','2023-10-08 13:00:00',86507648,'2023-10-09 12:07:49',NULL,NULL),(65473,148,'https://archive.cfru.ca/archive/2023/10/08/Clan Na Gael - October 8, 2023 at 12:00 - CFRU 93.3.mp3','2023-10-08 12:00:00',86507648,'2023-10-09 12:07:50',NULL,NULL),(65474,146,'https://archive.cfru.ca/archive/2023/10/08/The Kookoo Bananas Variety Hour - October 8, 2023 at 10:00 - CFRU 93.3.mp3','2023-10-08 10:00:00',86507648,'2023-10-30 21:45:08','In this episode of the animated program Koo koo bananas, the gang tries to find a happy song to play. The song they choose is called \"The 59th Street bridge Song by Harpers Bazaar\" and it\'s a song about kicking down the steps and looking for \"fun and feeling groovy\" . The gang then asks the listener to tell them if the song sounds happy. The answer is \"pretty happy, probably\" , meaning that the song is about feeling happy. This song will be followed by a song by Harry Richmond and a song sung by Stevie Wonder. The lyrics are all about the joy of being happy. After the songs are done, the band asks the listeners what makes them happy. They talk about Christmas and draw up a list of happy songs for the program.','The gang trying to find a happy song to play in Koo koo bananas'),(65475,150,'https://archive.cfru.ca/archive/2023/10/08/Zombie Jamboree - October 8, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-08 19:00:00',86507648,'2023-10-09 12:07:51',NULL,NULL),(65476,149,'https://archive.cfru.ca/archive/2023/10/08/La Buena Onda - October 8, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-08 17:00:00',86507648,'2023-10-09 12:07:52',NULL,NULL),(65477,150,'https://archive.cfru.ca/archive/2023/10/08/Zombie Jamboree - October 8, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-08 18:00:00',86638720,'2023-10-09 12:07:52',NULL,NULL),(65478,149,'https://archive.cfru.ca/archive/2023/10/08/La Buena Onda - October 8, 2023 at 16:00 - CFRU 93.3.mp3','2023-10-08 16:00:00',86507648,'2023-10-09 12:07:53',NULL,NULL),(65479,152,'https://archive.cfru.ca/archive/2023/10/08/Through the Looking Glass - October 8, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-08 21:00:00',86638720,'2023-10-09 12:07:54',NULL,NULL),(65480,153,'https://archive.cfru.ca/archive/2023/10/08/Backtracks - October 8, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-08 22:00:00',86507648,'2023-10-09 12:07:55',NULL,NULL),(65481,154,'https://archive.cfru.ca/archive/2023/10/09/This Night Wounds Time - October 9, 2023 at 01:00 - CFRU 93.3.mp3','2023-10-09 01:00:00',86507648,'2023-10-09 12:07:57',NULL,NULL),(65482,154,'https://archive.cfru.ca/archive/2023/10/09/This Night Wounds Time - October 9, 2023 at 00:00 - CFRU 93.3.mp3','2023-10-09 00:00:00',86507648,'2023-10-09 12:07:58',NULL,NULL),(65483,154,'https://archive.cfru.ca/archive/2023/10/08/This Night Wounds Time - October 8