23-10-17 06:00:00',86507648,'2023-10-17 16:06:11',NULL,NULL),(66378,80,'https://archive.cfru.ca/archive/2023/10/16/CFRU Playlist - October 16, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-16 14:00:00',86638720,'2023-10-17 16:06:12',NULL,NULL),(66379,86,'https://archive.cfru.ca/archive/2023/10/16/The Deep House Project - October 16, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-16 22:00:00',86507648,'2023-10-31 05:21:11','On this week\'s Deep House Project, we hear about the release of Lauren\'s debut, The Lost Art Of Through. The album is full of pop, folk, and jazz elements. We also learn that the International Institute of Critical Studies and Improvisation will be holding its fourth annual Festival of Improvised Arts on October 20 and 21 at the university. The show starts off with the classic track So Glad by Legendary Fingers Incorporated. The song is about a young woman who has fallen in love with someone else. She tells the girl that she\'s too proud to love her because she doesn\'t know all that she knows about love. She says she\'ll never be the first person to break her heart, but she will never be first to say it. She\'s not just saying she loves her, she loves the girl she loves. She won\'t let it go like this. She wants her Pin Springs to stop loving her. The Underground Man plays some remixes of some of Tim Walsh\'s tracks. He closes the show with an \"AI sounding trackopia\" from him.','Lauren\'s debut album, The Lost Art Of Through, is a big hit for the world'),(66380,87,'https://archive.cfru.ca/archive/2023/10/16/Back in the USSR - October 16, 2023 at 23:00 - CFRU 93.3.mp3','2023-10-16 23:00:00',86638720,'2023-10-17 16:06:16',NULL,NULL),(66381,84,'https://archive.cfru.ca/archive/2023/10/16/Blues Around the Block - October 16, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-16 20:00:00',86507648,'2023-10-17 16:06:19',NULL,NULL),(66382,84,'https://archive.cfru.ca/archive/2023/10/16/Blues Around the Block - October 16, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-16 19:00:00',86638720,'2023-10-17 16:06:19',NULL,NULL),(66383,85,'https://archive.cfru.ca/archive/2023/10/16/Ripcord Radio - October 16, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-16 21:00:00',86507648,'2023-10-17 16:06:21',NULL,NULL),(66384,82,'https://archive.cfru.ca/archive/2023/10/16/Big Sis Radio - October 16, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-16 17:00:00',86507648,'2023-10-17 16:06:22',NULL,NULL),(66385,83,'https://archive.cfru.ca/archive/2023/10/16/to know the land - October 16, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-16 18:00:00',86507648,'2023-10-30 16:03:27','On this episode of Know the Land: The Land, Byron speaks with his friend, artist, Miki Tamblyns about her recent project, called Animal Forms. The project is a mask making project that invites people to come to the forest to interact with the masks and have a sit spot. The masks represent different mammals living in the forest, and people are invited to record their impressions in journals and take photographs. The idea of seeing the world from another\'s point of view excites Byron, who is fascinated by the idea that humans can see the world as it is and see that their actions affect other people. He is inspired by Joanna Macy\'s work with the Council of Beings and also by the work of the artist. He was also interested in the idea of making masks to represent animals and then having people come together and share what is going on. He says that the world is alive, and that he wants to get into this because a lot of times he feels like he is like animus, which is a term that he has come to use in his life. He wants to know more about how people participate in this project, naming their own masks, and how they feel about the mirrors. He likes the mirrors because they allow people to look at themselves in a mirror, and he likes that the project is about inspiring and encouraging people to be more empathetic. He also likes the book she has been reading, Becoming Animal, by David Abrams, which he finds very helpful.','How To Make a Mask To Be a Friend of Miki Tamblyns'),(66386,81,'https://archive.cfru.ca/archive/2023/10/16/The Sentinel’s Marvellous Kaleidoscope - October 16, 2023 at 15:00 - CFRU 93.3.mp3','2023-10-16 15:00:00',86507648,'2023-10-17 16:06:23',NULL,NULL),(66387,101,'https://archive.cfru.ca/archive/2023/10/15/Seems Like Old Times - October 15, 2023 at 15:00 - CFRU 93.3.mp3','2023-10-15 15:00:00',86507648,'2023-10-17 16:06:34',NULL,NULL),(66388,101,'https://archive.cfru.ca/archive/2023/10/15/Seems Like Old Times - October 15, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-15 14:00:00',86507648,'2023-10-17 16:06:35',NULL,NULL),(66389,108,'https://archive.cfru.ca/archive/2023/10/15/Wind-Down - October 15, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-15 20:00:00',86507648,'2023-10-17 16:06:37',NULL,NULL),(66390,110,'https://archive.cfru.ca/archive/2023/10/16/Here Today - October 16, 2023 at 07:00 - CFRU 93.3.mp3','2023-10-16 07:00:00',86507648,'2023-10-17 16:06:41',NULL,NULL),(66391,145,'https://archive.cfru.ca/archive/2023/10/15/Visions fugitives - October 15, 2023 at 09:00 - CFRU 93.3.mp3','2023-10-15 09:00:00',86507648,'2023-10-17 16:07:11',NULL,NULL),(66392,145,'https://archive.cfru.ca/archive/2023/10/15/Visions fugitives - October 15, 2023 at 08:00 - CFRU 93.3.mp3','2023-10-15 08:00:00',86507648,'2023-10-17 16:07:13',NULL,NULL),(66393,146,'https://archive.cfru.ca/archive/2023/10/15/The Kookoo Bananas Variety Hour - October 15, 2023 at 10:00 - CFRU 93.3.mp3','2023-10-15 10:00:00',86507648,'2023-10-30 21:36:06','This episode of the Underground Man\'s show starts off with a song by a band called \"Run by a group Called Crying from Get Old.\" The Underground Man thinks that this song sounds like a game, but it turns out to be a song about women. They\'re celebrating women this week, so they\'ll start with a group called \"Crying from get old.\" They\'ll also hear a song called \"When breaks get wet,\" by a woman named \"Julie Duarant.\" Then, they\'re all going to hear \"salvagediver,\" by Jenny Omnicord, who we\'ll learn is a woman in town. So the Underground Men start off by playing \"The frog\" song, which is about a guy who tries to run over a dog. The Underground Men get to the song, and it\'s \"I really am,\" by the singer \"Angry Frog.\" The song is about being on the street, and the song ends with a quote from a famous author, \"Can\'t describe how I would feel going down to find bodies,\" by an author named \"Rowan.\" Next up on the show is a girl band called Cupcake Duck Tape, who are made up of a couple of women named Steph and Alana, and they\'ve started a project called \"Girls Rock Camp\" in which girls in high school can start a band and write a song. It\'ll be a fun thing to see. Then, the Underground Guys are','The Underground Man\'s show starts with a song by a band called \"Run By a Called Crying from Get Old'),(66394,148,'https://archive.cfru.ca/archive/2023/10/15/Clan Na Gael - October 15, 2023 at 13:00 - CFRU 93.3.mp3','2023-10-15 13:00:00',86638720,'2023-10-17 16:07:14',NULL,NULL),(66395,148,'https://archive.cfru.ca/archive/2023/10/15/Clan Na Gael - October 15, 2023 at 12:00 - CFRU 93.3.mp3','2023-10-15 12:00:00',86507648,'2023-10-17 16:07:15',NULL,NULL),(66396,150,'https://archive.cfru.ca/archive/2023/10/15/Zombie Jamboree - October 15, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-15 19:00:00',86638720,'2023-10-17 16:07:16',NULL,NULL),(66397,149,'https://archive.cfru.ca/archive/2023/10/15/La Buena Onda - October 15, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-15 17:00:00',86507648,'2023-10-17 16:07:16',NULL,NULL),(66398,150,'https://archive.cfru.ca/archive/2023/10/15/Zombie Jamboree - October 15, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-15 18:00:00',86507648,'2023-10-17 16:07:17',NULL,NULL),(66399,149,'https://archive.cfru.ca/archive/2023/10/15/La Buena Onda - October 15, 2023 at 16:00 - CFRU 93.3.mp3','2023-10-15 16:00:00',86638720,'2023-10-17 16:07:17',NULL,NULL),(66400,152,'https://archive.cfru.ca/archive/2023/10/15/Throug