ty in the Gaza Strip. The WHO says that conditions are \"spiraling out of control.\" Benjamin Netanyahu has announced that he will allow aid into Gaza from Egypt after meeting with Vice President Joe Biden. He also said that he would allow humanitarian aid into the territory from the Egyptian border. There is still no ground invasion, but there has been no ground attack. The rockets have come after Joe Biden has been in the area, and it seems to Adam that he is doing a lot of behind-the-scenes work to keep the conflict going. In the aftermath of the crisis, \"has Israel been so connected with its own internal politics and with a corrupt Prime Minister who\'','The Israeli War is now in its second week, and the death toll has reached 3,500'),(66669,121,'https://archive.cfru.ca/archive/2023/10/19/Sundowner - October 19, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-19 21:00:00',86507648,'2023-10-20 04:06:48',NULL,NULL),(66670,119,'https://archive.cfru.ca/archive/2023/10/19/Turtle Island Underground - October 19, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-19 18:00:00',86638720,'2023-10-20 04:06:49',NULL,NULL),(66671,120,'https://archive.cfru.ca/archive/2023/10/19/The Crooked Beat - October 19, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-19 20:00:00',86507648,'2023-10-20 04:06:49',NULL,NULL),(66672,120,'https://archive.cfru.ca/archive/2023/10/19/The Crooked Beat - October 19, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-19 19:00:00',86507648,'2023-10-20 04:06:50',NULL,NULL),(66673,122,'https://archive.cfru.ca/archive/2023/10/19/Forever Deaf - October 19, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-19 22:00:00',86638720,'2023-10-20 04:06:51',NULL,NULL),(66674,1437,'https://archive.cfru.ca/archive/2023/10/19/Democracy Now - October 19, 2023 at 11:00 - CFRU 93.3.mp3','2023-10-19 11:00:00',86507648,'2023-10-20 04:07:09',NULL,NULL),(66675,13307,'https://archive.cfru.ca/archive/2023/10/19/Eclectic Selections - October 19, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-19 14:00:00',86507648,'2023-10-20 04: