les usually emerge in mid July and males emerge in late July. When the females emerge, they eat the insects that feed on them, and the females then mate with the males. The males then mate again and hatch their eggs.','The regalitas sua virescens husk pupa is a white maggot that emerges from the'),(67137,84,'https://archive.cfru.ca/archive/2023/10/23/Blues Around the Block - October 23, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-23 20:00:00',86507648,'2023-10-24 02:06:14',NULL,NULL),(67138,84,'https://archive.cfru.ca/archive/2023/10/23/Blues Around the Block - October 23, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-23 19:00:00',86507648,'2023-10-24 02:06:15',NULL,NULL),(67139,82,'https://archive.cfru.ca/archive/2023/10/23/Big Sis Radio - October 23, 2023 at 17:00 - CFRU 93.3.mp3','2023-10-23 17:00:00',86507648,'2023-10-24 02:06:16',NULL,NULL),(67149,86,'https://archive.cfru.ca/archive/2023/10/23/The Deep House Project - October 23, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-23 22:00:00',86507648,'2023-10-31 05:10:19','In this episode of the Deep House project, host Scott Brown and his crew set out to raise money for Silence Sounds, a local organization dedicated to preserving the arts in the community. They invite listeners to pledge $10 a month to the organization for a year. Scott introduces them to the program, which runs every Tuesday at 8pm on the CFRU 93.3 FM station. The program begins with a dance track by a German artist named Levenmankind. The song begins by saying, \"It\'s not about you, and me, so hold on, wait for a day /To feel out where its gonna be.\" The song goes on to say, \"The luck is with Me, the world still stops hidden, I still breathe there\'s something to your eyes / Oh no I know it\'s for so long.\" The artist then says, \"I\'ve got to get you up and move on.\" He tells the listeners that he has a crush on them and he wants to show them how much he wants them to love him. The music starts off with a remix of Milk & Bones\' \"P-Back\" by Blue Hawaii, and then the band Moose and The Scarf comes out with their song \"Won\'t','Deep House project host Scott Brown pledges $10 a month to Silence Sounds, a local arts organization'),(67150,85,'https://archive.cfru.ca/archive/2023/10/23/Ripcord Radio - October 23, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-23 21:00:00',86638720,'2023-10-24 04:06:13',NULL,NULL),(67160,87,'https://archive.cfru.ca/archive/2023/10/23/Back in the USSR - October 23, 2023 at 23:00 - CFRU 93.3.mp3','2023-10-23 23:00:00',86507648,'2023-10-24 06:06:25',NULL,NULL),(67161,1447,'https://archive.cfru.ca/archive/2023/10/24/Rainbow Country - October 24, 2023 at 00:00 - CFRU 93.3.mp3','2023-10-24 00:00:00',86507648,'2023-10-24 06:07:32',NULL,NULL),(67171,1437,'https://archive.cfru.ca/archive/2023/10/24/Democracy Now (Rebroadcast) - October 24, 2023 at 02:00 - CFRU 93.3.mp3','2023-10-24 02:00:00',86507648,'2023-10-24 08:07:35',NULL,NULL),(67172,1447,'https://archive.cfru.ca/archive/2023/10/24/Rainbow Country - October 24, 2023 at 01:00 - CFRU 93.3.mp3','2023-10-24 01:00:00',86638720,'2023-10-24 08:07:38',NULL,NULL),(67182,207,'https://mcdn.podbean.com/mf/web/ztigut/Music_w_db_Hawkes_Oct_25_2023_podcast69weg.mp3','2023-10-24 09:43:29',286504750,'2023-10-24 10:06:04',NULL,NULL),(67192,80,'https://archive.cfru.ca/archive/2023/10/24/CFRU Playlist - October 24, 2023 at 06:00 - CFRU 93.3.mp3','2023-10-24 06:00:00',86507648,'2023-10-24 12:06:31',NULL,NULL),(67202,78,'https://archive.cfru.ca/archive/2023/10/24/Morning Soul Shake-Up! - October 24, 2023 at 08:00 - CFRU 93.3.mp3','2023-10-24 08:00:00',86507648,'2023-10-24 14:06:30',NULL,NULL),(67212,2653,'https://archive.cfru.ca/archive/2023/10/24/Solipsistic Retreat - October 24, 2023 at 10:00 - CFRU 93.3.mp3','2023-10-24 10:00:00',86507648,'2023-10-24 16:07:57',NULL,NULL),(67213,2653,'https://archive.cfru.ca/archive/2023/10/24/Solipsistic Retreat - October 24, 2023 at 09:00 - CFRU 93.3.mp3','2023-10-24 09:00:00',86638720,'2023-10-24 16:07:57',NULL,NULL),(67223,90,'h