s called \"Political Current Affairs Discussion Show\" and it discusses the latest news from the region. The show discusses the situation in the Gaza Strip and the possibility of a ground invasion by Israel. The situation in Gaza has gotten worse and the war is not over yet. The death toll in the war has reached 6,000, and the toll is growing. The political context of the show is that it is a discussion show and the opinions expressed are those of the CFRU and the University of Guelph. The views expressed are theirs and do not reflect those of CFRU, the University, or any other political party. The United Nations is trying to stop the fighting, but the terms of the ceasefire have not been agreed upon. The ground attack is imminent. The humanitarian crisis in Gaza is being used as a political weapon by both sides.','Open Source: The 12th episode of the \'Political Current Affairs Discussion Show\''),(67528,119,'https://archive.cfru.ca/archive/2023/10/26/Turtle Island Underground - October 26, 2023 at 18:00 - CFRU 93.3.mp3','2023-10-26 18:00:00',86507648,'2023-10-27 00:06:57',NULL,NULL),(67538,120,'https://archive.cfru.ca/archive/2023/10/26/The Crooked Beat - October 26, 2023 at 20:00 - CFRU 93.3.mp3','2023-10-26 20:00:00',86507648,'2023-10-27 02:06:50',NULL,NULL),(67539,120,'https://archive.cfru.ca/archive/2023/10/26/The Crooked Beat - October 26, 2023 at 19:00 - CFRU 93.3.mp3','2023-10-26 19:00:00',86638720,'2023-10-27 02:06:51',NULL,NULL),(67549,121,'https://archive.cfru.ca/archive/2023/10/26/Sundowner - October 26, 2023 at 21:00 - CFRU 93.3.mp3','2023-10-26 21:00:00',86507648,'2023-10-27 04:10:34',NULL,NULL),(67550,122,'https://archive.cfru.ca/archive/2023/10/26/Forever Deaf - October 26, 2023 at 22:00 - CFRU 93.3.mp3','2023-10-26 22:00:00',86507648,'2023-10-27 04:10:37',NULL,NULL),(67560,122,'https://archive.cfru.ca/archive/2023/10/27/Forever Deaf - October 27, 2023 at 00:00 - CFRU 93.3.mp3','2023-10-27 00:00:00',86507648,'2023-10-27 06:07:08',NULL,NULL),(67561,1