 on your behalf if you give him a check. So there\'s a lot going on here. First, the Underground Man talks about how people need to get out of their shells and start exploring again. He says that this is the time of year when the Earth starts to become more and more populated, so it\'s time for us to start exploring. He uses the example of the dance as an example of how people can get into the flow of information. You can exchange information, you can exchange data, and so on. He goes on to say that all of the things we need to do in the world are connected to one another. He calls it the \"land of low base\" and says it\'ll be a great place to explore.','The Underground Man talks about how people need to get out of shells and start exploring'),(67620,186,'https://mcdn.podbean.com/mf/web/w24ruk/October_26th_2023_Higher_Groundaztpt.mp3','2023-10-27 17:01:50',287962512,'2023-10-27 18:05:36',NULL,NULL),(67625,1437,'https://archive.cfru.ca/archive/2023/10/27/Democracy Now - October 27, 2023 at 11:00 - CFRU 93.3.mp3','2023-10-27 11:00:00',86507648,'2023-10-27 18:07:45',NULL,NULL),(67626,3686,'https://archive.cfru.ca/archive/2023/10/27/Volunteer Playlist - October 27, 2023 at 12:00 - CFRU 93.3.mp3','2023-10-27 12:00:00',86638720,'2023-10-27 18:08:17',NULL,NULL),(67636,206,'https://mcdn.podbean.com/mf/web/m4brqp/October_21_2023_The_Minx_Sessions76vhk.mp3','2023-10-27 19:49:27',287962512,'2023-10-27 20:05:53',NULL,NULL),(67637,292,'https://mcdn.podbean.com/mf/web/2j536a/October_27_2023_The_Cool_Side_of_The_Pillow7eb0f.mp3','2023-10-27 19:43:37',287962512,'2023-10-27 20:05:58',NULL,NULL),(67638,126,'https://archive.cfru.ca/archive/2023/10/27/Viejoteca - October 27, 2023 at 14:00 - CFRU 93.3.mp3','2023-10-27 14:00:00',86638720,'2023-10-27 20:06:54',NULL,NULL),(67639,126,'https://archive.cfru.ca/archive/2023/10/27/Viejoteca - October 27, 2023 at 13:00 - CFRU 93.3.mp3','2023-10-27 13:00:00',86507648,'2023-10-27 20:06:54',NULL,NULL),(67649,127,'https://archive.cfru.ca/archive/20