th in time. Way back, way back. Way way back, Way back! Way back... Way back. The group then goes back in time to listen to a song called Spooky Cowboy, which sounds very much like a mass-produced costume. The song basically says, \"I\'m not a cowboy, I\'ve got a plan. I\'ll never be wrong.\"','Future Shock is a horror movie set in a virtual reality world. Way back, way back'),(68019,80,'https://archive.cfru.ca/archive/2023/10/31/CFRU Playlist - October 31, 2023 at 06:00 - CFRU 93.3.mp3','2023-10-31 06:00:00',86638720,'2023-10-31 14:06:18',NULL,NULL),(68020,78,'https://archive.cfru.ca/archive/2023/10/31/Morning Soul Shake-Up! - October 31, 2023 at 08:00 - CFRU 93.3.mp3','2023-10-31 08:00:00',86507648,'2023-10-31 14:06:19',NULL,NULL),(68021,87,'https://archive.cfru.ca/archive/2023/10/30/Back in the USSR - October 30, 2023 at 23:00 - CFRU 93.3.mp3','2023-10-30 23:00:00',86507648,'2023-10-31 14:06:30',NULL,NULL),(68022,1437,'https://archive.cfru.ca/archive/2023/10/31/Democracy Now (Rebroadcast) - October 31, 2023 at 02:00 - CFRU 93.3.mp3','2023-10-31 02:00:00',86507648,'2023-10-31 14:08:05',NULL,NULL),(68023,1447,'https://archive.cfru.ca/archive/2023/10/31/Rainbow Country - October 31, 2023 at 01:00 - CFRU 93.3.mp3','2023-10-31 01:00:00',86507648,'2023-10-31 14:08:06',NULL,NULL),(68024,1447,'https://archive.cfru.ca/archive/2023/10/31/Rainbow Country - October 31, 2023 at 00:00 - CFRU 93.3.mp3','2023-10-31 00:00:00',86507648,'2023-10-31 14:08:06',NULL,NULL),(68034,2653,'https://archive.cfru.ca/archive/2023/10/31/Solipsistic Retreat - October 31, 2023 at 10:00 - CFRU 93.3.mp3','2023-10-31 10:00:00',86507648,'2023-10-31 16:08:19',NULL,NULL),(68035,2653,'https://archive.cfru.ca/archive/2023/10/31/Solipsistic Retreat - October 31, 2023 at 09:00 - CFRU 93.3.mp3','2023-10-31 09:00:00',86638720,'2023-10-31 16:08:19',NULL,NULL),(68036,38498,'https://archive.cfru.ca/archive/2019/10/31/CFR Booo! - October 31, 2019 at 16:00 - CFRU 93.3.mp3','2019-10-31 16:00:00',86507648,'2023-10-