CFRU 93.3.mp3','2023-11-01 12:00:00',86507648,'2023-11-01 18:06:34',NULL,NULL),(68188,1437,'https://archive.cfru.ca/archive/2023/11/01/Democracy Now - November 1, 2023 at 11:00 - CFRU 93.3.mp3','2023-11-01 11:00:00',86507648,'2023-11-01 18:07:37',NULL,NULL),(68191,155,'https://mcdn.podbean.com/mf/web/nz33ki/DrMouth_CIUTshow_oct31_2023_fullshow.mp3','2023-11-01 19:47:30',431485568,'2023-11-01 20:05:27',NULL,NULL),(68199,1586,'https://archive.cfru.ca/archive/2023/11/01/What Do You Do? - November 1, 2023 at 13:00 - CFRU 93.3.mp3','2023-11-01 13:00:00',0,'2023-11-01 20:08:03',NULL,NULL),(68200,3686,'https://archive.cfru.ca/archive/2023/11/01/Volunteer Playlist - November 1, 2023 at 14:00 - CFRU 93.3.mp3','2023-11-01 14:00:00',86507648,'2023-11-01 20:08:47',NULL,NULL),(68210,102,'https://archive.cfru.ca/archive/2023/11/01/End Credits - November 1, 2023 at 15:00 - CFRU 93.3.mp3','2023-11-01 15:00:00',86638720,'2023-11-02 02:17:32','The credits of this program are a local movie talk show hosted by Adam Donaldson and Peter Westie. The show starts off with a discussion about the recent spate of deaths in the entertainment industry. The first show topic is \"feel-good\" movies, which are comedies that make you feel better. The second show topic deals with \"the axe gang\" a term used for a martial arts group that originated in Hong Kong in the early 20th century. The third show topic relates to a recent Martin Scorsese movie, \"Hugo,\" a story about an orphan boy named Hugo. It is set in the Paris train station in 1922 and tells the story of the invention of the cinema.','The \'feel-good\' movie talk show begins with a discussion about the recent spate of deaths in the entertainment industry'),(68211,1464,'https://archive.cfru.ca/archive/2023/11/01/Gryphon And Special Olympics Sports Show - November 1, 2023 at 16:00 - CFRU 93.3.mp3','2023-11-01 16:00:00',86507648,'2023-11-02 02:07:19','In this program, Taylor introduces his guests and then introduces himself as the host of the Griffin Sports Show. He introduces Dizeng as a star point guard on the University of Guelph\'s men\'s and women\'s basketball, and as a member of the University\'s National Art Basketball Rookie team. He also talks about his hometown, Hamilton, and his experience playing against Team Canada star Shay Goodes Alexander at the last summer\'s London Games. He discusses his expectations for the upcoming season and his hopes of making the Canadian Basketball League team.','Taylor is the host of the Griffin Sports Show. He’s a point guard at the University of Guelph'),(68212,13298,'https://archive.cfru.ca/archive/2023/11/01/CFRU Selector - November 1, 2023 at 17:00 - CFRU 93.3.mp3','2023-11-01 17:00:00',86638720,'2023-11-02 01:57:28','We start this program with an interview with Doug Blackwith, host of the old time music program \"Sounds Like Old Times\" on CFRU 92.3. He tells us that he\'s been entertaining listeners with old songs and stories since the early 1900s. He\'s hosting a show on the 4th of November at the Al Green Theatre, a venue accessible to people with physical limitations. The show will be a benefit for the War Amputees, who need artificial limbs and equipment to live with amputation. If you\'re a war amputee and you want to help, visit waramps.ca. The song opens with a poem called \"The Story is Ours.\" It\'s about a man named \"Patient\" who is a patient in a war hospital. \"Patient,\" the song says, \"do you touch the sun. Do you realize sun. show my light. make the world my sun. Still light as soonas we agree Patient.\" The song ends with a quote from the poem \"The sun is near you. It\'ll not always be there on the opposite side.\"','\'Sounds Like Old Times\': \'Do you touch the sun. Do you realize sun\''),(68222,105,'https://archive.cfru.ca/archive/2023/11/01/B Siide Radio - November 1, 2023 at 19:00 - CFRU 93.3.mp3','2023-11-01 19:00:00',86507648,'2023-11-02 03:27:42','Stash Ram is back in the States. He\'s back to robbing. He has a new plan: he\'s going to start a new gang of robbers. This time, he\'ll be back to \"live like an orphan\" . He doesn\'t want to live like a homeless man. He is going to hit the road with a shotgun, and he can\'t even run with it. So, he needs to figure out a way to keep people on their toes. Stash Ram points out that the \"cats that be hating\" still love the dogs, even though they know that they\'re doomed to die by the law. He tells them that he got them all on the same team: \"you got money keep yours\" , and since Stash Ram took the governor\'s job, \"even the cats that are hating\" are still loving the dogs. He explains that he likes to use a watch as a weapon and a gun as a way of killing people. He compares his methods to the \"riots\" in a jailhouse. He buys an extra 20 bucks with the money, which he then uses to buy some drugs. He says that he can kill anyone he wants, even cats','Stash Ram is back in the States and is going to start a new gang of robbers'),(68223,106,'https://archive.cfru.ca/archive/2023/11/01/Trail Mix - November 1, 2023 at 20:00 - CFRU 93.3.mp3','2023-11-01 20:00:00',86507648,'2023-11-02 03:16:24','The Underground Man returns with a new song from a band called Thresh. The song is called \"Closing on a minor client\" and it opens with the words, \"True love is easy. It\'s easy to know it\'s true in the end. True love is the only thing that matters in the world. It is easy in the classic. I\'m just an alien horse power like an Mongolian trying to find soul. I can\'t complain though, as I am only an alien power trying to search soul again. The Underground Men also play a new track from Micaiah Mc-Raven\'s new album \"In These Times\" and a song from Panisaurus\'s \"Market Street Junkie\" from his new album.','The Underground Man returns with a new song from a band called Thresh'),(68224,1321,'https://archive.cfru.ca/archive/2023/11/01/Hong Kong Student Radio Association - November 1, 2023 at 18:00 - CFRU 93.3.mp3','2023-11-01 18:00:00',86507648,'2023-11-02 03:04:44','Hong Kong Student Association Various From the Roots Up CIUT 89.4 CFRU archives . . Various from the Roots up CIUT. 89.5 CFRU archive . Hong Kong student association Various from roots up. 89.4 CIUT archives , Various from root up. CIUT archive , Hong Kong students association Various. 89.7 CFRU Archive .','Hong Kong Student Association Various From the Roots Up CIUT 89.4 CFRU archives'),(68234,107,'https://archive.cfru.ca/archive/2023/11/01/Tone Zone - November 1, 2023 at 21:00 - CFRU 93.3.mp3','2023-11-01 21:00:00',86507648,'2023-11-02 04:38:49','The show starts off with a rendition of one of Nirvana\'s most famous songs, \"In utero Scentless Apprentice,\" which was released in September of 1994 and is a live version. The show also includes a number of other songs from the band\'s career, including \"Pink Flag,\" \"Wire and mannequin,\" and \"The go-between\'s\" and \"Bachelor kisses.\" The show closes with a song from a band called \"Ducks limited,\" which is a new single from Matt Webb and Bry Webb, the twin brothers who have sold millions of records for their roles in the music industry.','Nirvana\'s \"In utero Scentless Apprentice\" is a live version of the band'),(68244,97,'https://archive.cfru.ca/archive/2023/11/02/Wild Combination - November 2, 2023 at 00:00 - CFRU 93.3.mp3','2023-11-02 00:00:00',86507648,'2023-11-02 06:06:46',NULL,NULL),(68254,97,'https://archive.cfru.ca/archive/2023/11/02/Wild Combination - November 2, 2023 at 01:00 - CFRU 93.3.mp3','2023-11-02 01:00:00',86507648,'2023-11-02 08:06:46',NULL,NULL),(68255,1437,'https://archive.cfru.ca/archive/2023/11/02/Democracy Now (Rebroadcast) - November 2, 2023 at 02:00 - CFRU 93.3.mp3','2023-11-02 02:00:00',86638720,'2023-11-02 08:07:41',NULL,NULL),(68274,78,'https://archive.cfru.ca/archive/2023/11/02/Morning Soul Shake-Up! - November 2, 2023 at 08:00 - CFRU 93.3.mp3','2023-11-02 08:00:00',86507648,'2023-11-02 14:06:14',NULL,NULL),(68275,110,'https://archive.cfru.ca/archive/2023/11/02/Here Today - November 2, 2023 at 07:00 - CFRU 93.3.mp3','2023-11-02 07:00:00',86507648,'2023-11-07 05:00:20','Aaron Badgley is back on the show to introduce us to some of the new artists on the air. He starts off with a few covers, including Martha Johnson and the Muffins from Buffalo Springfield and Martha Johnson, Mark Gain, John Orpheus and Sam and Casey Exists from Cover Rama, a compilation of artists who cover songs they really like. Aaron also introduces us to Paul Manchin, who is releasing his new album soon and has a new song called First on it. Finally, Aaron introduces you to Church of Trees, who have a new single out called Pet Cemetery. Aaron and his friend Jenna also introduce you to a new EP from RewindStar called Forward.','Aaron Badgley on the Weeknight Show (Sponsor)'),(68279,173,'https://mcdn.podbean.com/mf/web/brrwxz/Club_Ned_Nov_5_2023_podcastbobye.mp3','2023-11-02 14:11:35',463090415,'2023-11-02 16:05:24',NULL,NULL),(68286,219,'https://mcdn.podbean.com/mf/web/w5nzsq/ES231101.mp3','2023-11-02 14:38:25',139549345,'2023-11-02 16:06:01',NULL,NULL),(68287,111,'https://archive.cfru.ca/archive/2023/11/02/Tales from the Bridge - November 2, 2023 at 09:00 - CFRU 93.3.mp3','2023-11-02 09:00:00',86638720,'2023-11-02 16:06:45',NULL,NULL),(68288,112,'https://archive.cfru.ca/archive/2023/11/02/FoodFarm Talk - November 2, 2023 at 10:00 - CFRU 93.3.mp3','2023-11-02 10:00:00',86507648,'2023-11-02 16:06:46',NULL,NULL),(68298,195,'https://mcdn.podbean.com/mf/web/kvdkdi/Dementia13RadioShow_23_10_31.mp3','2023-11-02 17:58:12',287962512,'2023-11-02 18:06:00',NULL,NULL),(68299,296,'https://mcdn.podbean.com/mf/web/aztb3w/3rd_Face_21_oct_2023ae8yt.mp3','2023-11-02 17:47:47',143961989,'2023-11-02 18:06:21',NULL,NULL),(68300,90,'https://archive.cfru.ca/archive/2023/11/02/Bridging The Social Distance - November 2, 2023 at 12:00 - CFRU 93.3.mp3','2023-11-02 12:00:00',86507648,'2023-11-02 18:06:38',NULL,NULL),(68301,1437,'https://archive.cfru.ca/archive/2023/11/02/Democracy No