on of being his last, so he hopes not to. He\'s always been a fan of diversity and he loves people who share his values. The new album is personal to Manchin because it\'s his first in three years. He says that he spent three years trying to make the best music he could, and he\'s super proud of his work. The novel is about transitions through death and illness. He also has Will I get better from the new album after this. Finally, the show closes with the song \"That\'s All\" from the upcoming February album Transients by the Church of Trees, which is also being released.','Paul Manchin\'s new memoir \"M.A.T. I.N.I.N.\" (Sponsor)'),(68770,163,'https://mcdn.podbean.com/mf/web/ubnxqf/November_4th_2023_Critic_s_Circlebjs75.mp3','2023-11-06 15:11:21',143961989,'2023-11-06 17:05:25',NULL,NULL),(68779,207,'https://mcdn.podbean.com/mf/web/f8iepq/Music_w_db_Hawkes_Nov_8_2023_Podcast9029g.mp3','2023-11-06 15:23:57',279799640,'2023-11-06 17:06:01',NULL,NULL),(68780,247,'https://mcdn.podbean.com/mf/web/456s6t/November_4th_2023_Calling_All_Blues9cdec.mp3','2023-11-06 16:32:56',143346496,'2023-11-06 17:06:06',NULL,NULL),(68781,79,'https://archive.cfru.ca/archive/2023/11/06/Breezy Breakfast Radio - November 6, 2023 at 10:00 - CFRU 93.3.mp3','2023-11-06 10:00:00',86507648,'2023-11-06 17:06:33',NULL,NULL),(68782,79,'https://archive.cfru.ca/archive/2023/11/06/Breezy Breakfast Radio - November 6, 2023 at 09:00 - CFRU 93.3.mp3','2023-11-06 09:00:00',86507648,'2023-11-06 17:06:33',NULL,NULL),(68784,164,'https://mcdn.podbean.com/mf/web/t8xgf2/BTHMO111_Nov6BRI_FINALbr8l6.mp3','2023-11-06 17:55:09',66534737,'2023-11-06 19:05:19',NULL,NULL),(68793,206,'https://mcdn.podbean.com/mf/web/w65wi2/November_4th_2023_The_Minx_Sessions7s4mi.mp3','2023-11-06 17:06:35',287320576,'2023-11-06 19:05:52',NULL,NULL),(68794,1438,'https://archive.cfru.ca/archive/2023/11/06/Worst Responders - November 6, 2023 at 12:00 - CFRU 93.3.mp3','2023-11-06 12:00:00',86507648,'2023-11-06 19:07:57',NULL,NULL),(68795,1437