INSERT INTO `shows` VALUES (78,'Morning Soul Shake-Up!','cfru','https://www.cfru.ca/wp-content/uploads/2020/07/soulimage.jpeg','<p>Start your day right with a joyful mix of rare vintage soul, r&b and funk!  A righteous mix, brought to you every day of the week from 8-9am.  A dynamite soundtrack for the breakfast table, the cafe or the commute.  Get up to get down!!</p>','Slim Volume','https://www.cfru.ca/?s=Morning%20Soul%20Shake-Up%21&posttype_search=mcm_recording','','bw@cfru.ca',3600,'cfru-morning-soul-shake-up'),(79,'Breezy Breakfast Radio','cfru','https://www.cfru.ca/wp-content/uploads/2020/07/podbean-image-1.jpg','<p>The Breezy Breakfast is a weekly community gathering focused on raising awareness and sharing ideas about important issues that concern residents of Guelph and beyond. From 2016 to 2020 this weekly gathering took place at the Breezy Corners Restaurant in downtown Guelph. Since the restaurant closed at the onset of the pandemic, the gatherings have moved online using the ZOOM platform, expanding our mandate beyond those able to attend in person, and it’s these meetings that will be shared in audio form on CFRU.</p>','Various','https://www.cfru.ca/?s=Breezy%20Breakfast%20Radio&posttype_search=mcm_recording','','',3600,'cfru-breezy-breakfast-radio'),(80,'CFRU Playlist','cfru','https://www.cfru.ca/wp-content/uploads/2020/06/cfru-playlist-cover-image-1.png','<p>A multi-genre mix of contemporary Canadian music in a shuffled playlist. Hear old favourites and new gems, and expect the unexpected!</p>','CFRU!','https://www.cfru.ca/?s=CFRU%20Playlist&posttype_search=mcm_recording','','',3600,'cfru-cfru-playlist'),(81,'The Sentinel’s Marvellous Kaleidoscope','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/SMK_FullSize_CFRUBanner.jpg','<p>Through this lens, you will be guided on audible explorations, gazing across the ever-changing horizon of music. The fantastical soundscape is filled with landmarks, relics and anomalies in progressive, fusion and alternative styles, near and far. Each observational session is constellatory, pulverizing, mystifying… and simply marvellous.</p>','Nicholas Cooper','https://www.cfru.ca/?s=The%20Sentinel%26%238217%3Bs%20Marvellous%20Kaleidoscope&posttype_search=mcm_recording','https://linktr.ee/smkobserves','',3600,'cfru-the-sentinels-marvellous-kaleidoscope'),(82,'Big Sis Radio','cfru','https://www.cfru.ca/wp-content/uploads/2022/08/Big-Sis-Radio-Thing.png','<p>Fresh indie rock tunes with host CC- your big sis with the soon-to-be-hits. We dance, tap, buzz and belt here but a special exception is made for introverts. Come hang out and find your next favourite indie band.</p>','CC','https://www.cfru.ca/?s=Big%20Sis%20Radio&posttype_search=mcm_recording','','bigsisradio@gmail.com',3600,'cfru-big-sis-radio'),(83,'to know the land','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/to-know-the-land.jpg','<p>A show about our connections with land. Species profiles, author interviews, land based knowledge, inter-species learning. Striving for embedded connection.</p>','byron','https://www.cfru.ca/?s=to%20know%20the%20land&posttype_search=mcm_recording','https://www.toknowtheland.com/','toknowtheland@gmail.com',3600,'cfru-to-know-the-land'),(84,'Blues Around the Block','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Blues-Around-the-Block-new-image.jpg','<p>Everything from folk to rockin’ electric and all stops in between. Occasionally veering off the rails into the unknown, it’s still all blues all the time. If you love the blues, we’ve got ’em and a whole lot Mo’.</p>','Mac Dee','https://www.cfru.ca/?s=Blues%20Around%20the%20Block&posttype_search=mcm_recording','','macdee@cfru.ca',3600,'cfru-blues-around-the-block'),(85,'Ripcord Radio','cfru','https://www.cfru.ca/wp-content/uploads/2020/08/logo.png','<p>Ripcord Radio is here to bring you 50,000 watts of punk rock from past to present. Stop & listen to a wide variety of loud, fast, dirty and sometimes weird music springing up from the underground.</p>','Jamie','https://www.cfru.ca/?s=Ripcord%20Radio&posttype_search=mcm_recording','','ripcordradio.cfru@gmail.com',3600,'cfru-ripcord-radio'),(86,'The Deep House Project','cfru','https://www.cfru.ca/wp-content/uploads/2019/02/unnamed.png','<p>Welcome to the Deep House Project. The show is an exploration of early deep house and its influences on modern music. The show plays classic club tracks in contrast with contemporary sounds while always spending time recognizing Canadian contributions.</p>','Aaron Blair','https://www.cfru.ca/?s=The%20Deep%20House%20Project&posttype_search=mcm_recording','https://www.facebook.com/DHPCFRU/','dhpcfru@gmail.com',3600,'cfru-the-deep-house-project'),(87,'Back in the USSR','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/proletarian-internationalism.jpg','<p>Music and cultural history from the former communist block, and rebel music from around the world!</p>','Seigfried Barazov','https://www.cfru.ca/?s=Back%20in%20the%20USSR&posttype_search=mcm_recording','https://proletarianguardbackintheussr.blogspot.com/','USSR@cfru.ca',3600,'cfru-back-in-the-ussr'),(89,'Terrible Horrible Breakfast','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Welcome to an eclectic tour through the weird, loud, dark, and/or strange side of music. A breakfast show for creatures of the night who would really rather not be awake at 9am.</p>','Edie','https://www.cfru.ca/?s=Terrible%20Horrible%20Breakfast&posttype_search=mcm_recording','','',3600,'cfru-terrible-horrible-breakfast'),(90,'Bridging The Social Distance','cfru','https://www.cfru.ca/wp-content/uploads/2020/03/49667588068_c3ed4dc50a_b.jpg','<p>A show that aims to give a platform for sharing ideas, perspectives and feelings in the wake of the Global COVID-19 pandemic. Interviews will feature local Guelphites as well as people living elsewhere around the world.</p>','Jenny Mitchell','https://www.cfru.ca/?s=Bridging%20The%20Social%20Distance&posttype_search=mcm_recording','','volunteer@cfru.ca',3600,'cfru-bridging-the-social-distance'),(91,'Tuesday at 5','cfru','https://www.cfru.ca/wp-content/uploads/2018/07/tuesday-at-5.jpg','','Mac Dee','https://www.cfru.ca/?s=Tuesday%20at%205&posttype_search=mcm_recording','','macdee@cfru.ca',3600,'cfru-tuesday-at-5'),(92,'Ear Candy','cfru','','<p>Serving up candy for your ears. Showcasing music both new and old, while supporting up and coming artists from Canada and around the globe! Tune in every Tuesday at 6pm for Ear Candy!</p>','Adrian Straatsma','https://www.cfru.ca/?s=Ear%20Candy&posttype_search=mcm_recording','','',3600,'cfru-ear-candy'),(93,'Melonaut Radio','cfru','https://www.cfru.ca/wp-content/uploads/2021/07/Thumb.png','<p>Melonaut Radio is a new exciting and chaotic open-concept progressive music podcast with elements of audio drama, interviews and storytelling. Formed under the tagline “genre is a construct”, Melonaut encompasses the core idea of prog as music that takes the listener on a journey, but welcomes a variety of music and genres that are prog in spirit, from darkwave to dark ambient and beyond. Hosted by Alia Synesthesia (podcast “Angelina Takes Requests”), siberian/canadian composer, trained operatic singer and multi-instrumentalist. FB: /melonautradio</p><p>Tune in on October 31, 2023, for a special Hallowe’en episode!</p>','Alia Synesthesia','https://www.cfru.ca/?s=Melonaut%20Radio&posttype_search=mcm_recording','https://melonaut.aliasynesthesia.com/','',3600,'cfru-melonaut-radio'),(94,'Let’s Get Lost','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Lets-Get-Lost.jpg','<p>Let’s Get Lost uses jazz as a staging area for discovery missions into other genres that inform jazz and into music that jazz affects (or infects).</p>','Scott Crockard','https://www.cfru.ca/?s=Let%26%238217%3Bs%20Get%20Lost&posttype_search=mcm_recording','','crockard@golden.net',3600,'cfru-lets-get-lost'),(95,'Humanoid Radio','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/humanoid-radio-banner-2020-rev.png','<p>A collage of experimental, electronic, ambient, and world music, incorporating spoken word.</p>','Alan Kirker','https://www.cfru.ca/?s=Humanoid%20Radio&posttype_search=mcm_recording','http://alankirker.com/humanoidradio/','',3600,'cfru-humanoid-radio'),(96,'Cyber Lich’s Gothic Castle','cfru','https://www.cfru.ca/wp-content/uploads/2022/10/DALL·E-2022-08-04-15.33.21-a-fantasy-drawing-of-a-giant-ominous-gothic-castle-in-the-night-lit-up-by-lightning-while-a-cyber-lich-cackles.png','<p>Step into the world of cybernetic darkness. Feel the deranged reverberations of the darkest of darksynth, dark ambient,.dungeon synth, and anything else eerie enough to send you screaming back to Arkham. The Cyber Lich awaits you.</p>','Cyber Lich','https://www.cfru.ca/?s=Cyber%20Lich%26%238217%3Bs%20Gothic%20Castle&posttype_search=mcm_recording','','',3600,'cfru-cyber-lichs-gothic-castle'),(97,'Wild Combination','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>There is something inherently magical about radio. So with this show I hope to play a ‘wild combination’ of music that I find strange or beautiful, to encourage late night moments of magic through listening.</p>','Jake Parker Scott','https://www.cfru.ca/?s=Wild%20Combination&posttype_search=mcm_recording','','',3600,'cfru-wild-combination'),(98,'Puerto Almendro','cfru','https://www.cfru.ca/wp-content/uploads/2020/01/PUERTO-ALMENDRO-Maria-Neder.jpg','','Maria Neder','https://www.cfru.ca/?s=Puerto%20Almendro&posttype_search=mcm_recording','http://www.marianeder.com.ar','marianeder@gmail.com',3600,NULL),(99,'The Stillness & The Dancing','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Stillness-The-Dancing.jpg','<p>Searching for the sublime in the simple? Give your ears some solace with highlights from the world of ambient, drone, electronic, neoclassical and post-rock. A quiet corner of sonic comfort food in a chaotic world. Soon to be your favourite introverted musical retreat.</p>','Joel Cuthbert','https://www.cfru.ca/?s=The%20Stillness%20%26%23038%3B%20The%20Dancing&posttype_search=mcm_recording','http://thestillnessandthedancing.tumblr.com/','thestillnessandthedancing@cfru.ca',3600,'cfru-the-stillness-the-dancing'),(100,'We Know Some Stuff + CFRU playlist','cfru','https://www.cfru.ca/wp-content/uploads/2020/08/WKSS-banner-3.jpg','<p>We Know Some Stuff: Scientists of Tomorrow Talking Today</p><p>Why are my house plants always dying? Do computers experience heartbreak? Will chocolate solve all my problems? We know the answers … well, mostly. Current and recent graduate students talk candidly about their science and how it helps us better understand life’s little questions. Unscripted, unedited, and understandable science that is fun to listen to, shaking up the traditional science radio show format.</p>','Louis A. Colaruotolo','https://www.cfru.ca/?s=We%20Know%20Some%20Stuff%20%2B%20CFRU%20playlist&posttype_search=mcm_recording','https://rss.com/podcasts/weknowsomestuff/','',3600,'cfru-we-know-some-stuff-cfru-playlist'),(101,'Seems Like Old Times','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Seems-Like-Old-Times-image.jpg','<p>Music and old time radio from the 1930’s to 1950’s, plus information and commentary that’s distinctively Doug!</p>','Doug Blackwood','https://www.cfru.ca/?s=Seems%20Like%20Old%20Times&posttype_search=mcm_recording','','',3600,'cfru-seems-like-old-times'),(102,'End Credits','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/End-Credits.jpg','<p>End Credits is a new weekly radio show on CFRU. The point of our show is movies: movie news and movie reviews. Our is a show dedicated to local movie fans, by local movie fans. We discuss and debate the latest news items in the realm of film and TV development in the first half, and after a music break we do an in-depth review of a movie recently released to theatres, streaming sites, or on demand.</p>','Adam Donaldson and others','https://www.cfru.ca/?s=End%20Credits&posttype_search=mcm_recording','','adamadonaldson@gmail.com',3600,'cfru-end-credits'),(103,'Keep Your Metres','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>A fill-in music show of new Canadian music, to get us through our Covid days.</p>','Jenny Mitchell','https://www.cfru.ca/?s=Keep%20Your%20Metres&posttype_search=mcm_recording','','volunteer@cfru.ca',3600,'cfru-keep-your-metres'),(104,'New Frontiers','cfru','https://www.cfru.ca/wp-content/uploads/2022/01/aaronwrixoncfru.png','<p>Che Guevara asked “What do we leave behind when we cross each frontier?” Get ready to find out—with the most adventurous avant-garde jazz and creative music on the dial.</p>','Aaron Wrixon','https://www.cfru.ca/?s=New%20Frontiers&posttype_search=mcm_recording','','',3600,'cfru-new-frontiers'),(105,'B Siide Radio','cfru','https://www.cfru.ca/wp-content/uploads/2021/11/AAEBE2EE-5B0D-4C1F-A15B-F07D0A187768.jpeg','<p>B Siide Radio, Bringing you the best in Hip Hop, R&B and everything In between. Shining a light on some of the best up-and-coming Canadian artists in the game!</p>','Mike Kivell','https://www.cfru.ca/?s=B%20Siide%20Radio&posttype_search=mcm_recording','','',3600,'cfru-b-siide-radio'),(106,'Trail Mix','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/CFRU-Eternal-Rhythm-photo-resized.jpg','<p>A hearty blend of rock, folk, jazz and country music.</p>','Dave Snider','https://www.cfru.ca/?s=Trail%20Mix&posttype_search=mcm_recording','http://eternalrhythmradioshow.blogspot.com/','eternalrhythm@cfru.ca',3600,'cfru-trail-mix'),(107,'Tone Zone','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Tone-Zone.jpg','<p>Show description coming soon!</p>','Dunster and Matt','https://www.cfru.ca/?s=Tone%20Zone&posttype_search=mcm_recording','','',3600,'cfru-tone-zone'),(108,'Wind-Down','cfru','https://www.cfru.ca/wp-content/uploads/2022/11/Wind-Down-image.jpg','<p>a program that offers you a selection of musical vibes to help you drift into the night. Starts off with high energy beats that get progressively dreamier through the show.</p>','Serra Willow','https://www.cfru.ca/?s=Wind-Down&posttype_search=mcm_recording','https://thewinddowncfru.blogspot.com/','',3600,'cfru-wind-down'),(109,'Radia','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Radia.jpg','<p>Radia is a network of independent radio stations, who have a common interest in promoting and producing artworks for the radio, and in forming related projects based on broadcasting and cultural exchange. Radia members produce a weekly radio show that is broadcast by each of the member radio stations. The shows represent the local artistic community of each station, whilst at the same time these new works point to an emergent collective notion of self-determined art for radio.</p>','Various','https://www.cfru.ca/?s=Radia&posttype_search=mcm_recording','','',3600,'cfru-radia'),(110,'Here Today','cfru','https://www.cfru.ca/wp-content/uploads/2022/04/Screen-Shot-2022-07-16-at-5.09.26-PM.jpeg','','Aaron Badgley','https://www.cfru.ca/?s=Here%20Today&posttype_search=mcm_recording','','',3600,'cfru-here-today'),(111,'Tales from the Bridge','cfru','https://www.cfru.ca/wp-content/uploads/2021/06/TFTB-Header.jpg','<p>You can always find more Tales From The Bridge on Apple Podcasts our website, you can also find us on Twitter, Instagram, and Facebook to see what is happening on The Bridge.</p><p>Check out our many links!</p><p>Apple Podcasts:</p><p>#podcast #sciencefiction #scifi #scifipodcast #applepodcasts #soundtrack #cinematicsound #composer #starwars #imperialmarch</p>','Tristan, Marty, Kevin, and Sam','https://www.cfru.ca/?s=Tales%20from%20the%20Bridge&posttype_search=mcm_recording','','',3600,'cfru-tales-from-the-bridge'),(112,'FoodFarm Talk','cfru','https://www.cfru.ca/wp-content/uploads/2019/03/FFT-For-CFRU.png','<p>FoodFarm Talk:</p><p>Food is life: We eat to live, and if there is anything worth celebrating, then it is food and the people behind it.</p><p>FoodFarm Talk is an interactive program that builds on the diversity of food research here at the University of Guelph and the strong agricultural and food community of the City of Guelph, to bring to listeners, among others, some of the wonderful works, being done from farm to fork. The program shows and celebrates the research, the people, and the activities that define the food we eat.</p>','Abdul-Rahim Abdulai, Emily Duncan, and Paul Smith','https://www.cfru.ca/?s=FoodFarm%20Talk&posttype_search=mcm_recording','https://anchor.fm/foodfarmtalk','',3600,'cfru-foodfarm-talk'),(113,'Android’s Dungeon','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/basement_stylised.jpg','<p>Enter the Android’s Dungeon with hosts Jack and Joel on a weekly show that discusses board and video games and their creators, the mechanics in them, and the culture around them. Give us a shout at androidsdungeon@cfru.ca or on twitter @ADRadioCFRU!</p>','Jack and Joel','https://www.cfru.ca/?s=Android%26%238217%3Bs%20Dungeon&posttype_search=mcm_recording','https://twitter.com/ADRadioCFRU','androidsdungeon@cfru.ca',3600,'cfru-androids-dungeon'),(114,'Listen Up','cfru','','Show description coming soon!','Jack','https://www.cfru.ca/?s=Listen%20Up&posttype_search=mcm_recording','','',3600,'cfru-listen-up'),(115,'RadiOPIRG','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/RadiOPIRG-1.png','<p>is our weekly spoken word show on CFRU 93.3FM, Guelph’s campus and community radio station, where we showcase the exciting work OPIRG is doing, and talk about current issues in the community related to social and environmental justice. Generally the show consists of recorded talks, live and pre-recorded interviews, spoken word pieces and music.  Listen to us on Thursdays from 3 to 4pm at 93.3FM.</p>','Omorowa Eguakun and Mandy Hiscocks','https://www.cfru.ca/?s=RadiOPIRG&posttype_search=mcm_recording','','',3600,'cfru-radiopirg'),(116,'T.K.O.','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/T.K.O..jpg','<p>From analyzing fights to paying tribute to legendary athletes, T.K.O. keeps you updated on the hottest issues that surround the world of Mixed Martial Arts and combat sports. Beast mode is guaranteed!</p>','Janan','https://www.cfru.ca/?s=T.K.O.&posttype_search=mcm_recording','','',3600,'cfru-t-k-o'),(117,'Café International','cfru','https://www.cfru.ca/wp-content/uploads/2022/10/Cafe-International-Take-Two.jpg','<p>Join host Dan Rosenberg on a radio series featuring interviews with musicians from around the world, from Fatoumata Diawara to Goran Bregović where we learn about folk music and its history.</p>','Daniel Rosenberg','https://www.cfru.ca/?s=Caf%C3%A9%20International&posttype_search=mcm_recording','','',3600,'cfru-cafe-international'),(118,'Open Sources Guelph','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Open-Sources-Guelph.jpg','<p>Open Sources Guelph is a weekly news, politics and current events radio show on CFRU 93.3 FM, campus and community radio in Guelph. Picking up the baton passed down by the Beyond the Ballot Box and Gang of Four shows, Open Sources will remain a dedicated, informative and alternative media source in the Royal City. Our mission is to bring Guelph all the latest news, insight and interviews on both the big issues of the day, and the issues being overlooked by the mainstream media. You can listen to Open Sources live, every Thursday at 5 pm by tuning your radio 93.3 FM or you can listen to us online at cfru.ca. Open Sources Guelph is hosted and produced by Scotty Hertz McWhinnie (The Working Week) and Adam A. Donaldson (Guelph Politico).</p>','Scotty Hertz & Adam Donaldson','https://www.cfru.ca/?s=Open%20Sources%20Guelph&posttype_search=mcm_recording','','',3600,'cfru-open-sources-guelph'),(119,'Turtle Island Underground','cfru','https://www.cfru.ca/wp-content/uploads/2022/05/Turtle-Island-Underground-revised.png','','Mac','https://www.cfru.ca/?s=Turtle%20Island%20Underground&posttype_search=mcm_recording','','',3600,'cfru-turtle-island-underground'),(120,'The Crooked Beat','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Crooked-Beat.jpg','<p>One of CFRU’s longest running and most beloved shows! Listen to Reggae, Dancehall, Ska & Rock Steady of all ages, styles and origins. “Don’t forget your history, know your destiny, In the abundance of water the fool is thirsty” (Bob Marley)</p>','Nicky Dread','https://www.cfru.ca/?s=The%20Crooked%20Beat&posttype_search=mcm_recording','http://nickydread.tripod.com/','nickydread@gmail.com',3600,'cfru-the-crooked-beat'),(121,'Sundowner','cfru','','<p>Finally, a show that brings the experience of staring out a bus window with headphones on to the airwaves. Tune in every other week for a selection of beloved gems, new releases, and left turns guaranteed to make today’s worries drift out of sight as you keep rolling.</p>','Matt Hollingshead','https://www.cfru.ca/?s=Sundowner&posttype_search=mcm_recording','','',3600,'cfru-sundowner'),(122,'Forever Deaf','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Dean-and-Todd-Forever-Deaf.jpg','<p>Dean and Todd have been on the air since 1987, and Forever Deaf has been in this format since 1989. Dean and Todd play all forms of extreme metal music, hardcore, punk, hard rock, and some prog for good measure.</p>','Dean and Todd','https://www.cfru.ca/?s=Forever%20Deaf&posttype_search=mcm_recording','','',3600,'cfru-forever-deaf'),(123,'Thanks for Listening :)','cfru','https://www.cfru.ca/wp-content/uploads/2021/10/Thanks-4-Listening.jpg','<p>Thanks For Listening</p>','Megan Arnold','https://www.cfru.ca/?s=Thanks%20for%20Listening%20:%29&posttype_search=mcm_recording','','',3600,'cfru-thanks-for-listening'),(124,'Planet Groove','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Planet-GrooveOL.jpg','<p>A history of underground rock, r&b, punk and more!</p>','Funky Blues Doctor','https://www.cfru.ca/?s=Planet%20Groove&posttype_search=mcm_recording','','',3600,'cfru-planet-groove'),(125,'Power Up! with Electrified Voltage','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Power-Up.jpg','<p>Underground rock and roll music from around the world! Electrified Voltage is a fountain of international rock & roll knowledge.</p>','Electrified Voltage','https://www.cfru.ca/?s=Power%20Up%21%20with%20Electrified%20Voltage&posttype_search=mcm_recording','','',3600,'cfru-power-up-with-electrified-voltage'),(126,'Viejoteca','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Viejoteca.jpg','<p>Guelph’s oldest pure salsa show. DJ Gury Gury plays the best in old school salsa, along with the hottest new performers. Que Viva la Salsa!!</p>','DJ Gury Gury','https://www.cfru.ca/?s=Viejoteca&posttype_search=mcm_recording','','salsa@cfru.ca',3600,'cfru-viejoteca'),(127,'LiYghTE FM','cfru','https://www.cfru.ca/wp-content/uploads/2022/03/LiYghTE-FM-long.png','<p>LiYghTE FM has two hundred and twenty-two percent of your daily light hits, hits sooo light you have to secure them tight. Never allow these hits to leave your person. To be kept under lock and key. It’s LiYghTE FM!</p>','DJ DD (Double D)','https://www.cfru.ca/?s=LiYghTE%20FM&posttype_search=mcm_recording','','',3600,'cfru-liyghte-fm'),(128,'Walkuman Style','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Walkuman-Style-schedule-grid-image.jpg','<p>Dinner time Hip Hop every Friday! One of the few weekly hip hop mix-shows today on Canadian radio. Gamma Krush gives you a continuous blending groove of underground and alternative hip hop, boom bap, old school, true school. Plus, featured mix-sets from other deejays.</p>','Gamma Krush','https://www.cfru.ca/?s=Walkuman%20Style&posttype_search=mcm_recording','','gammakrush@gmail.com',3600,'cfru-walkuman-style'),(129,'Digital Statik','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Digital-Statik.jpg','<p>Show description coming soon!</p>','DJ Julz','https://www.cfru.ca/?s=Digital%20Statik&posttype_search=mcm_recording','','deejayjulz@gmail.com',3600,'cfru-digital-statik'),(130,'Alegria Latina','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>Show description coming soon!</p>','Mango','https://www.cfru.ca/?s=Alegria%20Latina&posttype_search=mcm_recording','','',3600,'cfru-alegria-latina'),(132,'Global Rare Grooves','cfru','https://www.cfru.ca/wp-content/uploads/2022/11/Global-Rare-Grooves-image.jpg','<p>Dancefloor-oriented music from around the world that is jazz, funk and disco adjacent. Music from Africa, the Caribbean, Europe, South America, Southeast Asia, and North America with a special focus on Canadian artists. The program will play a mix of vintage and contemporary tunes, from the 1960s to the present day.</p>','Sam Cee','https://www.cfru.ca/?s=Global%20Rare%20Grooves&posttype_search=mcm_recording','','',3600,'cfru-global-rare-grooves'),(133,'The Illest','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','Start your weekend off right with a mix of 90’s and modern-day hip hop! Each week on the Illest we break down the sound coming out various regions across the US and look at the revolutionary artists that pioneered hip hop.','Caelen McCabe','https://www.cfru.ca/?s=The%20Illest&posttype_search=mcm_recording','','',3600,'cfru-the-illest'),(134,'It’s Time To get satis5d','cfru','https://www.cfru.ca/wp-content/uploads/2022/07/Its-Time-To-Get-satis5d-CFRU-picture.png','','satis5d','https://www.cfru.ca/?s=It%26%238217%3Bs%20Time%20To%20get%20satis5d&posttype_search=mcm_recording','','',3600,NULL),(135,'Folk Roots Radio','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/folk-roots-radio.jpg','<p>If folk, roots, country and blues are your thing you’ll find them all during this genre hopping show. Grab your favourite morning brew and settle down for two hours of music and more to start your Saturday! If you are a musician and you want to play live in the studio, get in touch. We’d love to hear from you!</p>','Jan Hall','https://www.cfru.ca/?s=Folk%20Roots%20Radio&posttype_search=mcm_recording','http://folkrootsradio.com/','jan@folkrootsradio.com',3600,'cfru-folk-roots-radio'),(136,'A Dog’s Breakfast','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/a-dogs-breakfast.jpg','<p>World music and Canadian-made “global” music.</p>','DJ\'','https://www.cfru.ca/?s=A%20Dog%26%238217%3Bs%20Breakfast&posttype_search=mcm_recording','','',3600,'cfru-a-dogs-breakfast'),(137,'Navrang Guelph','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Navrang-Guelph.jpg','<p>News, Music and Conversation in Punjabi and Hindi.</p>','Arun T','https://www.cfru.ca/?s=Navrang%20Guelph&posttype_search=mcm_recording','','trikha48@gmail.com',3600,'cfru-navrang-guelph'),(138,'Sound Magic','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Sound-Magic-Treble-Clef-Image-take-2.jpg','<p>Michael Doleschell’s survey of recent releases of concert art music, featuring forgotten or neglected figures from the margins of history till today. Specializing in the rare, bizarre or obscure.</p>','Michael Doleschell','https://www.cfru.ca/?s=Sound%20Magic&posttype_search=mcm_recording','','',3600,'cfru-sound-magic'),(139,'Bel Araby with CAWA','cfru','https://www.cfru.ca/wp-content/uploads/2022/08/Bel-Araby-with-CAWA-log.jpg','<p>Start your weekend right with the Canadian Arab Women’s Association (CAWA) and listen to Arabic songs that feel like home!</p>','','https://www.cfru.ca/?s=Bel%20Araby%20with%20CAWA&posttype_search=mcm_recording','','',3600,'cfru-bel-araby-with-cawa'),(140,'Caribbean Anthology','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/caribbean-anthology-logo-CFRUSITE.png','<p>Join us as we take you on a musical ride, exploring the depths of West Indian music from the yesteryear to our current day. Come take a musical round trip in our Time Machine: Caribbean Anthology.</p>','Keon (DOC)','https://www.cfru.ca/?s=Caribbean%20Anthology&posttype_search=mcm_recording','','',3600,'cfru-caribbean-anthology'),(141,'Alternativa Latinoamericana','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Alternativa-Latinoamericana.jpg','<p>Reflects Latin America’s reality, from literature and news to important social and political issues, A place for information in Spanish for those who want to know what’s happening in their countries of origin as well as their own communities in Canada.</p>','Collective','https://www.cfru.ca/?s=Alternativa%20Latinoamericana&posttype_search=mcm_recording','','',3600,'cfru-alternativa-latinoamericana'),(142,'Tiempo de Mujeres','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Tiempo-de-Mujeres.jpg','<p>“It is Time for Women” – this show is created by women for women’s issues.</p>','Collective','https://www.cfru.ca/?s=Tiempo%20de%20Mujeres&posttype_search=mcm_recording','','',3600,'cfru-tiempo-de-mujeres'),(143,'Mach Vibe Radio','cfru','https://www.cfru.ca/wp-content/uploads/2018/05/RADIO-SHOW-COVER-ART.jpg','<p>Showcasing local/independent Hip Hop/ R&B/ Reggae talents hailing out of Canada!</p>','Dj CanadianYardy and 7even 2wenty 8ight','https://www.cfru.ca/?s=Mach%20Vibe%20Radio&posttype_search=mcm_recording','','',3600,'cfru-mach-vibe-radio'),(144,'The Underground','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/the-underground.jpg','<p>DJ Vulgar & Oddie O’Phyle spin serious underground beats to keep your weekend alive!!</p>','DJ Vulgar & Oddie O\'Phyle','https://www.cfru.ca/?s=The%20Underground&posttype_search=mcm_recording','','sasha.g.radisic@gmail.com',3600,'cfru-the-underground'),(145,'Visions fugitives','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Visions-fugitives.jpg','<p>A spotlight on classical (and modern classical) composition!</p>','Christopher and Fangwei','https://www.cfru.ca/?s=Visions%20fugitives&posttype_search=mcm_recording','','',3600,'cfru-visions-fugitives'),(146,'The Kookoo Bananas Variety Hour','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/The-Kookoo-Bananas-Variety-Hour.jpg','<p>The Kookoo Bananas Variety Hour is a family-friendly show jam-packed with kiddie records, weirdo pop culture, and songs sung by robots, animals, and even kids! Hosted by Cap’n Kookoo & The Banana Brats.</p>','Curtis Walker & kids','https://www.cfru.ca/?s=The%20Kookoo%20Bananas%20Variety%20Hour&posttype_search=mcm_recording','https://www.cfru.ca/www.facebook.com/KookooBananas','kookookoobananas@gmail.com',3600,'cfru-the-kookoo-bananas-variety-hour'),(147,'One Turntable and a Microphone','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>I bought a turntable! Join me as I play my records on this newfangled technology and talk about the history and future of the turntable and records in general. I’m new to all of this, so I’ll be learning with you! I’ll also be doing a deep dive on the records that I spin and generally will cover one album per show. I’ll be exploring how they were recorded and what was good or bad about them, and learning some interesting musical trivia! This should be fun!</p>','Mark Hallman','https://www.cfru.ca/?s=One%20Turntable%20and%20a%20Microphone&posttype_search=mcm_recording','','',3600,'cfru-one-turntable-and-a-microphone'),(148,'Clan Na Gael','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Clan-Na-Gael.jpg','<p>Clan-na-Gael is one of CFRU’s longest running shows. Host John Fahy features Celtic/Folk music from around the world and around the corner. The music played originates in Canada, USA, Australia, Wales, Scotland, Cornwall in England, Brittany in France & Ireland. The Show particularly features local, regional and national artists with approx. 50% Canadian content weekly.</p>','John Fahy (regular host) & sometimes McDee','https://www.cfru.ca/?s=Clan%20Na%20Gael&posttype_search=mcm_recording','','clannagael@cfru.ca',3600,'cfru-clan-na-gael'),(149,'La Buena Onda','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/La-Buena-Onda.jpg','<p>The best of the best from Latin America, including reggaeton, pop, rock, salsa, bachata, merengue, cumbia and all of the newest sounds.</p>','DJ Andito','https://www.cfru.ca/?s=La%20Buena%20Onda&posttype_search=mcm_recording','','labuenaonda@live.com',3600,'cfru-la-buena-onda'),(150,'Zombie Jamboree','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Zombie-Jamboree-1.jpeg','<p>An international, cross-genre dance party that isn’t afraid to delve into the shadows, Zombie Jamboree is your weekly re-animator.</p>','B-Sides Mathews','https://www.cfru.ca/?s=Zombie%20Jamboree&posttype_search=mcm_recording','','zombiejamboree@cfru.ca',3600,'cfru-zombie-jamboree'),(151,'Neighbouring Sounds','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','','Joseph Shea Carter','https://www.cfru.ca/?s=Neighbouring%20Sounds&posttype_search=mcm_recording','','',3600,'cfru-neighbouring-sounds'),(152,'Through the Looking Glass','cfru','https://www.cfru.ca/wp-content/uploads/2020/07/Screen-Shot-2021-09-18-at-11.17.51-PM.png','<p>So much music, so little time. Shall we go down a rabbit hole or two?</p>','Alice','https://www.cfru.ca/?s=Through%20the%20Looking%20Glass&posttype_search=mcm_recording','https://www.facebook.com/Through-The-Looking-Glass-CFRU-105521528880013','LookingGlassCFRU@cfru.ca',3600,'cfru-through-the-looking-glass'),(153,'Backtracks','cfru','https://www.cfru.ca/wp-content/uploads/2020/11/image0-1.jpeg','<p>Crate Digger’s obscurities, rarities and B sides from the epic 60s and 70s.</p>','Eileen Jennifer','https://www.cfru.ca/?s=Backtracks&posttype_search=mcm_recording','','',3600,'cfru-backtracks'),(154,'This Night Wounds Time','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/this-night-wounds-time.jpg','<p>Avant garde, jazz, and experimental music … and geographical themes.</p>','TCC','https://www.cfru.ca/?s=This%20Night%20Wounds%20Time&posttype_search=mcm_recording','','',3600,'cfru-this-night-wounds-time'),(155,'Dr Mouth’s Rock and Roll Lunch Party','ciut','https://ciut.fm/wp-content/uploads/2020/06/mouth-CIUT-scaled.jpg','Dr Mouth’s Rock and Roll Lunch Party!',' Dr Mouth','https://ciut.fm/shows/dr-mouths-rock-and-roll-lunch-party/',NULL,'drmouth@ciut.fm',7200,'ciut-dr-mouths-rock-and-roll-lunch-party'),(156,'Pot Pourri','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','“Pot-Pourri Show” – Toute la diversté du monde sur votre fréquence. Un magazine culturel francophone, concept original 100%. Un regard différent sur l’actualité et les grands enjeux et défis de la francophonie. Cinéma / Musique / Spectacles/ Jeux-concours / Livres / Humour / Culture / Politique / LGBTQIA+. En partenariat avec Radio France Internationale, l’Université de Toronto, EducNation Consulting Inc., Noire & Psy, Cinéfranco, Kilimandjaro Radio/TV',' Eric, Ron, Morgane','https://ciut.fm/shows/pot-pourri/','http://potpourrishow.com/','potpourri@ciut.fm',7200,'ciut-pot-pourri'),(157,'33-45-78','ciut','https://ciut.fm/wp-content/uploads/2020/05/Steve-Fruitman.jpg','An all vinyl music program mined from my own record collection. I bought my first LP in April 1964 and haven’t stopped buying them since. So let’s listen to them on 33.45.78',' Steve Fruitman','https://ciut.fm/shows/33-45-78/',NULL,'334578@ciut.fm',7200,'ciut-33-45-78'),(158,'The Radical Reverend','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','Think all those in faith communities are misogynist homophobic idiots? Think again! Religion and politics no matter what you believe shape the world. Listen to the Revolutionary Rantings of the Radical Reverend and other heretics!',' Cheri DiNovo','https://ciut.fm/shows/the-radical-reverend/',NULL,'radicalreverend@ciut.fm',3600,'ciut-the-radical-reverend'),(159,'Career Buzz','ciut','https://ciut.fm/wp-content/uploads/2020/07/StephenArmstrong.jpeg','Since 2006, we’ve broadcast unrehearsed and informative conversations featuring extraordinary career stories of ordinary people, and insights from future-of-work thought leaders including Dragon’s Den star Arlene Dickinson, Canada’s career guru Barbara Moses, National Geographic explorer-in-residence Wade Davis, and career scholars Norm Amundson, John Krumboltz and many more.','','https://ciut.fm/shows/career-buzz/',NULL,'careerbuzz@ciut.fm',3600,'ciut-career-buzz'),(161,'Viento Sur','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','A journey through the diverse musical Bolivian landscape.',' Marco Lopez','https://ciut.fm/shows/viento-sur/',NULL,'vientosur@ciut.fm',3600,'ciut-viento-sur'),(162,'Gospel Music Machine','ciut','https://ciut.fm/wp-content/uploads/2020/06/brogee1-1024x926.jpg','The Gospel Music Machine is one of the longest running gospel music programs on radio in Canada. The program features a blend of gospel hits from various genres, along with current affairs, news and interview segments. The show provides a forum for current local and international Christian artists, while initiating new ventures for emerging talent. It also serves as an information sourcefor what’s happening on the international and local gospel scene.',' Courtney Williams and Richard Gordon aka (BroGee)','https://ciut.fm/shows/gospel-music-machine/','https://gospelmusicmachine.wordpress.com/','gospelmusicmachine@gmail.com',10800,'ciut-gospel-music-machine'),(163,'CIUT Critics Circle','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','We cover the arts and politics on this show. Listen weekly for: Film reviews with Film Critic Daniel Garber of culturalmining.com and Theatre reviews with our Passionate Playgoer and Theatre Critic Lynn Slotkin (Formerly of the CBC).',' Phil Taylor','https://ciut.fm/shows/ciut-critics-circle/',NULL,NULL,3600,'ciut-ciut-critics-circle'),(164,'Beyond the Headlines','ciut','https://ciut.fm/wp-content/uploads/2020/05/Beyond-the-Headlines-1.jpg','Beyond the Headlines is a weekly one-hour current affairs radio show & podcast airing on Mondays at 11AM on CIUT 89.5. Through discussions with leading Canadian and global experts, we aim to capture the essence of important public policy and global affairs issues. By taking a “deep dive” into a new subject each week, our objective is to take listeners beyond the immediacy of our daily news. We aspire to create content that is accessible to a wider audience, not simply those who have an academic background in policy. BTH is produced by Master’s students within the ',NULL,'https://ciut.fm/shows/beyond-the-headlines/','https://www.beyondtheheadlines.net/','beyondtheheadlines@ciut.fm',3600,'ciut-beyond-the-headlines'),(167,'Funky Fridays','ciut','https://ciut.fm/wp-content/uploads/2020/07/funky-fridays_ciut_logo-website-photo.jpg','Covering 6 decades of funk with a touch of soul!',' Mr. Pete, Dr. Mouth','https://ciut.fm/shows/funky-fridays/',NULL,'funkyfridays@ciut.fm',10800,'ciut-funky-fridays'),(168,'Drill Squad','ciut','https://ciut.fm/wp-content/uploads/2020/06/0-2-934x1024.jpeg','The best thing you’ll hear at 6am.',' DJ Dred-E-Maximum & DJ Magic Tricks','https://ciut.fm/shows/drill-squad/',NULL,'thedrillsquad@ciut.fm',10800,'ciut-drill-squad'),(169,'Indigenous Waves','ciut','https://ciut.fm/wp-content/uploads/2022/11/Jennifer-Sylvester.jpg','Jennifer Sylvester MEd, (She/Her) is in the third year of her Ph.D. in Leadership, Higher and Adult Education at University of Toronto - OISE. Deep family roots from Chimnissing  (Beausoliel) First Nation, but she was born and raised in Toronto. She is an advocate for Indigenous social issues, such as equity, protection, and Inclusion of Indigenous women. She\'s a hobbyist, crafter, and a single parent to a 16-year-old.  ',' Jenny Blackbird and Jennifer Sylvester','https://ciut.fm/shows/indigenous-waves/',NULL,'indigenouswaves@ciut.fm',3600,'ciut-indigenous-waves'),(170,'Ruby Slippers','ciut','https://ciut.fm/wp-content/uploads/2020/06/Ruby-Slippers-Carol-Barrett-IMG_3670.jpg','Music fiend passionate about the power of community radio. Veteran programmer back for another round on CIUT. All artists are welcome, new and older, from near and far. It\'s all about the music, I\'m just the host...',' Carol Barrett','https://ciut.fm/shows/ruby-slippers/',NULL,'carolbonciut@ciut.fm',3600,'ciut-ruby-slippers'),(171,'Second To the Right','ciut','https://ciut.fm/wp-content/uploads/2022/03/ohio-phils-inn.jpg','Broadcasting in the deep end of the nighttime, Second to the Right is three hours of eclectic music, poetry, and surprises, all presented with wit, intelligence, and acumen. Come visit and prepare for the beginning of the workaday week. Requests are encouraged.',' Brad Reed ','https://ciut.fm/shows/second-to-the-right/',NULL,'secondtotheright@ciut.fm',10800,'ciut-second-to-the-right'),(173,'Club Ned','ciut','https://ciut.fm/wp-content/uploads/2020/07/club-ned_ciut_db-hawkes-web-photo-768x1024.jpg','Late night mix like no other brought to you by DB Hawkes.',' DB Hawkes','https://ciut.fm/shows/club-ned/',NULL,'dbhawkes@ciut.fm',21600,'ciut-club-ned'),(174,'Global Rhythms','ciut','https://ciut.fm/wp-content/uploads/2020/06/98353479_293245375021760_3318519585199620096_n-768x1024.jpg','Travel the world through music without leaving your living room.',' Ken Stowar','https://ciut.fm/shows/global-rhythms/',NULL,'globalrhythms@ciut.fm',10800,'ciut-global-rhythms'),(175,'No Man’s Land','ciut','https://ciut.fm/wp-content/uploads/2022/11/DJ-medicineman-CIUT-Show-Page.jpeg','Richard ‘Medicineman’ Martin is Canada’s premier global groove DJ. His sets flow seamlessly from Indo Arabic Dub to Afro Gypsy Electronica, mixing primitive rhythms with progressive beats.',' DJ Medicineman','https://ciut.fm/shows/no-mans-land/',NULL,'nomansland@ciut.fm',7200,'ciut-no-mans-land'),(177,'The Prophecy','ciut','https://ciut.fm/wp-content/uploads/2020/06/52141172_10157126648938980_2681517867244978176_o.jpg','For 17 years, Prophecy Radio has been the hub for Toronto’s DNB community. Every week our listeners get the most upfront bass cultured music around!',' Scott Free, Mr. Brown & Polaris','https://ciut.fm/shows/the-prophecy/',NULL,'theprophecy@ciut.fm',7200,'ciut-the-prophecy'),(178,'EqualizingXDistort','ciut','https://ciut.fm/wp-content/uploads/2023/07/IMG_7889-scaled.jpg#2488','Description: Underground hardcore punk with features on genres or bands or shows AND weekly demo features.',NULL,'https://ciut.fm/shows/equalizingxdistort/','http://equalizingxdistort.blogspot.com/','equalizingxdistort@gmail.com',7200,'ciut-equalizingxdistort'),(179,'Groove Concept Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0319.jpg','Groove Concept Radio’s content mirrors the melting pot of musical genres and has carved a niche for itself as the home of Jazz, R&B, Soul, hip-hop & left-field sounds. Hosted by Emile Weekes, the show\'s goal is to always deliver \"message music\", with an emphasis on lyrical content and a perfect groove.',' Emile Weekes','https://ciut.fm/shows/groove-concept-radio/',NULL,'grooveconceptradio@ciut.fm',7200,'ciut-groove-concept-radio'),(180,'Howl','ciut','https://ciut.fm/wp-content/uploads/2020/06/Valentino.png','Valentino Assenza has been a published poet and performing spoken word artist for over the last two decades. In that time he has released four chapbooks and performed all over Canada and the US. Valentino has been a co-host and co-producer of HOWL on CIUT 89.5FM, where he has interviewed names such as George Elliott Clarke, Anne Michaels, Denise Donlon, Ron Sexsmith, and Margaret Atwood.',' Valentino Assenza','https://ciut.fm/shows/howl/',NULL,'howl@ciut.fm',3600,'ciut-howl'),(181,'Reggae Riddims','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','The best reggae you’ve ever heard.',' Patrick Roots','https://ciut.fm/shows/reggae-riddims/',NULL,'rasta@ciut.fm',7200,'ciut-reggae-riddims'),(182,'No Beat Radio','ciut','https://ciut.fm/wp-content/uploads/2020/05/20200512_080559-577x1024.jpg','Join Minesh Mandoda and No Beat Radio for a seamless journey through a world of unbound sound. Each show features both new and unknown ‘classics’ from Toronto and beyond that connect genres from electronica, folk, free jazz, garage, hip-hop, punk, krautrock and new world. From time to time a few guests and performances.',' Minesh Mandoda','https://ciut.fm/shows/no-beat-radio/','https://soundcloud.com/nobeatradio','nobeatradio@ciut.fm',3600,'ciut-no-beat-radio'),(183,'What Is Hip?','ciut','https://ciut.fm/wp-content/uploads/2020/06/Screenshot_20190105-142307_Facebook.jpg','Jazz, Latin-jazz, Jazz-Funk, Jazz-Fusion, SteelyDan. This is how the JazzFix rolls every week from 8 to 9pm. From 9 to 10pm - The lounge mix shifts gears into a DJ Set to round out the show.',' DjGoldfinger','https://ciut.fm/shows/what-is-hip/',NULL,'whatiship@ciut.fm',7200,'ciut-what-is-hip'),(184,'Six Degrees','ciut','https://ciut.fm/wp-content/uploads/2020/05/image0.jpeg','Playing the best hidden gems and underground Hip-hop, Dub, Grime, Soul, R & B, from around the world. Includes interviews from local up-and-coming musicians and people behind the scenes. Chances are that your new favourite song was played here first.',' DJ SLAM! & Mlny','https://ciut.fm/shows/six-degrees/',NULL,'6degrees@ciut.fm',7200,'ciut-six-degrees'),(185,'A to Z Blues','ciut','https://ciut.fm/wp-content/uploads/2020/05/Screamin-Red-300x293.png','An introduction for many and an reintroduction for others to the forgotten blues artists in context with today’s performers.',' Screamin’ Red & Howlin\' Wolf Boy','https://ciut.fm/shows/a-to-z-blues/',NULL,'atozbluesonciut@gmail.com',3600,'ciut-a-to-z-blues'),(186,'Higher Ground','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMGP1543-scaled.jpg','Funk, soul, and everything in between.',' Jason Palma','https://ciut.fm/shows/higher-ground/',NULL,NULL,7200,'ciut-higher-ground'),(187,'Dreaming In Stereo','ciut','https://ciut.fm/wp-content/uploads/2020/06/Dreaming-in-Stereo-scaled.jpg','This weekly show is hosted by Alexandra, U of T alumni and avid concertgoer. The music featured is a diverse mix of indie, rock, folk and electronic new releases. The focus is on uplifting local and international sounds and music news and announcements.',' Alexandra Simion','https://ciut.fm/shows/dreaming-in-stereo/','http://www.dreaminginstereo.ca/','dreaminginstereo@ciut.fm',3600,'ciut-dreaming-in-stereo'),(188,'Masterplan','ciut','https://ciut.fm/wp-content/uploads/2020/07/MASTERPLAN_TMPS-LOGO-PNG-1024x1024.png','Celebrating over 30 years Hip Hop in your city and across Canada & U.S.A. worldwide. The Master Plan show started in 1989 with John Adams, Wendy Brathwaite aka Motion, Derrick aka Dj Power and Dave Clarke aka DJ DTS. The Masterplan show is run by the members of the community with volunteers from all across the city. DJ DTS is still on the show as a mentor for Generation Next founded by Dj Romeo aka Matthew Romeo and DTS, to give help and support to the younger generation who are interested in radio production, spoken word, Dj-ing, and life skills just to name a few. ','','https://ciut.fm/shows/masterplan/',NULL,NULL,7200,'ciut-masterplan'),(189,'Vinyl From the Crypt','ciut','https://ciut.fm/wp-content/uploads/2020/06/20181012_150341.jpg','The Show for Audiophiles! For over a dozen years, Vinyl From The Crypt has given CIUT listeners and supporters the opportunity to come and present a 2-hour program featuring vinyl recordings from their personal collections.',' Sean Mitchell','https://ciut.fm/shows/vinyl-from-the-crypt/',NULL,'vinylfromthecrypt@ciut.fm',7200,'ciut-vinyl-from-the-crypt'),(190,'The Bassment Sessions','ciut','https://ciut.fm/wp-content/uploads/2020/06/Dubmatix-CIUT.jpg','Bassment Sessions is a weekly music mix focusing on reggae, dub, funk, jungle, hip-hop and beyond. ',' Dubmatix','https://ciut.fm/shows/the-bassment-sessions/',NULL,NULL,3600,'ciut-the-bassment-sessions'),(191,'Frisson Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/Frission-Radio.jpg','Frisson has its origin as a French word, which translates to a thrill or shiver akin to goose bumps. Those pore raising feelings are the emotions we seek to evoke as we curate music & provide Canadian artists, producers and DJs with a platform for exposure and expression.',' Mikhael (Miks) Lamont & Nabeel Pervaiz','https://ciut.fm/shows/frisson-radio/',NULL,'frissonradio@ciut.fm',7200,'ciut-frisson-radio'),(192,'Veritable Infusion','ciut','https://ciut.fm/wp-content/uploads/2023/03/300x300-0x000_4928554.jpg','VERITABLE INFUSION is one of several French translations for Naturally Flavoured. That is the only common denominator going on here; the music is naturally flavoured, crashing and gliding through many styles, from really old country and blues to dalliances with psychedelia, a lot of soul and funk from around the world, and usually topped off with a dose of reggae. Most weeks I insert some theme which is hoped to add some edification to the entertainment. Themes vary from the earliest Canadians to make American hits to the respective soul scenes of various countries, states and / or cities. An international music party going ‘All around the world for the funk’…',' DJ Erik T','https://ciut.fm/shows/veritable-infusion/','https://veritableinfusion.podomatic.com/','veritableinfusion@ciut.fm',7200,'ciut-veritable-infusion'),(193,'Classical Underground','ciut','https://ciut.fm/wp-content/uploads/2020/06/Philip-Conlon.png','Discover rare classical music gems and hear great stories too.',' Philip Conlon','https://ciut.fm/shows/classical-underground/',NULL,'classicalunderground@ciut.fm',7200,'ciut-classical-underground'),(194,'Radio Boogie','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0597-rotated.jpg','Radio Boogie focuses on today’s listener. Bluegrass and Old-Time music is today’s “folk” music, it is forever changing and forever relevant in today’s changing world of traditional musics.',' Steve Pritchard','https://ciut.fm/shows/radio-boogie/',NULL,'radioboogie@ciut.fm',7200,'ciut-radio-boogie'),(195,'Dementia 13','ciut','https://ciut.fm/wp-content/uploads/2022/11/IMG-2150.jpg','Musical rarities from the other side of the Psychedelic Era. Early Prog Rock, Acid, Sunshine Pop, Garage, Beat, Freak Folk and Psychedelia of all sorts; the period’s best gems on 33-45 rpm.',' Christian Hamilton','https://ciut.fm/shows/dementia-13/','https://www.facebook.com/dementia13radio/','dementia13radio@gmail.com',7200,'ciut-dementia-13'),(196,'Across the Universe','ciut','https://ciut.fm/wp-content/uploads/2020/05/91767915_10158588047969575_526689013419999232_o.jpg','A weekly musical and sonic journey connecting the pieces of an ever expanding mosaic of sound, interspersed with the delivery of small-chat of a human interest nature with some lyrical and mildly philosophical content.',' Ken Stowar','https://ciut.fm/shows/across-the-universe/',NULL,'acrosstheuniverse@ciut.fm',10800,'ciut-across-the-universe'),(197,'Phil’s Inn','ciut','https://ciut.fm/wp-content/uploads/2022/03/ohio-phils-inn.jpg','Brad Reed has been involved in campus/community radio as on-air programmer since the 1970s. These past few years he has been honoured to be appointed General Manager/Custodian of Phil’s Inn. Drop in on Saturday afternoons, pull up a chair, sit by the fireplace, and take off your thirsty boots. Stay for awhile. Requests encouraged.',' Brad Reed','https://ciut.fm/shows/phils-inn/',NULL,NULL,7200,'ciut-phils-inn'),(198,'Ultra Latino','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-Michelle-3330-sm.jpg','Tune in to Ultra Latino every Sunday from 2-3pm on CIUT 89.5 FM! We’re playing the best Latin music… new and old on your FM radio!',' Michelle (Dj Chelli)','https://ciut.fm/shows/ultra-latino/',NULL,'ultralatinoradio@gmail.com',3600,'ciut-ultra-latino'),(199,'The Lovecast','ciut','https://ciut.fm/wp-content/uploads/2023/03/Lovecast-Banner-New-X-Flower-Cropped-for-CIUT-Page.png','Dave O Rama takes you on a journey through his schizophonic ears. From roots and blues to electronic moods, from orchestral to free form, dub stylistics, Latin soul psychedelics, global grooves, Afrocentric moves, and whatever other sonic delectables he digs up to stir into the pot.',' Dave O Rama','https://ciut.fm/shows/the-lovecast/',NULL,'lovecast@ciut.fm',7200,'ciut-the-lovecast'),(200,'Karibuni','ciut','https://ciut.fm/wp-content/uploads/2020/06/thierno-and-nadine.jpg','A celebration of the cultures and music from the African continent.',' Nadine McNulty and Thierno Soumare','https://ciut.fm/shows/karibuni/',NULL,'karibuni@ciut.fm',7200,'ciut-karibuni'),(201,'The More the Merrier','ciut','https://ciut.fm/wp-content/uploads/2023/05/IMG_20230421_191011_660.jpg','donna g has been involved with CIUT 89.5 FM for almost 25 years. From being a member of the feminist collective \"By All Means\" in the 90\'s, to co-hosting the Caribbean-Filipino fusion show \"baba(eh) mama\" in the early 2000\'s to her present solo show, \"The More the Merrier.\" donna g has made it her goal to bring film, theatre and arts-at-large coverage to the broadest possible audience.',' donna g','https://ciut.fm/shows/the-more-the-merrier/',NULL,'tmtmwithdonnag@ciut.fm',3600,'ciut-the-more-the-merrier'),(203,'The Bill King Show','ciut','https://ciut.fm/wp-content/uploads/2020/06/Bill-King-905x1024.jpg','New music, cultural waves, faces in the news, fresh ideas, a glimpse at the past, the sounds of the future – all done with humour, clarity and a determination to share the best in all of us.',' Bill King','https://ciut.fm/shows/the-bill-king-show/','https://www.mixcloud.com/6345789/the-bill-king-show-with-kim-stockwood-ciut-895-fm/','thebillkingshow@ciut.fm',3600,'ciut-the-bill-king-show'),(204,'Meditation-Relaxation-Chill','ciut','https://ciut.fm/wp-content/uploads/2020/12/newchill.jpg','Join us each Friday from 1- 3 pm for a mix of meditative, relaxing, and chill sounds and positive vibrations to help you through the remainder of your day.',NULL,'https://ciut.fm/shows/meditation-relaxation-chill/',NULL,'ken.stowar@ciut.fm',7200,'ciut-meditation-relaxation-chill'),(205,'Music At High Noon','ciut','https://ciut.fm/wp-content/uploads/2020/06/Music-at-High-Noon.png','Two hour open format music program. Genres include a variety of rock, surf, blues, jazz, funk, soul, and reggae.',' Mike Tadros','https://ciut.fm/shows/music-at-high-noon/',NULL,'highnoon@ciut.fm',7200,'ciut-music-at-high-noon'),(206,'The Minx Sessions','ciut','https://ciut.fm/wp-content/uploads/2020/06/40138933_10156334687820325_4252347171585654784_o.jpg','A musical appreciation show! Serving up new and old in abstract jazz, electronic, techno, deep house, soul, funk and anything to get you movin’!',' Binny the Minx','https://ciut.fm/shows/the-minx-sessions/','https://theminxsessions.com/','theminxsessions@ciut.fm',7200,'ciut-the-minx-sessions'),(207,'Music With DB Hawkes','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png',NULL,' DB Hawkes','https://ciut.fm/shows/music-with-db-hawkes/',NULL,'dbhawkes@ciut.fm',7200,'ciut-music-with-db-hawkes'),(209,'Turn Out Radio','ciut','https://ciut.fm/wp-content/uploads/2020/06/Turn-Out-Radio-Logo.jpg','Turn Out Radio is an innovative and engaging talk show which incorporates the latest in dance news within the national and international spectrum of current events. The broadcast platform connects with spotlighted guests to discover the heart of what moves us, and the latest in the news of our day. From critical perspectives on history to performance highlights, dance health news, and the real stories that live both on and beyond the stage.',' Nicole Inica Hamilton','https://ciut.fm/shows/turn-out-radio/','http://turnoutradio.com/','turnoutradio@ciut.fm',3600,'ciut-turn-out-radio'),(211,'Slipmat and Friends','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_2972-768x1024.jpg','Slipmat & Friends can be described as the sound of Herbie Hancock and King Diamond fighting over what to put on the turntable. Every Tuesday morning at midnight.',' Robert Trevisan','https://ciut.fm/shows/slipmat-and-friends/',NULL,'slipmatandfriends@ciut.fm',7200,'ciut-slipmat-and-friends'),(212,'Soundtracks For the Alpha State','ciut','https://ciut.fm/wp-content/uploads/2020/06/Chris-Durand.jpg','The host for Soundtracks for the Alpha State, Chris has over ten years of experience on air, having started in Buffalo at WBNY before hopping the border in 2013. Combining indie tunes, a snarky personality, and a bit of camp, things are always weird when he\'s on air.',' Chris Durand','https://ciut.fm/shows/soundtracks-for-the-alpha-state/',NULL,'chris.durand@ciut.fm',7200,'ciut-soundtracks-for-the-alpha-state'),(216,'Raw','ciut','https://ciut.fm/wp-content/uploads/2022/02/IMG_20211119_193311_108.jpg','Take flight Friday\'s @ 8PM, all vinyl selection of dusty gems, sample gold, and rare grooves from around the world.',' Kalliopi Telidis & Ariel Samonte','https://ciut.fm/shows/raw/',NULL,'raw@ciut.fm',7200,'ciut-raw'),(217,'Moondog’s Ballroom','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','You ain’t no punk you punk; this here’s the real junk! The best on Rawk n’ Roll from the roots til the future; Punk, Rockabilly, Surf, Garage, Psyche, Cowpunk, Psychobilly, Honky Tonk, Blues, Swing, Doo Wop, Soul and Gospel just like the Good Lord intended.',' Daibhid James','https://ciut.fm/shows/moondogs-ballroom/','http://moondogsplaylists.blogspot.com/','moondogsballroom@ciut.fm',3600,'ciut-moondogs-ballroom'),(218,'The Taylor Report','ciut','https://ciut.fm/wp-content/uploads/2023/03/The-Taylor-Report-Logo.png','We talk to informed people with a fresh point of view. The topics are war, peace, resistance, etc.',' Phil Taylor','https://ciut.fm/shows/the-taylor-report/',NULL,'thetaylorreport@ciut.fm',3600,'ciut-the-taylor-report'),(219,'Electric Sense','ciut','https://ciut.fm/wp-content/uploads/2020/06/2020-05-15-01.11.47-scaled.jpg','All sorts of unusual. Electronic, experimental, improvised, modern orchestral/chamber composition, sound poetry, whatever else falls into weird. Mostly from the last few years with occasional trips down memory lane.',' James Bailey','https://ciut.fm/shows/electric-sense/',NULL,'electricsense@ciut.fm',3600,'ciut-electric-sense'),(247,'Calling All Blues','ciut','https://ciut.fm/wp-content/uploads/2020/06/CIUT-89.5FM.png','Four rotating hosts produce a diversity of blues and related music (roots, soul, R&B, jazz, gospel, funk, & more) from classic / traditional to contemporary, solo acoustic to electric bands, and local to international, with personal stories and contextual history, across the range of over a century of blues music.',' Blues Doctor Julie, Sugar Brown, and Brooke Blackburn','https://ciut.fm/shows/calling-all-blues/',NULL,'callingallblues@ciut.fm',3600,'ciut-calling-all-blues'),(257,'Psychedelic/Stoner Rock Extravaganza','ciut','https://ciut.fm/wp-content/uploads/2021/08/psychedelic-300x205.jpg','An uninterrupted mix of recent, new and modern psychedelic and stoner rock sounds for your ears and mind.',NULL,'https://ciut.fm/shows/psychedelic-stoner-rock-extravaganza/',NULL,'ken.stowar@ciut.fm',7200,'ciut-psychedelic-stoner-rock-extravaganza'),(280,'Tracks From Abroad','ciut','https://ciut.fm/wp-content/uploads/2021/11/Thumbnail-copy-300x290.png','Tracks From Abroad amplifies diverse voices at the University of Toronto through international music and open-minded discussion. We feature weekly interviews with international students, U of T professors, and local artists to learn more about the multicultural city of Toronto, Canada.',' Jesse McDougall','https://ciut.fm/shows/tracks-from-abroad/',NULL,'tracksfromabroad@ciut.fm',3600,'ciut-tracks-from-abroad'),(289,'The Next Stop','ciut','https://ciut.fm/wp-content/uploads/2022/05/Sage-CIUT.jpg','The Next Stop is the soundtrack to your night. Each episode follows a loose theme that draws from film scores and explores music from a wide range of genres and regions. We\'ll travel from 90\'s Boom-Bap to Space Age Pop to Tuareg Desert Blues to Peruvian Cumbia to 19th Century folk songs to celestial ambient tracks and everything in between for 2 hours every week.',' Sage Ranaldo','https://ciut.fm/shows/the-next-stop/',NULL,'thenextstop@ciut.fm',7200,'ciut-the-next-stop'),(292,'The Cool Side of the Pillow','ciut','https://ciut.fm/wp-content/uploads/2022/03/cool-side-of-the-pillow.png','Join us each Friday afternoon from 1-3 pm for The Cool Side of the Pillow . The program features a wide array of sound encompassing relaxing, chill, ambient, positive vibrations and much more all curated by Lydia. The program repeats on Sunday night at midnight until 2 am.',NULL,'https://ciut.fm/shows/the-cool-side-of-the-pillow/',NULL,'ken.stowar@ciut.fm',7200,'ciut-the-cool-side-of-the-pillow'),(296,'The Third Face','ciut','https://ciut.fm/wp-content/uploads/2021/12/3rdface.jpg','The Third Face is commonly known as \"the face you hide from the world\" but this show is anything but an existential statement. The show is meant to bring new tracks to light that awaken the joy of discovering new music as an exciting hobby, or an hourly distraction!',' Victor Kovaleski','https://ciut.fm/shows/the-third-face/',NULL,'thethirdface@ciut.fm',3600,'ciut-the-third-face'),(1060,'Fridays at Five','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/a-dogs-breakfast-3.jpg','Discover emerging art and artists in Guelph while they showcase their personalities through interviews and games!','Amara Sheppard','https://www.cfru.ca/?s=Fridays%20at%20Five&posttype_search=mcm_recording','','',3600,NULL),(1163,'Parallel Careers','cfru','https://www.cfru.ca/wp-content/uploads/2022/02/Parallel-Careers-Podcast-Image.jpg','<p>Parallel Careers is a show for creative writers—and the writers who teach them. The show features Canadian writers who are at the top of their game in both craft and pedagogy. Tune in to hear the big ideas and practical tips they take into their classrooms and their own craft.</p><p>Credits/team: Parallel Careers is produced by Claire Tacon, in partnership with The New Quarterly literary magazine. Erin MacIndoe Sproule is our Technical Producer and Story Editor. Music composed by Amadeo Ventura. Financial and in-kind support provided by the The Region of Waterloo Arts Fund, St. Jerome’s University, and the Government of Canada.</p>','','https://www.cfru.ca/?s=Parallel%20Careers&posttype_search=mcm_recording','','',3600,'cfru-parallel-careers'),(1321,'Hong Kong Student Radio Association','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Hong-Kong-Student-Radio-Association.jpg','<p>Discussions, interviews and community news in Cantonese and English.</p>','Various','https://www.cfru.ca/?s=Hong%20Kong%20Student%20Radio%20Association&posttype_search=mcm_recording','','hongkong@uoguelph.ca',3600,'cfru-hong-kong-student-radio-association'),(1344,'Beautiful Druid','cfru','https://www.cfru.ca/wp-content/uploads/2020/09/863F24D6-A669-47DB-9BD5-348BA141211A-1.jpeg','<p>Join host Alden Hadwen for a relaxed Sunday morning mix of music and poetry – for the day which we often set aside for pursuits close to our hearts. Whatever the activities you have planned, this program will give you a thoughtful start with some poetry to savour and some mellow music to set the tone – singer songwriters, jazz, classical and folk music tracks that you do not hear every day. This is a show for the garden of your mind; philosophical musings, letting your mind drift in the wind and the willows of beautiful music and words, all to go with a great cup of coffee and a slow easy start to the day.</p>','Alden Hadwen','https://www.cfru.ca/?s=Beautiful%20Druid&posttype_search=mcm_recording','','',3600,'cfru-beautiful-druid'),(1437,'Democracy Now','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/democracy-now.jpg','<p>With award-winning journalists Amy Goodman and Juan Gonzalez, Democracy Now is a national, daily, independent, award-winning news program airing on over 140 stations in North America.</p>','Amy Goodman','https://www.cfru.ca/?s=Democracy%20Now&posttype_search=mcm_recording','http://www.democracynow.org/','',3600,'cfru-democracy-now'),(1438,'Worst Responders','cfru','https://www.cfru.ca/wp-content/uploads/2023/03/Worst-Responders-temporary-image.jpg','<p>Relationship troubles, work drama, or complicated life stuff that you just</p>','Renee and Charissa','https://www.cfru.ca/?s=Worst%20Responders&posttype_search=mcm_recording','','',3600,'cfru-worst-responders'),(1447,'Rainbow Country','cfru','https://www.cfru.ca/wp-content/uploads/2021/05/CFRU-RC-BANNER-1.jpg','<p>Mark Tara is your guide through RAINBOW COUNTRY, a show that offers a blend of music & interviews giving voice to the LGBT community</p>','Mark Tara','https://www.cfru.ca/?s=Rainbow%20Country&posttype_search=mcm_recording','http://www.marktara.com/','rainbowcountry@ciut.fm',3600,'cfru-rainbow-country'),(1451,'What Do You Know?','cfru','','<p>Long-form interviews!</p>','Gaon','https://www.cfru.ca/?s=What%20Do%20You%20Know%3F&posttype_search=mcm_recording','','',3600,'cfru-what-do-you-know'),(1453,'Silver Screen Dream Machine','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Silver-Screen-Dream-Machine.jpg','<p>Silver Screen Dream Machine is a collective approach to anything and everything to do with cinema, through interviewing people in and around the community who are involved with independent cinema, movie reviews and Bookshelf Cinema listings. We are always looking for contributors, so contact us if you are interested!</p>','Electrified Voltage and Boston Carlyle','https://www.cfru.ca/?s=Silver%20Screen%20Dream%20Machine&posttype_search=mcm_recording','','silverscreen@cfru.ca',3600,'cfru-silver-screen-dream-machine'),(1455,'Down the Rabbit Hole','cfru','https://www.cfru.ca/wp-content/uploads/2023/03/istockphoto-1302337885-612x612-1.jpeg','<p>Down the Rabbit Hole! Each week we’ll be looking at an artist and going down the rabbit hole of their musical journey! Whether this is through listening to their influences, checking out similar artists they’ve worked with, or exploring other musicians who may have been influenced themselves, the goal of this show is to showcase the million little threads that connect musicians in the industry!</p>','Hans Haryanto','https://www.cfru.ca/?s=Down%20the%20Rabbit%20Hole&posttype_search=mcm_recording','','',3600,'cfru-down-the-rabbit-hole'),(1464,'Gryphon And Special Olympics Sports Show','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Gryphon-And-Special-Olympics-Sports-Show.jpg','<p>There are sports to report, and Boston and Taylor have a boatload of things you’ve got to hear! It’s a free form celebration of sports and songs from all eras and styles, including hot new releases from local and Canadian artists. Don’t miss this dynamic team in action!</p>','Taylor and Boston Carlyle','https://www.cfru.ca/?s=Gryphon%20And%20Special%20Olympics%20Sports%20Show&posttype_search=mcm_recording','','bostoncarlyle@gmail.com',3600,'cfru-gryphon-and-special-olympics-sports-show'),(1491,'Industry Tactics','cfru','https://www.cfru.ca/wp-content/uploads/2023/02/industry-tactics.jpg','<p>Join Friendly Rich as he interviews some of the finest outsiders in Canadian music!</p>','Friendly Rich','https://www.cfru.ca/?s=Industry%20Tactics&posttype_search=mcm_recording','','',3600,'cfru-industry-tactics'),(1528,'Alternative Radio','ciut','https://ciut.fm/wp-content/uploads/2020/05/David-Barsamian.jpg','Alternative Radio, established in 1986, is a weekly one-hour public affairs program offered free to all public radio stations in the US, Canada, Europe and beyond. AR provides information, analyses and views that are frequently ignored or distorted in other media.',' David Barsamian','https://ciut.fm/shows/alternative-radio/',NULL,NULL,3600,'ciut-alternative-radio'),(1551,'Moovin\' In the Right Direction','ciut','https://ciut.fm/wp-content/uploads/2020/06/IMG_0709-rotated.jpg','Heard every Thursday, the program features established and emerging talent both locally and internationally with a prime focus on independent Electronic music. Through guest DJ sets, artist interviews, event previews and reviews, emerging artists share the same platform with established ones creating a unique experience challenging the status quo in radio.',' David James','https://ciut.fm/shows/moovin-in-the-right-direction/',NULL,'moovinintherightdirection@ciut.fm',10800,'ciut-moovin-in-the-right-direction'),(1556,'The Green Majority','ciut','https://ciut.fm/wp-content/uploads/2020/10/tgm_hof.jpg','David Hostetter summarizes and combines news items and articles to create an audible admixture of elixirs and toxins. When not working on The Green Majority he is trying to convince Stefan to worship the sun and moon.',NULL,'https://ciut.fm/shows/the-green-majority/','http://www.greenmajority.ca/','greenmajority@ciut.fm',3600,'ciut-the-green-majority'),(1586,'What Do You Do?','cfru','https://www.cfru.ca/wp-content/uploads/2023/03/What-Do-You-Do-Logo.png','<p>People all around us are unique. We each carry a hidden gem waiting to be uncovered by asking the right questions. So, on our show, we’ll be interviewing people of different career and educational paths to discover their unique experiences.</p>','Gaon','https://www.cfru.ca/?s=What%20Do%20You%20Do%3F&posttype_search=mcm_recording','','',3600,'cfru-what-do-you-do'),(1591,'New or Never','cfru','https://www.cfru.ca/wp-content/uploads/2023/04/New-or-Never-show-image.jpeg','<p>‘New or Never’ sorts its eclectic musical selections by recency, playing only new releases from the CFRU library. Host Adrian Hoad-Reddick and collaborators cuddle up to now with features on anything newly released to the world (books, words, memes, theories, concepts…)</p>','Adrian Hoad-Reddick','https://www.cfru.ca/?s=New%20or%20Never&posttype_search=mcm_recording','http://www.hoadworks.com/new-or-never.html','',3600,'cfru-new-or-never'),(1608,'Uncool','cfru','https://www.cfru.ca/wp-content/uploads/2023/04/Uncool-Image.jpeg','<p>A playlist baby’s mocktail of sonic flavours and interviews. Shaken, not stirred.</p>','Cole Cooper','https://www.cfru.ca/?s=Uncool&posttype_search=mcm_recording','','',3600,'cfru-uncool'),(1615,'Off the Beaten Track','cfru','https://www.cfru.ca/wp-content/uploads/2023/04/off-the-beaten-track-promo-image-may-2023.png','','Jean','https://www.cfru.ca/?s=Off%20the%20Beaten%20Track&posttype_search=mcm_recording','https://www.instagram.com/offbeatsjean/','sofreshsojean@outlook.com',3600,'cfru-off-the-beaten-track'),(1620,'Hellfire Radio','cfru','','<p>Always electrifying the airwaves! (Even more than usual, we mean …)</p>','Saxon and Leonard Skwozen','https://www.cfru.ca/?s=Hellfire%20Radio&posttype_search=mcm_recording','','',3600,'cfru-hellfire-radio'),(1627,'Jitterbuggin','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/Jitterbuggin.jpg','<p>We take a 16oz prime cut of Lindy Hop, season with some East Coast Swing and Jive. Slow cook till it just falls off the bone! Comes complete with our special poutine; (fresh cut Rock & Roll, chunks of R&B and smothered in rich thick Rockabilly). Served with a mug of ice cool Canadian talent. Visit us at “Jitterbuggin” where you’ll enjoy the platters and dance all the way through.</p>','Adrian Jaye','https://www.cfru.ca/?s=Jitterbuggin&posttype_search=mcm_recording','','AdrianJaye@yahoo.ca',3600,'cfru-jitterbuggin'),(1628,'Indigenous Musicians playlist!','cfru','','<p>On July 1, CFRU Radio will feature playlists of music by Indigenous artists from 8 to 9 am and from 10 am to noon.</p>','','https://www.cfru.ca/?s=Indigenous%20Musicians%20playlist%21&posttype_search=mcm_recording','','',3600,'cfru-indigenous-musicians-playlist'),(1783,'Under the Needle','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/KEXP-Under-the-Needle.jpg','<p>A syndicated program from KEXP!</p>','Troy Nelson','https://www.cfru.ca/?s=Under%20the%20Needle&posttype_search=mcm_recording','http://kexp.org/programs/undertheneedle','',3600,'cfru-under-the-needle'),(2205,'Samaismela Music Show + CFRU Playlist','cfru','','<p>Tune in to CFRU from about 5 to 5:40 pm for a Samaismela Music Show playlist, followed by random tracks from CFRU’s library up to the top of the hour.</p>','','https://www.cfru.ca/?s=Samaismela%20Music%20Show%20%2B%20CFRU%20Playlist&posttype_search=mcm_recording','','',3600,'cfru-samaismela-music-show-cfru-playlist'),(2653,'Solipsistic Retreat','cfru','https://www.cfru.ca/wp-content/uploads/2023/08/Solipsistic-Retreat.jpg','<p>SR is an algorithmically-determined post-genre music-festival in-the-morning.</p>','Justin Grignon','https://www.cfru.ca/?s=Solipsistic%20Retreat&posttype_search=mcm_recording','','',3600,'cfru-solipsistic-retreat'),(2678,'CFRU Prisoners’ Justice Day programming','cfru','','<p>Tune in to CFRU Radio from noon to 1 pm on Thursday, August 10, for Prisoners’ Justice Day programming. Prisoners’ Justice Day is the day prisoners have set aside as a day to fast and refuse to work in a show of solidarity to remember those who have died unnecessarily — victims of murder, suicide and neglect. The date was chosen in memory of Eddie Nolan, who bled to death in his cell in Millhaven on August 10, 1974, due to the negligence of the prison system.</p>','Various','https://www.cfru.ca/?s=CFRU%20Prisoners%26%238217%3B%20Justice%20Day%20programming&posttype_search=mcm_recording','','',3600,'cfru-cfru-prisoners-justice-day-programming'),(2778,'CFRU Live from Riverfest Elora!','cfru','','<p>Tune in to CFRU Radio from 2 to 7 pm on both Saturday, August 19, and Sunday, August 20, for our annual live broadcast from Riverfest Elora! Various CFRU programmers will be spinning tunes from onsite. For more information about Riverfest, check out riverfestelora.com!</p>','Various','https://www.cfru.ca/?s=CFRU%20Live%20from%20Riverfest%20Elora%21&posttype_search=mcm_recording','','',3600,'cfru-cfru-live-from-riverfest-elora'),(3033,'A Multilingual Affair','cfru','https://www.cfru.ca/wp-content/uploads/2023/08/AMA-Aligned-Again.jpg','<p>Inspirational music and inspirational words in English, French, and Spanish!</p>','Takeyce','https://www.cfru.ca/?s=A%20Multilingual%20Affair&posttype_search=mcm_recording','','',3600,'cfru-a-multilingual-affair'),(3291,'CFRU Move-In Day Broadcasts!','cfru','','<p>CFRU is broadcasting live from Branion Plaza for the University of Guelph’s Move-In Days, 10 am to 5 pm on Friday, September 1, and Saturday, September 2! Tune in to hear CFRU programmers hosting live from just outside the University Centre at the University of Guelph!</p>','Various','https://www.cfru.ca/?s=CFRU%20Move-In%20Day%20Broadcasts%21&posttype_search=mcm_recording','','',3600,'cfru-cfru-move-in-day-broadcasts'),(3445,'Bike the Night!','cfru','','<p>Tune in to CFRU Radio from 7 to 10 pm on Saturday, September 9, for a live broadcast from Bike the Night in downtown Guelph.</p>','CFRU','https://www.cfru.ca/?s=Bike%20the%20Night%21&posttype_search=mcm_recording','','',3600,'cfru-bike-the-night'),(3686,'Volunteer Playlist','cfru','https://www.cfru.ca/wp-content/uploads/2023/09/Volunteer-Playlist.png','<p>Tune in for a playlist of tracks from CFRU’s new release library, curated by one of CFRU’s volunteers!</p>','A CFRU volunteer!','https://www.cfru.ca/?s=Volunteer%20Playlist&posttype_search=mcm_recording','','',3600,'cfru-volunteer-playlist'),(3689,'CFRU Live at Clubs Days!','cfru','','<p>Join CFRU Radio live from Clubs Days at the University of Guelph from 1 to 3 pm on Monday, September 18, and noon to 2 pm on Tuesday, September 19!</p>','Various','https://www.cfru.ca/?s=CFRU%20Live%20at%20Clubs%20Days%21&posttype_search=mcm_recording','','',3600,'cfru-cfru-live-at-clubs-days'),(8658,'Night Beach','cfru','https://www.cfru.ca/wp-content/uploads/2018/09/CFRU-Rebroadcast.jpg','<p>An eclectic mix from musicians Lisa Conway (LCON) and Andrew Collins (AMC Gremlin).</p>','Andrew Collins and Lisa Conway','https://www.cfru.ca/?s=Night%20Beach&posttype_search=mcm_recording','','',3600,'cfru-night-beach'),(9234,'Art Not Shame Panel Discussion','cfru','','<p>Tune in to CFRU Radio from 1 to 2 pm on Monday, September 25, for a panel discussion from the Art Not Shame Mural Display public event recorded earlier this year.</p>','Various/CFRU','https://www.cfru.ca/?s=Art%20Not%20Shame%20Panel%20Discussion&posttype_search=mcm_recording','','',3600,'cfru-art-not-shame-panel-discussion'),(12585,'CFRU Mobile Community Radio Show','cfru','https://www.cfru.ca/wp-content/uploads/2018/04/CFRU-Mobile-Community-Radio-Show.jpg','<p>The Mobile Community Radio Show is a show dedicated to broadcasting the stories, perspectives and performances collected and recorded at neighbourhoods throughout Guelph, as part of CFRU 93.3 FM’s mobile studio project.</p>','Jenny Mitchell','https://www.cfru.ca/?s=CFRU%20Mobile%20Community%20Radio%20Show&posttype_search=mcm_recording','','',3600,'cfru-cfru-mobile-community-radio-show'),(13298,'CFRU Selector','cfru','https://www.cfru.ca/wp-content/uploads/2023/09/CFRU-Selector-crop.jpg','<p>Tune in to the CFRU Selector, featuring a selection of tracks from the newest additions to CFRU’s music library!</p>','Various/CFRU','https://www.cfru.ca/?s=CFRU%20Selector&posttype_search=mcm_recording','','',3600,'cfru-cfru-selector'),(13307,'Eclectic Selections','cfru','https://www.cfru.ca/wp-content/uploads/2023/09/Karim-Eclectic-selections-1.jpg','','Karim Mosna','https://www.cfru.ca/?s=Eclectic%20Selections&posttype_search=mcm_recording','','',3600,'cfru-eclectic-selections'),(14544,'National Day for Truth and Reconciliation','cfru','','<p>Tune in to CFRU Radio on September 30 from 11 am to 8 pm for programming in recognition of the National Day for Truth and Reconciliation!</p>','various','https://www.cfru.ca/?s=National%20Day%20for%20Truth%20and%20Reconciliation&posttype_search=mcm_recording','','',3600,'cfru-national-day-for-truth-and-reconciliation'),(16921,'CSA Election Forum!','cfru','','<p>Tune in to CFRU Radio from noon to 1 pm on Thursday, October 5, for live coverage of the Central Student Association’s 2023 election forum!</p>','CFRU','https://www.cfru.ca/?s=CSA%20Election%20Forum%21&posttype_search=mcm_recording','','',3600,'cfru-csa-election-forum'),(30061,'IF 2023','cfru','','<p>Tune in to CFRU Radio from 2 to 7 am on Saturday, October 21, 2023, for featured content from the Improvisation Festival 2023!</p>','various','https://www.cfru.ca/?s=IF%202023&posttype_search=mcm_recording','https://improvfest.ca/','IMPROVFEST@UOGUELPH.CA',3600,'cfru-if-2023'),(35978,'CFRU Live from 10C!','cfru','','<p>Tune in to CFRU Radio from 11 am to 4 pm on Saturday, October 28, for a live broadcast from 10C in downtown Guelph! Various CFRU volunteers will be interviewing people for 10C’s 15th Birthday Celebration!</p>','CFRU','https://www.cfru.ca/?s=CFRU%20Live%20from%2010C%21&posttype_search=mcm_recording','','',3600,'cfru-cfru-live-from-10c'),(37839,'Feeding Tummies and Souls','cfru','','<p>Tune in to CFRU Radio from 1 to 2:45 pm on Monday, October 30, for a special broadcast of the Feeding Tummies and Souls event!</p>','CFRU','https://www.cfru.ca/?s=Feeding%20Tummies%20and%20Souls&posttype_search=mcm_recording','','',3600,'cfru-feeding-tummies-and-souls'),(38498,'CFR Booo!','cfru','','<p>Tune in to CFRU from noon to 5 pm on October 31 for the annual CFR Booo! Hallowe’en special!</p>','CFRU','https://www.cfru.ca/?s=CFR%20Booo%21&posttype_search=mcm_recording','','',3600,'cfru-cfr-booo'),(38669,'NOSFERATU!','cfru','','<p>NOSFERATU!</p>','','https://www.cfru.ca/?s=NOSFERATU%21&posttype_search=mcm_recording','','',3600,'cfru-nosferatu');
